(2, 'DokladViewReklamacia', ',(IF(Stav=''Prijata'',''Brown'',(IF(Stav=''Odoslana'',''Orange'',(IF(Stav=''Vybavena'',(IF(ReklamaciaVybavena=1,''LightGreen'',''LightBlue'')),''LightGreen'')))))) as `col_background_color`, (IF(Stav=''Prijata'',''White'',(IF(Stav=''Odoslana'',''Black'',(IF(Stav=''Vybavena'',(IF(ReklamaciaVybavena=1,''Black'',''Black'')),''Black'')))))) as `col_foreground_color`'),
(3, 'DokladViewObjednavka', ',(IF(Stav=0,''Red'',''LightGreen'')) as `col_background_color`, (IF(Stav=0,''White'',''Black'')) as `col_foreground_color`'),
(6, 'SkladovaKartaView', ',if(((select count(*) from `blueticket`.`skladovakartazlozenie` where (`blueticket`.`skladovakartazlozenie`.`RC` = `blueticket`.`skladovakartalookupview`.`RegistracneCislo`)) > 0),''orange'',''white'') AS `col_background_color`,(''black'') AS `col_foreground_color`'),
(5, 'SkladovaKartaViewTWO WINGS, s.r.o.', ',if(((select count(*) from `blueticket`.`skladovakartazlozenie` where (`blueticket`.`skladovakartazlozenie`.`RC` = `blueticket`.`skladovakartalookupview`.`RegistracneCislo`)) > 0),''orange'',''white'') AS `col_background_color`,(''black'') AS `col_foreground_color`'),
(7, 'KosikView', ',if( RegistracneCislo = -1,''red'',''white'') AS `col_background_color`,if( RegistracneCislo = -1,''white'',''black'') AS `col_foreground_color`'),
(8, 'DokladViewDodaci list BA', ',if(((dokladview.CisTypDokladuId=91 OR dokladview.CisTypDokladuId=92) AND (SELECT COUNT(*) FROM doklad WHERE doklad.Odvolavka=dokladview.KodDokladu and doklad.CisTypDokladuId!=5)>0),''lightgreen'', if((dokladview.CisTypDokladuId=91 OR dokladview.CisTypDokladuId=92),''lightblue'',''white'')) as `col_background_color`, ''black'' as `col_foreground_color`'),
(9, 'DokladViewDodaci list KE', ',if(((dokladview.CisTypDokladuId=90 OR dokladview.CisTypDokladuId=93) AND (SELECT COUNT(*) FROM doklad WHERE doklad.Odvolavka=dokladview.KodDokladu and doklad.CisTypDokladuId!=5)>0),''lightgreen'', IF((dokladview.CisTypDokladuId=90 OR dokladview.CisTypDokladuId=93),''lightblue'',''white'')) as `col_background_color`, ''black'' as `col_foreground_color`');
