(50, 'SKInventorySnack', 'Vytvorit inventurny supis - Snack', NULL, 'SQL', '<?php\r\r\n$zauctovane = 0;\r\r\n\r\r\n$query = "INSERT INTO Inventura(Datum, Poznamka, Aktivna) VALUES(NOW(),''Inventura Snack-3'', 1)";\r\r\nmysql_query($query);\r\r\n\r\r\n$lastid = mysql_insert_id();\r\r\n$query = "INSERT INTO InventurnySupis(CiarovyKod, RegistracneCislo, KartaID, KratkyNazov, PredajnaCena, NakupnaCena, EvidencneMnozstvo, SkutocneMnozstvo, InventuraID) SELECT CiarovyKod, RegistracneCislo, ID, Nazov, PredajnaCena3, NakupnaCenaBezDPH, AktualnaZasoba, 0, " . $lastid . " FROM SkladovaKartaFullView3 WHERE (CisStavId=3 OR CisStavId=5 OR CisStavId=9) AND Stredisko3=1 ORDER BY TovarovaSkupinaID, Nazov";\r\r\n\r\n$zauctovane = mysql_query($query);\r\r\n\r\r\necho $zauctovane . '' vytvorenych inventurnych supisov. Cislo Inventury : '' . $lastid;\r\r\n\r\r\n?>'),
(65, 'SKInventoryKaviaren', 'Vytvorit inventurny supis - Kaviaren', NULL, 'SQL', '<?php\r\r\n$zauctovane = 0;\r\r\n\r\r\n$query = "INSERT INTO Inventura(Datum, Poznamka, Aktivna) VALUES(NOW(),''Inventura Kaviaren-2'', 1)";\r\r\nmysql_query($query);\r\r\n\r\r\n$lastid = mysql_insert_id();\r\r\n\r\r\n$query = "INSERT INTO InventurnySupis(CiarovyKod, RegistracneCislo, KartaID, KratkyNazov, PredajnaCena, NakupnaCena, EvidencneMnozstvo, SkutocneMnozstvo, InventuraID) SELECT CiarovyKod, RegistracneCislo, ID, Nazov, PredajnaCena2, NakupnaCenaBezDPH, AktualnaZasoba, 0, " . $lastid . " FROM SkladovaKartaFullView2 WHERE (CisStavId=3 OR CisStavId=5 OR CisStavId=9) AND Stredisko2=1 ORDER BY TovarovaSkupinaID, Nazov";\r\r\n$zauctovane = mysql_query($query);\r\r\n\r\r\necho $zauctovane . '' vytvorenych inventurnych supisov. Cislo Inventury : '' . $lastid;\r\r\n\r\r\n?>'),
(51, 'TSInventory', 'Inventura tovarovych skupin', NULL, 'SQL', '<?php\r\r\n$zauctovane = 0;\r\r\n\r\r\n$query = "INSERT INTO Inventura(Datum, Poznamka, Aktivna) VALUES(NOW(),''Inventura vytvorena zo zoznamu skladovych kariet'', 1)";\r\r\nmysql_query($query);\r\r\n\r\r\n$lastid = mysql_insert_id();\r\r\n\r\r\nforeach(explode(''|'',$_REQUEST[''Arguments'']) as $valueall)\r\r\n{\r\r\n	$z = 0;\r\r\n	$found = 0;\r\r\n	foreach(explode(''^^^'',$valueall) as $key=>$value)\r\r\n	{\r\r\n		if( $z == 0 )\r\r\n		{\r\r\n			$z = $z+1;\r\r\n			if( $value=="ID" )\r\r\n			{\r\r\n				$found = 1;\r\r\n			}\r\r\n		}\r\r\n		else\r\r\n		{\r\r\n			$z = 0;\r\r\n			if( $found == 1 )\r\r\n			{\r\r\n				$found = 0;\r\r\n				$query = "INSERT INTO InventurnySupis(CiarovyKod, RegistracneCislo, KartaID, KratkyNazov, PredajnaCena, NakupnaCena, EvidencneMnozstvo, SkutocneMnozstvo, InventuraID) SELECT CiarovyKod, RegistracneCislo, ID, KratkyNazov, PredajnaCena, NakupnaCenaBezDPH, AktualnaZasoba, 0, " . $lastid . " FROM SkladovaKartaListView WHERE TovarovaSkupinaId=" . $value;\r\r\n				mysql_query($query);\r\r\n				$zauctovane = $zauctovane + 1;\r\r\n			}\r\r\n		}\r\r\n	}\r\r\n}\r\r\n\r\r\necho ''Cislo Inventury : '' . $lastid;\r\r\n\r\r\n?>'),
(52, 'PartnerInventory', 'Inventura partnerov', NULL, 'SQL', '<?php\r\r\n$zauctovane = 0;\r\r\n\r\r\n$query = "INSERT INTO Inventura(Datum, Poznamka, Aktivna) VALUES(NOW(),''Inventura vytvorena zo zoznamu skladovych kariet'', 1)";\r\r\nmysql_query($query);\r\r\n\r\r\n$lastid = mysql_insert_id();\r\r\n\r\r\nforeach(explode(''|'',$_REQUEST[''Arguments'']) as $valueall)\r\r\n{\r\r\n	$z = 0;\r\r\n	$found = 0;\r\r\n	foreach(explode(''^^^'',$valueall) as $key=>$value)\r\r\n	{\r\r\n		if( $z == 0 )\r\r\n		{\r\r\n			$z = $z+1;\r\r\n			if( $value=="ID" )\r\r\n			{\r\r\n				$found = 1;\r\r\n			}\r\r\n		}\r\r\n		else\r\r\n		{\r\r\n			$z = 0;\r\r\n			if( $found == 1 )\r\r\n			{\r\r\n				$found = 0;\r\r\n				$query = "INSERT INTO InventurnySupis(CiarovyKod, RegistracneCislo, KartaID, KratkyNazov, PredajnaCena, NakupnaCena, EvidencneMnozstvo, SkutocneMnozstvo, InventuraID) SELECT CiarovyKod, RegistracneCislo, ID, KratkyNazov, PredajnaCena, NakupnaCenaBezDPH, AktualnaZasoba, 0, " . $lastid . " FROM SkladovaKartaListView WHERE CisPartnerHlavnyId=" . $value;\r\r\n				mysql_query($query);\r\r\n				$zauctovane = $zauctovane + 1;\r\r\n			}\r\r\n		}\r\r\n	}\r\r\n}\r\r\n\r\r\necho ''Cislo Inventury : '' . $lastid;\r\r\n\r\r\n?>'),
(53, 'InventoryItemsDelete', 'Vymazat polozky', NULL, 'SQL', '<?php\r\r\n$zauctovane = 0;\r\r\n\r\r\nforeach(explode(''|'',$_REQUEST[''Arguments'']) as $valueall)\r\r\n{\r\r\n	$z = 0;\r\r\n	$found = 0;\r\r\n	foreach(explode(''^^^'',$valueall) as $key=>$value)\r\r\n	{\r\r\n		if( $z == 0 )\r\r\n		{\r\r\n			$z = $z+1;\r\r\n			if( $value=="ID" )\r\r\n			{\r\r\n				$found = 1;\r\r\n			}\r\r\n		}\r\r\n		else\r\r\n		{\r\r\n			$z = 0;\r\r\n			if( $found == 1 )\r\r\n			{\r\r\n				$found = 0;\r\r\n				$query = "DELETE FROM InventurnySupis WHERE ID=" . $value;\r\r\n				mysql_query($query);\r\r\n				$zauctovane = $zauctovane + 1;\r\r\n			}\r\r\n		}\r\r\n	}\r\r\n}\r\r\n\r\r\necho ''Odstranenych zaznamov : '' . $zauctovane;\r\r\n\r\r\n?>'),
(54, 'InventoryUpdate', 'Zauctovat inventuru', NULL, 'SQL', '<?php\r\n\r\n$zauctovane = 0;\r\n$inventuraid = 0;\r\n\r\n\r\nforeach (explode(''|'', $_REQUEST[''Arguments'']) as $valueall) {\r\n    $z = 0;\r\n    $found = 0;\r\n    foreach (explode(''^^^'', $valueall) as $key => $value) {\r\n        if ($z == 0) {\r\n            $z = $z + 1;\r\n            if ($value == "ID") {\r\n                $found = 1;\r\n            }\r\n        } else {\r\n            $z = 0;\r\n            if ($found == 1) {\r\n                $result = mysql_query("SELECT Poznamka,Datum, FileName FROM Inventura WHERE ID=$value");\r\n                $inventuraid = $value;\r\n                $poznamka_row = mysql_fetch_assoc($result);\r\n                $poznamka = $poznamka_row[''Poznamka''];\r\n                $datuminv = $poznamka_row[''Datum''];\r\n                $verzia = $poznamka_row[''FileName''];\r\n\r\n                mysql_free_result($result);\r\n\r\n                if ($verzia == ''Inventura_2'') {\r\n                    $query = "INSERT INTO Doklad(KodDokladu,DatumVystavenia,CisTypDokladuId, Poznamka) VALUES((SELECT Cislo FROM CisCiselneRady WHERE CisTypDokladuID=12),NOW(),32,''Automaticky ubytok z inventury'')";\r\n                    mysql_query($query);\r\n                    $lastidubytok = mysql_insert_id();\r\n\r\n                    $query = "INSERT INTO Doklad(KodDokladu,DatumVystavenia,CisTypDokladuId, Poznamka) VALUES((SELECT Cislo FROM CisCiselneRady WHERE CisTypDokladuID=11),NOW(),34,''Automaticky prirastok z inventury'')";\r\n                    mysql_query($query);\r\n                    $lastidprirastok = mysql_insert_id();\r\n\r\n                    $query = "UPDATE CisCiselneRady SET Cislo=Cislo+1 WHERE CisTypDokladuID=12";\r\n                    mysql_query($query);\r\n                    $query = "UPDATE CisCiselneRady SET Cislo=Cislo+1 WHERE CisTypDokladuID=11";\r\n                    mysql_query($query);\r\n\r\n\r\n                    mysql_query("UPDATE Doklad SET Poznamka=concat(''Ubytok - '',''$poznamka'','' - '', ''$datuminv''), DatumVystavenia=''$datuminv'' WHERE ID=$lastidubytok");\r\n                    mysql_query("UPDATE Doklad SET Poznamka=concat(''Prirastok - '',''$poznamka'','' - '', ''$datuminv''), DatumVystavenia=''$datuminv'' WHERE ID=$lastidprirastok");\r\n\r\n                    $result = mysql_query("SELECT RIGHT(Poznamka,1) as Stredisko FROM Inventura WHERE ID=$value");\r\n                    $stredisko_row = mysql_fetch_assoc($result);\r\n                    $stredisko = $stredisko_row[''Stredisko''];\r\n                    mysql_free_result($result);\r\n                    $found = 0;\r\n                    $query = "UPDATE InventurnySupis SET EvidencneMnozstvo=(SELECT AktualnaZasoba FROM SkladovaKartaFullView" . $stredisko . " WHERE SkladovaKartaFullView" . $stredisko . ".ID=InventurnySupis.KartaID) WHERE InventuraID=" . $value;\r\n                    //echo $query . "\\n";\r\n                    mysql_query($query);\r\n                    $query = "INSERT INTO Pohyb(RegistracneCislo, Nazov, CiarovyKod, DokladId, SkladovaKartaId, CisKodPohybuId, CennikovaCena, PredajnaCena, NakupnaCena, Mnozstvo, DPH, Datum, Aktivny, Multiplier, SkutocneMnozstvo, AktualnaZasoba, OvplyvnujeZasobu) SELECT RegistracneCislo, KratkyNazov, CiarovyKod, " . $lastidubytok . ", KartaID, 750" . $stredisko . ", 0" . $stredisko . ", PredajnaCena, NakupnaCena, (EvidencneMnozstvo-SkutocneMnozstvo), (SELECT DPH FROM SkladovaKartaListView WHERE ID=KartaID) AS DPH, Datum,1,-1,(EvidencneMnozstvo-SkutocneMnozstvo),EvidencneMnozstvo,1 FROM InventurnySupisView WHERE InventuraID=" . $value . " AND ((EvidencneMnozstvo-SkutocneMnozstvo)>0)";\r\n                    mysql_query($query);\r\n                    $query = "INSERT INTO Pohyb(RegistracneCislo, Nazov, CiarovyKod, DokladId, SkladovaKartaId, CisKodPohybuId, CennikovaCena, PredajnaCena, NakupnaCena, Mnozstvo, DPH, Datum, Aktivny, Multiplier, SkutocneMnozstvo, AktualnaZasoba, OvplyvnujeZasobu) SELECT RegistracneCislo, KratkyNazov, CiarovyKod, " . $lastidprirastok . ", KartaID, 850" . $stredisko . ", 0, PredajnaCena, NakupnaCena, (EvidencneMnozstvo-SkutocneMnozstvo)*(-1), (SELECT DPH FROM SkladovaKartaListView WHERE ID=KartaID) AS DPH, Datum,1,1,(EvidencneMnozstvo-SkutocneMnozstvo)*(-1),EvidencneMnozstvo,1 FROM InventurnySupisView WHERE InventuraID=" . $value . " AND ((EvidencneMnozstvo-SkutocneMnozstvo)<0)";\r\n                    mysql_query($query);\r\n                    mysql_query("UPDATE Doklad SET NakupnaCenaBezDPH=(Select SUM(NakupnaCena*(Mnozstvo*Multiplier)) FROM Pohyb WHERE Pohyb.DokladId=$lastidubytok), NakupnaCenaSDPH=(Select SUM((NakupnaCena*(1+(Pohyb.DPH/100)))*(Mnozstvo*Multiplier)) FROM Pohyb WHERE Pohyb.DokladId=$lastidubytok) WHERE ID=$lastidubytok");\r\n                    mysql_query("UPDATE Doklad SET NakupnaCenaBezDPH=(Select SUM(NakupnaCena*(Mnozstvo*Multiplier)) FROM Pohyb WHERE Pohyb.DokladId=$lastidprirastok), NakupnaCenaSDPH=(Select SUM((NakupnaCena*(1+(Pohyb.DPH/100)))*(Mnozstvo*Multiplier)) FROM Pohyb WHERE Pohyb.DokladId=$lastidprirastok) WHERE ID=$lastidprirastok");\r\n                    $query = "UPDATE Inventura SET FileName = ''Inventura_3'', Aktivna=0 WHERE ID=" . $value;\r\n                    mysql_query($query);\r\n                    $zauctovane = $zauctovane + 1;\r\n\r\n                    $query = "insert into inventurnysupis_backup SELECT * FROM InventurnySupis WHERE InventuraID = $inventuraid";\r\n                    mysql_query($query);\r\n                    $query = "update inventurnysupis_backup set Verzia = 3 where InventuraID = $inventuraid and Verzia = 1";\r\n                    mysql_query($query);\r\n                } else {\r\n                    $query = "UPDATE Inventura set FileName = ''Inventura_2'' WHERE ID = $inventuraid";\r\n                    mysql_query($query);\r\n                    $query = "insert into inventurnysupis_backup SELECT * FROM InventurnySupis WHERE InventuraID = $inventuraid";\r\n                    mysql_query($query);\r\n                    $query = "update inventurnysupis_backup set Verzia = 2 where InventuraID = $inventuraid and Verzia = 1";\r\n                    mysql_query($query);\r\n                }\r\n            }\r\n        }\r\n    }\r\n}\r\n\r\necho ''ID Vytvoreneho ubytku : '' . $lastidubytok;\r\necho '' / ID Vytvoreneho prirastku : '' . $lastidprirastok;\r\n?>'),
(55, 'SKRefresh', 'Obnovenie kariet', NULL, 'SQL', '<?php\r\r\n$zauctovane = 0;\r\r\n\r\r\n$query = "call refreshquery";\r\r\nmysql_query($query);\r\r\n\r\necho ''OK'';\r\n?>'),
(57, 'DokladStav1', 'Nastavit na vybavene', NULL, 'SQL', '<?php\r\n$zauctovane = 0;\r\n\r\nforeach(explode(''|'',$_REQUEST[''Arguments'']) as $valueall)\r\n{\r\n	$z = 0;\r\n	$found = 0;\r\n	foreach(explode(''^^^'',$valueall) as $key=>$value)\r\n	{\r\n		if( $z == 0 )\r\n		{\r\n			$z = $z+1;\r\n			if( $value=="ID" )\r\n			{				\r\n				$found = 1;\r\n			}\r\n		}\r\n		else\r\n		{\r\n			$z = 0;\r\n			if( $found == 1 )\r\n			{\r\n				$found = 0;\r\n				$query = "UPDATE Doklad SET Stav = 1 WHERE ID = " . $value;\r\n				mysql_query($query);\r\n				$zauctovane = $zauctovane + 1;\r\n			}\r\n		}\r\n	}\r\n}\r\n\r\necho ''Zmenenych poloziek: '' . $zauctovane;\r\n\r\n?>'),
(58, 'UpdatePos', 'Aktualizacia pokladni Restauracia, Snack, Kaviaren', NULL, 'SQL', '<?php\r\r\n$zauctovane = 0;\r\r\n\r\n$result = mysql_query(''SELECT * FROM SkladovaKarta'');\r\n\r\nwhile ($row=mysql_fetch_assoc($result))\r\n{\r\n	$vowelssk = array("ľ","š","č","ť","ž","ý","á","í","é","ä","ú","ň","ô","Ľ","Š","Č","Ť","Ž","Ý","Á","É","Ú","Ň","ď","Ď","ř","Ř","ě","Ě","ó","Ó","Â","°");\r\n	$vowelsen = array("l","s","c","t","z","y","a","i","e","a","u","n","o","L","S","C","T","Z","Y","A","E","U","N","d","D","r","R","e","E","o","O","","st");\r\n	$novy_nazov = str_replace($vowelssk, $vowelsen, $row[''KratkyNazov'']);\r\n	echo $novy_nazov . ''<br/>'';\r\n	mysql_query("UPDATE SkladovaKarta SET KratkyNazov=''" . $novy_nazov . "'' WHERE ID=" . $row[''ID'']);\r\n}\r\n\r\nmysql_free_result($result);\r\n\r\r\n$query = "call update_pos";\r\r\nmysql_query($query);\r\r\n\r\necho ''OK'';\r\n?>'),
