(62, 'PriraditZlavu', 'Zadat zlavu v percentach', NULL, 'SQL', '<?php\r\r\n$zauctovane = 0;\r\r\n$user_parameters = '''';\r\n\r\n\r\nforeach(explode(''|'',$_REQUEST[''Arguments'']) as $valueall)\r\r\n{\r\r\n	$z = 0;\r\n	$found = 0;\r\n	foreach(explode(''^^^'',$valueall) as $key=>$value)\r\r\n	{\r\r\n		if( $z == 0 )\r\r\n		{\r\r\n			$z = $z+1;\r\r\n			if( $value=="UserParameters" )\r\r\n			{\r\r\n				$found = 1;\r\r\n			}\r\r\n		}\r\r\n		else\r\r\n		{\r\r\n			$z = 0;\r\r\n			if( $found == 1 )\r\r\n			{\r\r\n				$found = 0;\r\n				$user_parameters = $value;\r\r\n			}\r\r\n		}\r\r\n	}\r\r\n}\r\r\n\r\n\r\r\nforeach(explode(''|'',$_REQUEST[''Arguments'']) as $valueall)\r\r\n{\r\r\n	$z = 0;\r\n	$found = 0;\r\n	foreach(explode(''^^^'',$valueall) as $key=>$value)\r\r\n	{\r\r\n		if( $z == 0 )\r\r\n		{\r\r\n			$z = $z+1;\r\r\n			if( $value=="ID" )\r\r\n			{\r\r\n				$found = 1;\r\r\n			}\r\r\n		}\r\r\n		else\r\r\n		{\r\r\n			$z = 0;\r\r\n			if( $found == 1 )\r\r\n			{\r\r\n				$found = 0;\r\n                                                                $user_parameters = 1 - ($user_parameters/100);\r\r\n				$query = "UPDATE Pohyb SET NakupnaCena=NakupnaCena*" . $user_parameters . " WHERE DokladId=" . $value;\r\r\n				mysql_query($query);\r\r\n				$zauctovane = $zauctovane + 1;\r\r\n			}\r\r\n		}\r\r\n	}\r\r\n}\r\r\n\r\r\necho ''Upravenych zaznamov : '' . $zauctovane;\r\r\n\r\r\n?>'),
(63, 'NahradZlozenie', 'Nahradit zlozenie z ...', 'Zadajte 5 registracnych cisel z ktorych si prajete nacitat zlozenie oddelene ciarkou v tvare: KOD1,KOD2,KOD3,KOD4,KOD5', 'SQL', '<?php\r\n\r\n$karta = '''';\r\n$zauctovane = 0;\r\n\r\n$user_parameters = '''';\r\n\r\n\r\nforeach (explode(''|'', $_REQUEST[''Arguments'']) as $valueall) {\r\n\r\n    $z = 0;\r\n    $found = 0;\r\n    foreach (explode(''^^^'', $valueall) as $key => $value) {\r\n\r\n        if ($z == 0) {\r\n\r\n            $z = $z + 1;\r\n\r\n            if ($value == "ID") {\r\n                $found = 2;\r\n            }\r\n\r\n            if ($value == "UserParameters") {\r\n                $found = 1;\r\n            }\r\n        } else {\r\n\r\n            $z = 0;\r\n\r\n            if ($found == 1) {\r\n                $found = 0;\r\n                $array_exp = explode('','', $value);\r\n                $kod1 = $array_exp[0];\r\n                $kod2 = $array_exp[1];\r\n                $kod3 = $array_exp[2];\r\n                $kod4 = $array_exp[3];\r\n                $kod5 = $array_exp[4];\r\n            }\r\n\r\n            if ($found == 2) {\r\n                $resultx = mysql_query("SELECT RegistracneCislo FROM SkladovaKarta WHERE ID=" . $value);\r\n                $rowx = mysql_fetch_assoc($resultx);\r\n                $karta = $rowx[''RegistracneCislo''];\r\n                mysql_free_result($resultx);\r\n\r\n                $found = 0;\r\n                $query = "DELETE FROM SkladovaKartaZlozenie WHERE RC=" . $karta;\r\n            }\r\n        }\r\n    }\r\n}\r\n$z = 0;\r\n\r\n$query = "INSERT INTO SkladovaKartaZlozenie(RC,ZlozeneZ,Mnozstvo,Kopia) SELECT " . $karta . ",ZlozeneZ,Mnozstvo,''" . $kod1 . "'' FROM SkladovaKartaZlozenie WHERE RC=''" . $kod1 . "''";\r\nmysql_query($query);\r\n$query = "INSERT INTO SkladovaKartaZlozenie(RC,ZlozeneZ,Mnozstvo,Kopia) SELECT " . $karta . ",ZlozeneZ,Mnozstvo,''" . $kod2 . "'' FROM SkladovaKartaZlozenie WHERE RC=''" . $kod2 . "''";\r\nmysql_query($query);\r\n$query = "INSERT INTO SkladovaKartaZlozenie(RC,ZlozeneZ,Mnozstvo,Kopia) SELECT " . $karta . ",ZlozeneZ,Mnozstvo,''" . $kod3 . "'' FROM SkladovaKartaZlozenie WHERE RC=''" . $kod3 . "''";\r\nmysql_query($query);\r\n$query = "INSERT INTO SkladovaKartaZlozenie(RC,ZlozeneZ,Mnozstvo,Kopia) SELECT " . $karta . ",ZlozeneZ,Mnozstvo,''" . $kod4 . "'' FROM SkladovaKartaZlozenie WHERE RC=''" . $kod4 . "''";\r\nmysql_query($query);\r\n$query = "INSERT INTO SkladovaKartaZlozenie(RC,ZlozeneZ,Mnozstvo,Kopia) SELECT " . $karta . ",ZlozeneZ,Mnozstvo,''" . $kod5 . "'' FROM SkladovaKartaZlozenie WHERE RC=''" . $kod5 . "''";\r\nmysql_query($query);\r\n\r\necho ''Dokoncene'';\r\n?>'),
