(110, 'UpdateKosik', 'Aktualizuj karty v kosiku', NULL, 'SQL', '<?\r\n\r\n$query = "UPDATE kosik set RegistracneCislo = (IF((SELECT COUNT(*) from skladovakarta WHERE (skladovakarta.CiarovyKod=kosik.CiarovyKod OR REPLACE(skladovakarta.CiarovyKod,''9'','''')=kosik.CiarovyKod))>0,(SELECT RegistracneCislo from skladovakarta WHERE (skladovakarta.CiarovyKod=kosik.CiarovyKod OR REPLACE(skladovakarta.CiarovyKod,''9'','''')=kosik.CiarovyKod) LIMIT 1),''-1'')), KratkyNazov = (IF((SELECT COUNT(*) from skladovakarta WHERE (skladovakarta.CiarovyKod=kosik.CiarovyKod OR REPLACE(skladovakarta.CiarovyKod,''9'','''')=kosik.CiarovyKod))>0,(SELECT Nazov from skladovakarta WHERE (skladovakarta.CiarovyKod=kosik.CiarovyKod OR REPLACE(skladovakarta.CiarovyKod,''9'','''')=kosik.CiarovyKod) LIMIT 1),''NOVY TOVAR'')), KartaID=(IF((SELECT COUNT(*) from skladovakarta WHERE (skladovakarta.CiarovyKod=kosik.CiarovyKod OR REPLACE(skladovakarta.CiarovyKod,''9'','''')=kosik.CiarovyKod))>0,(SELECT ID from skladovakarta WHERE (skladovakarta.CiarovyKod=kosik.CiarovyKod OR REPLACE(skladovakarta.CiarovyKod,''9'','''')=kosik.CiarovyKod) LIMIT 1),''-1'')) WHERE RegistracneCislo=-1";\r\n\r\nmysql_query($query);\r\n\r\necho ''Hotovo'';\r\n?>'),
(81, 'TlacStitkovSalaty', 'Tlac stitkov na salaty', 'Zadajte počet štítkov a dátum spotreby oddelené bodkočiarkou v tvare: Pocet;Datum', 'SHOW', '<?php\r\n\r\n$karta = '''';\r\n$zauctovane = 0;\r\n\r\n$user_parameters = '''';\r\n\r\n\r\nforeach(explode(''|'',$_REQUEST[''Arguments'']) as $valueall)\r\n\r\n{\r\n\r\n	$z = 0;\r\n	$found = 0;\r\n	foreach(explode(''^^^'',$valueall) as $key=>$value)\r\n\r\n	{\r\n\r\n		if( $z == 0 )\r\n\r\n		{\r\n\r\n			$z = $z+1;\r\n\r\n			if( $value=="ID" )\r\n			{\r\n				$found=2;\r\n			}\r\n\r\n			if( $value=="UserParameters" )\r\n			{\r\n				$found = 1;\r\n			}\r\n\r\n		}\r\n\r\n		else\r\n\r\n		{\r\n\r\n			$z = 0;\r\n\r\n			if( $found == 1 )\r\n\r\n			{\r\n				$found = 0;\r\n				$array_exp = explode('','',$value);\r\n				$user_parameters = $array_exp[0];\r\n				$spotreba = $array_exp[1];				\r\n			}\r\n\r\n			if( $found == 2 )\r\n\r\n			{\r\n				$found = 0;\r\n				$ID = $value;\r\n			}\r\n		}\r\n\r\n	}\r\n\r\n}\r\n			$z = 0;\r\n\r\n				$query = "DROP TABLE IF EXISTS _tlac_salaty";\r\n				mysql_query($query);\r\n\r\n				$query = "CREATE TABLE _tlac_salaty SELECT ID,Nazov,RegistracneCislo,(SELECT DlhyPopis FROM sk_description WHERE SkladovaKartaId=SkladovaKarta.ID) as Popis, ''" . $user_parameters . "'' as Pocet, ''salaty'' as NazovDokladu, ''" . $spotreba . "'' as Spotreba FROM SkladovaKarta WHERE ID=" . $ID;\r\n				mysql_query($query);\r\n\r\n				for($j=1;$j<$user_parameters;$j++)\r\n				{\r\n					$query = "INSERT INTO _tlac_salaty SELECT ID,Nazov,RegistracneCislo,(SELECT DlhyPopis FROM sk_description WHERE SkladovaKartaId=SkladovaKarta.ID) as Popis, ''" . $user_parameters . "'' as Pocet, ''salaty'' as NazovDokladu, ''" . $spotreba . "'' as Spotreba FROM SkladovaKarta WHERE ID=" . $ID;\r\n					mysql_query($query);\r\n				}\r\n\r\n				$query = "DELETE FROM _blueticket_forms WHERE FormName=''_tlac_salaty''";\r\n				mysql_query($query);\r\n				\r\n				$query = "DELETE FROM _blueticket_forms_fields WHERE FormName=''_tlac_salaty''";\r\n				mysql_query($query);\r\n\r\n				$query = "INSERT INTO _blueticket_forms(FormName,FormCaption,TableName) VALUES(''_tlac_salaty'',''Tlac stitkov na salaty'',''_tlac_salaty'')";\r\n				mysql_query($query);\r\n				\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_tlac_salaty'',''ID'',''ID'',1,1)";\r\n				mysql_query($query);\r\n\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_tlac_salaty'',''RegistracneCislo'',''Reg. cislo'',1,1)";\r\n				mysql_query($query);\r\n\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_tlac_salaty'',''Nazov'',''Nazov'',1,1)";\r\n				mysql_query($query);\r\n\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_tlac_salaty'',''Popis'',''Popis'',1,1)";\r\n				mysql_query($query);\r\n\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_tlac_salaty'',''NazovDokladu'',''Tlacovka'',1,1)";\r\n				mysql_query($query);\r\necho ''_tlac_salaty'';\r\n\r\n\r\n\r\n?>'),
(77, 'TSMyTest', 'Odbyt po dnoch', 'Zadajte číslo strediska', 'SHOW', '<?php\r\n\r\n$karta = '''';\r\n$zauctovane = 0;\r\n\r\n$user_parameters = '''';\r\n\r\n\r\nforeach(explode(''|'',$_REQUEST[''Arguments'']) as $valueall)\r\n\r\n{\r\n\r\n	$z = 0;\r\n	$found = 0;\r\n	foreach(explode(''^^^'',$valueall) as $key=>$value)\r\n\r\n	{\r\n\r\n		if( $z == 0 )\r\n\r\n		{\r\n\r\n			$z = $z+1;\r\n\r\n			if( $value=="UserParameters" )\r\n\r\n			{\r\n				$found = 1;\r\n			}\r\n\r\n		}\r\n\r\n		else\r\n\r\n		{\r\n\r\n			$z = 0;\r\n\r\n			if( $found == 1 )\r\n\r\n			{\r\n				$found = 0;\r\n				$user_parameters = $value;\r\n			}\r\n\r\n		}\r\n\r\n	}\r\n\r\n}\r\n\r\n\r\n\r\n\r\n			$z = 0;\r\n\r\n				$query = "DROP TABLE IF EXISTS __trzba_po_dnoch";\r\n				mysql_query($query);\r\n\r\n				$query = "CREATE TABLE __trzba_po_dnoch SELECT DATE(InvoiceDateTime) as InvoiceDateTime,SUM(Price*Quantity) as Subtotal, ''" . $user_parameters . "'' as Stredisko FROM posmonth WHERE InvoiceNumber LIKE ''00" . $user_parameters . "-%'' GROUP BY DATE(InvoiceDateTime) ORDER BY InvoiceDateTime DESC";\r\n				mysql_query($query);\r\n\r\n				$query = "DELETE FROM _blueticket_forms WHERE FormName=''_trzba_po_dnoch''";\r\n				mysql_query($query);\r\n				\r\n				$query = "DELETE FROM _blueticket_forms_fields WHERE FormName=''_trzba_po_dnoch''";\r\n				mysql_query($query);\r\n\r\n				$query = "INSERT INTO _blueticket_forms(FormName,FormCaption,TableName) VALUES(''_trzba_po_dnoch'',''Trzba po dnoch za stredisko - " . $user_parameters . "'',''__trzba_po_dnoch'')";\r\n				mysql_query($query);				\r\n				\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_trzba_po_dnoch'',''InvoiceDateTime'',''Datum'',1,1)";\r\n				mysql_query($query);				\r\n\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_trzba_po_dnoch'',''Subtotal'',''Trzba'',1,1)";\r\n				mysql_query($query);				\r\n\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_trzba_po_dnoch'',''Stredisko'',''Stredisko'',1,1)";\r\n				mysql_query($query);				\r\n\r\n\r\n\r\n\r\n\r\n\r\necho ''_trzba_po_dnoch'';\r\n\r\n\r\n\r\n?>'),
(78, 'OdbytAircraft', 'Odbyt poloziek za AirCraft', 'Zadajte dátum v tvare RRRR-MM-DD', 'SHOW', '<?php\r\n\r\n$karta = '''';\r\n$zauctovane = 0;\r\n\r\n$user_parameters = '''';\r\n\r\n\r\nforeach(explode(''|'',$_REQUEST[''Arguments'']) as $valueall)\r\n\r\n{\r\n\r\n	$z = 0;\r\n	$found = 0;\r\n	foreach(explode(''^^^'',$valueall) as $key=>$value)\r\n\r\n	{\r\n\r\n		if( $z == 0 )\r\n\r\n		{\r\n\r\n			$z = $z+1;\r\n\r\n			if( $value=="UserParameters" )\r\n\r\n			{\r\n				$found = 1;\r\n			}\r\n\r\n		}\r\n\r\n		else\r\n\r\n		{\r\n\r\n			$z = 0;\r\n\r\n			if( $found == 1 )\r\n\r\n			{\r\n				$found = 0;\r\n				$user_parameters = $value;\r\n			}\r\n\r\n		}\r\n\r\n	}\r\n\r\n}\r\n\r\n\r\n\r\n\r\n			$z = 0;\r\n\r\n				$query = "DROP TABLE IF EXISTS __trzba_aircraft";\r\n				mysql_query($query);\r\n\r\n				$query = "CREATE TABLE __trzba_aircraft SELECT Barcode,Name, SUM(Quantity) as Quantity, SUM(Price*Quantity) as Subtotal FROM posmonth WHERE InvoiceNumber LIKE ''007-%'' AND DATE(InvoiceDateTime)=''" . $user_parameters . "'' GROUP BY Barcode, Name ORDER BY Name DESC";\r\n				mysql_query($query);\r\n\r\n				$query = "DELETE FROM _blueticket_forms WHERE FormName=''_trzba_aircraft''";\r\n				mysql_query($query);\r\n				\r\n				$query = "DELETE FROM _blueticket_forms_fields WHERE FormName=''_trzba_aircraft''";\r\n				mysql_query($query);\r\n\r\n				$query = "INSERT INTO _blueticket_forms(FormName,FormCaption,TableName) VALUES(''_trzba_aircraft'',''Trzba po polozkach Aircraft za datum - " . $user_parameters . "'',''__trzba_aircraft'')";\r\n				mysql_query($query);				\r\n				\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_trzba_aircraft'',''Barcode'',''Reg. cislo'',1,1)";\r\n				mysql_query($query);				\r\n\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_trzba_aircraft'',''Name'',''Nazov'',1,1)";\r\n				mysql_query($query);				\r\n\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_trzba_aircraft'',''Quantity'',''Mnozstvo'',1,1)";\r\n				mysql_query($query);				\r\n\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_trzba_aircraft'',''Subtotal'',''Trzba'',1,1)";\r\n				mysql_query($query);				\r\n\r\n\r\necho ''_trzba_aircraft'';\r\n\r\n\r\n\r\n?>'),
(79, 'OdbytRestauracia', 'Odbyt poloziek za dátum a POS', 'Zadajte číslo strediska a rozsah dátumov v tvare STREDISKO,RRRR-MM-DD,RRRR-MM-DD', 'SHOW', '<?php\r\n\r\n$karta = '''';\r\n$zauctovane = 0;\r\n\r\n$user_parameters = '''';\r\n\r\n\r\nforeach(explode(''|'',$_REQUEST[''Arguments'']) as $valueall)\r\n\r\n{\r\n\r\n	$z = 0;\r\n	$found = 0;\r\n	foreach(explode(''^^^'',$valueall) as $key=>$value)\r\n\r\n	{\r\n\r\n		if( $z == 0 )\r\n\r\n		{\r\n\r\n			$z = $z+1;\r\n\r\n			if( $value=="UserParameters" )\r\n\r\n			{\r\n				$found = 1;\r\n			}\r\n\r\n		}\r\n\r\n		else\r\n\r\n		{\r\n\r\n			$z = 0;\r\n\r\n			if( $found == 1 )\r\n\r\n			{\r\n				$found = 0;\r\n				$user_parameters = $value;\r\n			}\r\n\r\n		}\r\n\r\n	}\r\n\r\n}\r\n\r\n\r\n		$params = explode('','',$user_parameters);\r\n\r\n		$stredisko=$params[0];\r\n		$from=$params[1];\r\n		$to=$params[2];\r\n\r\n			$z = 0;\r\n\r\n				$query = "DROP TABLE IF EXISTS __trzba_restaurant";\r\n				mysql_query($query);\r\n\r\n				$query = "CREATE TABLE __trzba_restaurant SELECT Barcode,Name, SUM(Quantity) as Quantity, SUM(Price*Quantity) as Subtotal,''" . $stredisko . "'' as Stredisko, PosName FROM posmonth WHERE InvoiceNumber LIKE ''00" . $stredisko . "-%'' AND DATE(InvoiceDateTime)>=''" . $from . "'' AND DATE(InvoiceDateTime)<=''" . $to . "'' GROUP BY PosName, Barcode, Name ORDER BY Name ASC";\r\n				mysql_query($query);\r\n\r\n				$query = "DELETE FROM _blueticket_forms WHERE FormName=''_trzba_restaurant''";\r\n				mysql_query($query);\r\n				\r\n				$query = "DELETE FROM _blueticket_forms_fields WHERE FormName=''_trzba_restaurant''";\r\n				mysql_query($query);\r\n\r\n				$query = "INSERT INTO _blueticket_forms(FormName,FormCaption,TableName) VALUES(''_trzba_restaurant'',''Trzba po polozkach Aircraft za datum - " . $user_parameters . "'',''__trzba_restaurant'')";\r\n				mysql_query($query);				\r\n				\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_trzba_restaurant'',''Barcode'',''Reg. cislo'',1,1)";\r\n				mysql_query($query);				\r\n\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_trzba_restaurant'',''Name'',''Nazov'',1,1)";\r\n				mysql_query($query);				\r\n\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_trzba_restaurant'',''Quantity'',''Mnozstvo'',1,1)";\r\n				mysql_query($query);				\r\n\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_trzba_restaurant'',''Subtotal'',''Trzba'',1,1)";\r\n				mysql_query($query);				\r\n\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_trzba_restaurant'',''PosName'',''Pokladna'',1,1)";\r\n				mysql_query($query);				\r\n\r\necho ''_trzba_restaurant'';\r\n\r\n\r\n\r\n?>'),
(80, 'SKInventoryAircraft', 'Vytvorit inventurny supis - Aircraft', NULL, 'SQL', '<?php\r\n\r\n$zauctovane = 0;\r\n\r\n\r\n\r\n$query = "INSERT INTO Inventura(Datum, Poznamka, Aktivna) VALUES(NOW(),''Inventura Aircraft-7'', 1)";\r\n\r\nmysql_query($query);\r\n\r\n\r\n\r\n$lastid = mysql_insert_id();\r\n\r\n$query = "INSERT INTO InventurnySupis(CiarovyKod, RegistracneCislo, KartaID, KratkyNazov, PredajnaCena, NakupnaCena, EvidencneMnozstvo, SkutocneMnozstvo, InventuraID) SELECT CiarovyKod, RegistracneCislo, ID, Nazov, PredajnaCena7, NakupnaCenaBezDPH, AktualnaZasoba, 0, " . $lastid . " FROM SkladovaKartaFullView7 WHERE (CisStavId=3 OR CisStavId=5 OR CisStavId=9) AND Stredisko7=1 ORDER BY TovarovaSkupinaID, Nazov";\r\n\r\n\r\n$zauctovane = mysql_query($query);\r\n\r\n\r\n\r\necho $zauctovane . '' vytvorenych inventurnych supisov. Cislo Inventury : '' . $lastid;\r\n\r\n\r\n\r\n?>'),
(82, 'TlacStitkovBagety', 'Tlac stitkov na bagety', 'Zadajte počet štítkov a dátum spotreby oddelené čiarkou v tvare: Pocet,Datum', 'SHOW', '<?php\r\n\r\n$karta = '''';\r\n$zauctovane = 0;\r\n\r\n$user_parameters = '''';\r\n\r\n\r\nforeach(explode(''|'',$_REQUEST[''Arguments'']) as $valueall)\r\n\r\n{\r\n\r\n	$z = 0;\r\n	$found = 0;\r\n	foreach(explode(''^^^'',$valueall) as $key=>$value)\r\n\r\n	{\r\n\r\n		if( $z == 0 )\r\n\r\n		{\r\n\r\n			$z = $z+1;\r\n\r\n			if( $value=="ID" )\r\n			{\r\n				$found=2;\r\n			}\r\n\r\n			if( $value=="UserParameters" )\r\n			{\r\n				$found = 1;\r\n			}\r\n\r\n		}\r\n\r\n		else\r\n\r\n		{\r\n\r\n			$z = 0;\r\n\r\n			if( $found == 1 )\r\n\r\n			{\r\n				$found = 0;\r\n				$array_exp = explode('','',$value);\r\n				$user_parameters = $array_exp[0];\r\n				$spotreba = $array_exp[1];				\r\n			}\r\n\r\n			if( $found == 2 )\r\n\r\n			{\r\n				$found = 0;\r\n				$ID = $value;\r\n			}\r\n		}\r\n\r\n	}\r\n\r\n}\r\n			$z = 0;\r\n\r\n				$query = "DROP TABLE IF EXISTS _tlac_bagety";\r\n				mysql_query($query);\r\n\r\n				$query = "CREATE TABLE _tlac_bagety SELECT ID,Nazov,RegistracneCislo,(SELECT DlhyPopis FROM sk_description WHERE SkladovaKartaId=SkladovaKarta.ID) as Popis, ''" . $user_parameters . "'' as Pocet, ''bagety'' as NazovDokladu, ''" . $spotreba . "'' as Spotreba FROM SkladovaKarta WHERE ID=" . $ID;\r\n				mysql_query($query);\r\n\r\n				for($j=1;$j<$user_parameters;$j++)\r\n				{\r\n					$query = "INSERT INTO _tlac_bagety SELECT ID,Nazov,RegistracneCislo,(SELECT DlhyPopis FROM sk_description WHERE SkladovaKartaId=SkladovaKarta.ID) as Popis, ''" . $user_parameters . "'' as Pocet, ''bagety'' as NazovDokladu, ''" . $spotreba . "'' as Spotreba FROM SkladovaKarta WHERE ID=" . $ID;\r\n					mysql_query($query);\r\n				}\r\n\r\n				$query = "DELETE FROM _blueticket_forms WHERE FormName=''_tlac_bagety''";\r\n				mysql_query($query);\r\n				\r\n				$query = "DELETE FROM _blueticket_forms_fields WHERE FormName=''_tlac_bagety''";\r\n				mysql_query($query);\r\n\r\n				$query = "INSERT INTO _blueticket_forms(FormName,FormCaption,TableName) VALUES(''_tlac_bagety'',''Tlac stitkov na bagety'',''_tlac_bagety'')";\r\n				mysql_query($query);\r\n				\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_tlac_bagety'',''ID'',''ID'',1,1)";\r\n				mysql_query($query);\r\n\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_tlac_bagety'',''RegistracneCislo'',''Reg. cislo'',1,1)";\r\n				mysql_query($query);\r\n\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_tlac_bagety'',''Nazov'',''Nazov'',1,1)";\r\n				mysql_query($query);\r\n\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_tlac_bagety'',''Popis'',''Popis'',1,1)";\r\n				mysql_query($query);\r\n\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_tlac_bagety'',''NazovDokladu'',''Tlacovka'',1,1)";\r\n				mysql_query($query);\r\necho ''_tlac_bagety'';\r\n\r\n\r\n\r\n?>');
INSERT INTO `blueticket_scripts` (`ID`, `ScriptName`, `ScriptCaption`, `TableName`, `ScriptType`, `Script`) VALUES
(83, 'VykazAlkohol', 'Vykaz liehu', 'Zadajte stredisko, mesiac a rok pre výkaz oddelené čiarkou v tvare: STREDISKO,MM,RRRR', 'SHOW', '<?php\r\n\r\n$karta = '''';\r\n$zauctovane = 0;\r\n\r\n$user_parameters = '''';\r\n\r\n\r\nforeach (explode(''|'', $_REQUEST[''Arguments'']) as $valueall) {\r\n\r\n    $z = 0;\r\n    $found = 0;\r\n    foreach (explode(''^^^'', $valueall) as $key => $value) {\r\n\r\n        if ($z == 0) {\r\n\r\n            $z = $z + 1;\r\n\r\n            if ($value == "ID") {\r\n                $found = 2;\r\n            }\r\n\r\n            if ($value == "UserParameters") {\r\n                $found = 1;\r\n            }\r\n        } else {\r\n\r\n            $z = 0;\r\n\r\n            if ($found == 1) {\r\n                $found = 0;\r\n                $array_exp = explode('','', $value);\r\n                $stredisko = $array_exp[0];\r\n                $year = $array_exp[2];\r\n                $month = $array_exp[1];\r\n            }\r\n\r\n            if ($found == 2) {\r\n                $found = 0;\r\n                $ID = $value;\r\n            }\r\n        }\r\n    }\r\n}\r\n$z = 0;\r\n\r\n\r\n$days = cal_days_in_month(CAL_GREGORIAN, $month, $year);\r\n\r\n$from = $year . ''-'' . $month . ''-01'';\r\n$to = $year . ''-'' . $month . ''-'' . $days;\r\n\r\n// Priprava tabulky\r\n$sql = "DROP TABLE IF EXISTS __vykaz";\r\nmysql_query($sql);\r\n\r\n$sql = "CREATE TABLE __vykaz (\r\n         ID BIGINT NOT NULL AUTO_INCREMENT PRIMARY KEY,\r\n         CiarovyKod VARCHAR(30),\r\n         Nazov VARCHAR(100),\r\n         Alkohol VARCHAR(20),\r\n         PS VARCHAR(20),";\r\nfor ($i = 1; $i <= $days; $i++) {\r\n    if ($i < 10) {\r\n        $day = ''0'' . $i;\r\n    } else {\r\n        $day = $i;\r\n    }\r\n    $sql .= "D" . $day . " VARCHAR(20),";\r\n}\r\n$sql .= "KS VARCHAR(20)\r\n)";\r\n\r\nmysql_query($sql);\r\n\r\n$result = mysql_query("SELECT RegistracneCislo, CiarovyKod, Nazov, Alkohol, VelkostSBL FROM SkladovaKarta WHERE Alkohol>0");\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n\r\n    $psresult = mysql_query("SELECT SUM(Mnozstvo*Quantity) as PS FROM tt2 WHERE RegistracneCislo = " . $row[''RegistracneCislo''] . " AND OdbytoveStredisko = " . $stredisko . " AND DATE(InvoiceDateTime)<''" . $from . "''");\r\n    $prow = mysql_fetch_assoc($psresult);\r\n    mysql_free_result($psresult);\r\n\r\n    $ksresult = mysql_query("SELECT SUM(Mnozstvo*Quantity) as KS FROM tt2 WHERE RegistracneCislo = " . $row[''RegistracneCislo''] . " AND OdbytoveStredisko = " . $stredisko . " AND DATE(InvoiceDateTime)<=''" . $to . "''");\r\n    $krow = mysql_fetch_assoc($ksresult);\r\n    mysql_free_result($ksresult);\r\n\r\n    mysql_query("INSERT INTO __vykaz(CiarovyKod,Nazov,Alkohol,PS,KS) VALUES(''" . $row[''CiarovyKod''] . "'',''" . $row[''Nazov''] . "'',''" . $row[''Alkohol''] . "'',''" . str_replace(''.'','','',number_format($prow[''PS''], 4)) . "'',''" . str_replace(''.'','','',number_format($krow[''KS''], 4)) . "'')");\r\n\r\n    $lastid = mysql_insert_id();\r\n\r\n    for ($i = 1; $i <= $days; $i++) {\r\n        if ($i < 10) {\r\n            $day = ''0'' . $i;\r\n        } else {\r\n            $day = $i;\r\n        }\r\n\r\n        $today = $year . "-" . $month . "-" . $day;\r\n\r\n        //Prijem za den\r\n        $ppresult = mysql_query("SELECT SUM(Mnozstvo*Quantity) as PP FROM tt2 WHERE RegistracneCislo = " . $row[''RegistracneCislo''] . " AND OdbytoveStredisko = " . $stredisko . " AND Quantity>0 AND DATE(InvoiceDateTime) = ''" . $today . "''");\r\n        $pprow = mysql_fetch_assoc($ppresult);\r\n\r\n        //Vydaj za den\r\n        $pvresult = mysql_query("SELECT SUM(Mnozstvo*Quantity) as PV FROM tt2 WHERE RegistracneCislo = " . $row[''RegistracneCislo''] . " AND OdbytoveStredisko = " . $stredisko . " AND Quantity<0 AND DATE(InvoiceDateTime) = ''" . $today . "''");\r\n        $pvrow = mysql_fetch_assoc($pvresult);\r\n\r\n        mysql_query("UPDATE __vykaz SET D" . $day . "=''" . number_format($pprow[''PP''], 4) . " / " . number_format($pvrow[''PV''], 4) . "'' WHERE ID=" . $lastid);\r\n\r\n        mysql_free_result($ppresult);\r\n        mysql_free_result($pvresult);\r\n    }\r\n\r\n//    echo $row[''Nazov''] . " - " . $prow[''PS''] . " - (" . $pprow[''PP''] . ") - (" . $pvrow[''PV''] . ") - " . $krow[''KS''] . "<br/>";\r\n}\r\n\r\nmysql_free_result($result);\r\n\r\n\r\n$query = "DELETE FROM _blueticket_forms WHERE FormName=''__vykaz''";\r\nmysql_query($query);\r\n\r\n$query = "DELETE FROM _blueticket_forms_fields WHERE FormName=''__vykaz''";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms(FormName,FormCaption,TableName) VALUES(''__vykaz'',''Vykaz predaja liehu - " . $stredisko . " - " . $month . " / " . $year . "'',''__vykaz'')";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,Priority) VALUES(''__vykaz'',''ID'',''ID'',1,1,0)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,Priority) VALUES(''__vykaz'',''CiarovyKod'',''Ciarovy kod'',1,1,1)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,Priority) VALUES(''__vykaz'',''Nazov'',''Nazov'',1,1,2)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,Priority) VALUES(''__vykaz'',''Alkohol'',''Alkohol'',1,1,3)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,Priority) VALUES(''__vykaz'',''PS'',''Poc. stav'',1,1,4)";\r\nmysql_query($query);\r\n\r\n$ishift=5;\r\n$shift = 5;\r\n\r\nfor ($i = 1; $i <= $days; $i++) {\r\n    if ($i < 10) {\r\n        $day = ''0'' . $i;\r\n    } else {\r\n        $day = $i;\r\n    }\r\n\r\n    $query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,Priority) VALUES(''__vykaz'',''D" . $day . "'',''Den " . $day . " [P/V]'',1,1," . $shift . ")";\r\n    mysql_query($query);\r\n\r\n    $shift = $ishift+$i;\r\n}\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,Priority) VALUES(''__vykaz'',''KS'',''Kon. stav'',1,1," . $shift . ")";\r\nmysql_query($query);\r\n\r\necho ''__vykaz'';\r\n?>'),
(84, 'TlacStitkov', 'Tlac tovarovych kodov', NULL, 'SHOW', '<?php\r\n\r\n$zauctovane = 0;\r\n\r\n$query = "DROP TABLE IF EXISTS _tlac_kodov";\r\nmysql_query($query);\r\n\r\n\r\n\r\n\r\n$x = 0;\r\n$y = 0;\r\n$myid = 0;\r\n\r\nforeach (explode(''|'', $_REQUEST[''Arguments'']) as $valueall) {\r\n\r\n    $z = 0;\r\n\r\n    $found = 0;\r\n\r\n    foreach (explode(''^^^'', $valueall) as $key => $value) {\r\n\r\n        if ($z == 0) {\r\n\r\n            $z = $z + 1;\r\n\r\n            if ($value == "ID") {\r\n\r\n                $found = 1;\r\n            }\r\n        } else {\r\n\r\n            $z = 0;\r\n\r\n            if ($found == 1) {\r\n\r\n                $found = 0;\r\n                if ($x == 0) {\r\n\r\n                    $query = "CREATE TABLE _tlac_kodov SELECT ID,Nazov,RegistracneCislo,(SELECT Popis FROM TovarovaSkupina WHERE TovarovaSkupina.ID=SkladovaKarta.TovarovaSkupinaId) as NazovTS, ''1'' as Pocet, ''TabulkaKodov'' as NazovDokladu,'''' as Spotreba, ID as ID2,Nazov as Nazov2,RegistracneCislo as RegistracneCislo2,Nazov as NazovTS2, ''1'' as Pocet2, ''TabulkaKodov'' as NazovDokladu2,''1'' as Spotreba2 FROM SkladovaKarta WHERE ID=" . $value;\r\n                    //mysql_query($query);\r\n\r\n                    $x = 1;\r\n                    $y = 1;\r\n                    $myid = $value;\r\n                    mysql_query($query);\r\n                    $query = "UPDATE _tlac_kodov SET ID2=0, Nazov2 = '''', RegistracneCislo2=0, NazovTS2 = '''', Pocet2 = ''1'', NazovDokladu2 = ''TabulkaKodov'', Spotreba2 = '''' WHERE ID=" . $myid;\r\n                    mysql_query($query);\r\n                } else {\r\n                    if ($y == 0) {\r\n                        $query = "SELECT *,(SELECT Popis FROM TovarovaSkupina WHERE TovarovaSkupina.ID=SkladovaKarta.TovarovaSkupinaId) as NazovTS FROM SkladovaKarta WHERE ID=$value";\r\n                        $myresult = mysql_query($query);\r\n                        $myrow = mysql_fetch_assoc($myresult);\r\n                        mysql_free_result($myresult);\r\n                        $query = "INSERT INTO _tlac_kodov(ID,Nazov,RegistracneCislo, NazovTS,Pocet,NazovDokladu,Spotreba) SELECT ID,Nazov,RegistracneCislo,(SELECT Popis FROM TovarovaSkupina WHERE TovarovaSkupina.ID=SkladovaKarta.TovarovaSkupinaId) as NazovTS, ''1'' as Pocet, ''TabulkaKodov'' as NazovDokladu,'''' as Spotreba FROM SkladovaKarta WHERE ID=" . $value;\r\n                        $myid = $value;\r\n                        $NazovTS = $myrow[''NazovTS''];\r\n                        $y = 1;\r\n                        mysql_query($query);\r\n                    } else {\r\n                        $query = "SELECT *,(SELECT Popis FROM TovarovaSkupina WHERE TovarovaSkupina.ID=SkladovaKarta.TovarovaSkupinaId) as NazovTS FROM SkladovaKarta WHERE ID=$value";\r\n                        $myresult = mysql_query($query);\r\n                        $myrow = mysql_fetch_assoc($myresult);\r\n                        mysql_free_result($myresult);\r\n                        if($NazovTS == $myrow[''NazovTS''])\r\n                        {\r\n                            $query = "UPDATE _tlac_kodov SET ID2=''" . $myrow[''ID''] . "'', Nazov2 = ''" . $myrow[''Nazov''] . "'', RegistracneCislo2=''" . $myrow[''RegistracneCislo''] . "'', NazovTS2 = ''" . $myrow[''NazovTS''] . "'', Pocet2 = ''1'', NazovDokladu2 = ''TabulkaKodov'', Spotreba2 = '''' WHERE ID=" . $myid;\r\n                            $y = 0;\r\n                        }\r\n                        else\r\n                        {\r\n                            $query = "INSERT INTO _tlac_kodov(ID,Nazov,RegistracneCislo, NazovTS,Pocet,NazovDokladu,Spotreba) SELECT ID,Nazov,RegistracneCislo,(SELECT Popis FROM TovarovaSkupina WHERE TovarovaSkupina.ID=SkladovaKarta.TovarovaSkupinaId) as NazovTS, ''1'' as Pocet, ''TabulkaKodov'' as NazovDokladu,'''' as Spotreba FROM SkladovaKarta WHERE ID=" . $value;\r\n                            $y = 1;\r\n                            $myid = $value;\r\n                            $NazovTS = $myrow[''NazovTS''];\r\n                        }\r\n                        \r\n                        mysql_query($query);\r\n                    }\r\n                }\r\n                $zauctovane = $zauctovane + 1;\r\n            }\r\n        }\r\n    }\r\n}\r\n\r\n\r\n\r\n$query = "DELETE FROM _blueticket_forms WHERE FormName=''_tlac_kodov''";\r\nmysql_query($query);\r\n\r\n$query = "DELETE FROM _blueticket_forms_fields WHERE FormName=''_tlac_kodov''";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms(FormName,FormCaption,TableName) VALUES(''_tlac_kodov'',''Tlac tovarovych kodov'',''_tlac_kodov'')";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_tlac_kodov'',''ID'',''ID'',1,1)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_tlac_kodov'',''RegistracneCislo'',''Reg. cislo'',1,1)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_tlac_kodov'',''Nazov'',''Nazov'',1,1)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_tlac_kodov'',''NazovTS'',''NazovTS'',1,1)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_tlac_kodov'',''NazovDokladu'',''Tlacovka'',1,1)";\r\nmysql_query($query);\r\necho ''_tlac_kodov'';\r\n?>'),
(96, 'PripravaSumarnejObjednavky', '05. Priprava sumarnej Objednavky s DPH', 'Od datumu po datum v tvare : RRRR-MM-DD,RRRR-MM-DD', 'SHOW', '<?php\r\n\r\n/* mysql_connect(''212.5.221.3'', ''root'', ''awqbn154'');\r\n\r\n  mysql_select_db(''blueticket'');\r\n */\r\n\r\n$karta = '''';\r\n$zauctovane = 0;\r\n// pre kazdy typ dokladu ine cislo\r\n$storno = "0";\r\n$typy_dokladov = "6";\r\n\r\n\r\n$user_parameters = '''';\r\n\r\n\r\nforeach (explode(''|'', $_REQUEST[''Arguments'']) as $valueall) {\r\n\r\n    $z = 0;\r\n    $found = 0;\r\n    foreach (explode(''^^^'', $valueall) as $key => $value) {\r\n\r\n        if ($z == 0) {\r\n\r\n            $z = $z + 1;\r\n\r\n            if ($value == "ID") {\r\n                $found = 2;\r\n            }\r\n\r\n            if ($value == "UserParameters") {\r\n                $found = 1;\r\n            }\r\n        } else {\r\n\r\n            $z = 0;\r\n\r\n            if ($found == 1) {\r\n                $found = 0;\r\n                $array_exp = explode('','', $value);\r\n                $from_date = $array_exp[0];\r\n                $to_date = $array_exp[1];\r\n            }\r\n\r\n            if ($found == 2) {\r\n                $found = 0;\r\n                $ID = $value;\r\n            }\r\n        }\r\n    }\r\n}\r\n\r\n$z = 0;\r\n\r\n/* $from_date = "2012-04-01";\r\n  $to_date = "2012-04-20";\r\n  $ID = "6613";\r\n */\r\n\r\n/* Storna OB */\r\n\r\n$doklad_query = "SELECT * FROM Doklad WHERE DATE(Doklad.DatumDodania) >= ''$from_date'' AND DATE(Doklad.DatumDodania) <= ''$to_date'' AND Doklad.CisTypDokladuId IN (" . $storno . ") AND CisPartnerId=$ID ORDER BY Doklad.DatumDodania";\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\n$stlpce = "";\r\n$i = 0;\r\n\r\n$stlpce_insert = "";\r\n$datum_insert = "";\r\n$let_insert = "";\r\n\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    if ($i == 0) {\r\n        $stlpce = "OB" . $row[''Odvolavka''] . " VARCHAR(250), OB" . $row[''Odvolavka''] . "Spolu VARCHAR(250), OB" . $row[''Odvolavka''] . "Mnoz DECIMAL(20,4), OB" . $row[''Odvolavka''] . "PC DECIMAL(20,4)";\r\n        $stlpce_insert = "RegistracneCislo, Nazov, PredajnaCena, MJ";\r\n        $let_insert = "'''',''Cislo letu'',-10000,''''";\r\n        $datum_insert = "'''',''Datum letu'',-10000,''''";\r\n    } else {\r\n        $stlpce .= ",OB" . $row[''Odvolavka''] . " VARCHAR(250), OB" . $row[''Odvolavka''] . "Spolu VARCHAR(250), OB" . $row[''Odvolavka''] . "Mnoz DECIMAL(20,4), OB" . $row[''Odvolavka''] . "PC DECIMAL(20,4)";\r\n    }\r\n    $i++;\r\n}\r\nmysql_free_result($result);\r\n\r\n//$doklad_query = "SELECT * FROM Doklad WHERE DATE(Doklad.DatumDodania) >= ''$from_date'' AND DATE(Doklad.DatumDodania) <= ''$to_date'' AND Doklad.CisTypDokladuId IN (" . $storno . ") AND CisPartnerId=$ID ORDER BY Doklad.DatumDodania";\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    //$stlpce .= ",OB" . $row[''Odvolavka''] . " VARCHAR(250), OB" . $row[''Odvolavka''] . "Spolu VARCHAR(250), OB" . $row[''Odvolavka''] . "Mnoz DECIMAL(20,4), OB" . $row[''Odvolavka''] . "PC DECIMAL(20,4)";\r\n    $stlpce_insert .= ",OB" . $row[''Odvolavka''] . ", OB" . $row[''Odvolavka''] . "Spolu, OB" . $row[''Odvolavka''] . "Mnoz, OB" . $row[''Odvolavka''] . "PC";\r\n    $datum_insert .= ",''" . $row[''DatumDodania''] . " - " . $row[''catCateringName''] . "'','''',0,0";\r\n    $let_insert .= ",''" . $row[''catCisloLetu''] . " - " . $row[''catDestinacia''] . "'','''',0,0";\r\n}\r\n\r\nmysql_free_result($result);\r\n\r\n$query = "DROP TABLE IF EXISTS _summary_st";\r\nmysql_query($query);\r\n\r\n//echo $stlpce  . "<br/>";\r\n//echo $stlpce_insert . "<br/>";\r\n//echo $let_insert . "<br/>";\r\n//echo $stlpce_insert . "<br/>";\r\n//echo $datum_insert . "<br/>";\r\n\r\n$query = "CREATE TABLE _summary_st(RegistracneCislo VARCHAR(20), Nazov VARCHAR(255), PredajnaCena DECIMAL(20,4), MJ VARCHAR(20), " . $stlpce . ", SpoluMnozstvo DECIMAL(20,4), CelkomZaPolozku DECIMAL(20,4))";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _summary_st(" . $stlpce_insert . ") VALUES(" . $let_insert . ")";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _summary_st(" . $stlpce_insert . ") VALUES(" . $datum_insert . ")";\r\nmysql_query($query);\r\n\r\n$query = "SELECT Pohyb.*, Doklad.Odvolavka FROM Pohyb INNER JOIN Doklad ON Pohyb.DokladID=Doklad.ID WHERE DATE(Doklad.DatumDodania) >= ''$from_date'' AND DATE(Doklad.DatumDodania) <= ''$to_date'' AND Doklad.CisTypDokladuID IN (" . $storno . ") AND Doklad.CisPartnerId=$ID ORDER BY Doklad.DatumDodania";\r\n$result = mysql_query($query);\r\n\r\n$KodDokladu = 0;\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $myquery = "SELECT COUNT(*) AS Pocet FROM _summary_st WHERE RegistracneCislo = ''" . $row[''RegistracneCislo''] . "'' AND PredajnaCena=''" . $row[''PredajnaCena''] . "''";\r\n\r\n    $myresult = mysql_query($myquery);\r\n    $myrow = @mysql_fetch_assoc($myresult);\r\n\r\n    if ($myrow[''Pocet''] > 0) {\r\n        $myquery = "UPDATE _summary_st SET  PredajnaCena=" . number_format($row[''PredajnaCena''], 4, ".", "") . ", MJ=''" . $row[''MernaJednotkaNazov''] . "'', OB" . $row[''Odvolavka''] . "=''" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)), 4, ".", "") . "'', OB" . $row[''Odvolavka''] . "Spolu=''" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)) * $row[''PredajnaCena''], 4, ".", "") . " EUR'', OB" . $row[''Odvolavka''] . "Mnoz=" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)), 4, ".", "") . ", OB" . $row[''Odvolavka''] . "PC=" . number_format($row[''PredajnaCena''], 4, ".", "") . " WHERE RegistracneCislo = ''" . $row[''RegistracneCislo''] . "'' AND PredajnaCena=''" . $row[''PredajnaCena''] . "''";\r\n    } else {\r\n        $myquery = "INSERT INTO _summary_st(RegistracneCislo, Nazov, PredajnaCena, MJ, OB" . $row[''Odvolavka''] . ", OB" . $row[''Odvolavka''] . "Spolu, OB" . $row[''Odvolavka''] . "Mnoz, OB" . $row[''Odvolavka''] . "PC) VALUES(''" . $row[''RegistracneCislo''] . "'',''" . $row[''Nazov''] . "''," . number_format($row[''PredajnaCena''], 4, ".", "") . ",''" . $row[''MernaJednotkaNazov''] . "'',''" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)), 4, ".", "") . "'', ''" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)) * $row[''PredajnaCena''], 4, ".", "") . "''," . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)), 4, ".", "") . "," . number_format($row[''PredajnaCena''], 4, ".", "") . ")";\r\n    }\r\n    @mysql_free_result($myresult);\r\n\r\n    //echo $myquery . "<br/>";\r\n    mysql_query($myquery);\r\n}\r\n\r\nmysql_free_result($result);\r\n\r\n$myq = "INSERT INTO _summary_st(RegistracneCislo, PredajnaCena, Nazov) VALUES(''Spolu za OB bez DPH'',-10000, '''')";\r\nmysql_query($myq);\r\n\r\n$myq = "INSERT INTO _summary_st(RegistracneCislo, PredajnaCena, Nazov) VALUES(''Spolu za OB s DPH'',-10000, '''')";\r\nmysql_query($myq);\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $myq = "UPDATE _summary_st SET OB" . $row[''Odvolavka''] . "Mnoz=0 WHERE OB" . $row[''Odvolavka''] . "Mnoz IS NULL";\r\n    mysql_query($myq);\r\n    $myq = "UPDATE _summary_st SET OB" . $row[''Odvolavka''] . "PC=0 WHERE OB" . $row[''Odvolavka''] . "PC IS NULL";\r\n    mysql_query($myq);\r\n    $myq = "UPDATE _summary_st SET CelkomZaPolozku = 0, SpoluMnozstvo = 0";\r\n    mysql_query($myq);\r\n}\r\nmysql_free_result($result);\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $myq = "SELECT SUM(OB" . $row[''Odvolavka''] . "Mnoz*(OB" . $row[''Odvolavka''] . "PC*1.2)) as Suma FROM _summary_st";\r\n    $res = mysql_query($myq);\r\n    $myrow = @mysql_fetch_assoc($res);\r\n    $spolu = number_format($myrow[''Suma''], 4, ".", "");\r\n    @mysql_free_result($res);\r\n    $myq = "UPDATE _summary_st SET OB" . $row[''Odvolavka''] . " = ''" . number_format(($spolu/1.2), 4, ".", "") . "'', OB" . $row[''Odvolavka''] . "Spolu = " . number_format(($spolu/1.2), 4, ".", "") . ", OB" . $row[''Odvolavka''] . "PC=" . number_format(($spolu/1.2), 4, ".", "") . ", OB" . $row[''Odvolavka''] . "Mnoz=1 WHERE RegistracneCislo = ''Spolu za OB bez DPH''";\r\n    mysql_query($myq);\r\n    $myq = "UPDATE _summary_st SET OB" . $row[''Odvolavka''] . " = ''" . number_format($spolu, 4, ".", "") . "'', OB" . $row[''Odvolavka''] . "Spolu = " . number_format($spolu, 4, ".", "") . ", OB" . $row[''Odvolavka''] . "PC=" . number_format($spolu , 4, ".", "") . ", OB" . $row[''Odvolavka''] . "Mnoz=1 WHERE RegistracneCislo = ''Spolu za OB s DPH''";\r\n    mysql_query($myq);\r\n}\r\nmysql_free_result($result);\r\n\r\n\r\n$sumquery = "SELECT * FROM _summary_st";\r\n$sumresult = mysql_query($sumquery);\r\n\r\nwhile ($sumrow = @mysql_fetch_assoc($sumresult)) {\r\n    $query = $doklad_query;\r\n    $result = mysql_query($query);\r\n    while ($row = mysql_fetch_assoc($result)) {\r\n        $myq = "UPDATE _summary_st SET CelkomZaPolozku=CelkomZaPolozku+" . number_format($sumrow[''OB'' . $row[''Odvolavka''] . ''Mnoz''] * $sumrow[''OB'' . $row[''Odvolavka''] . ''PC''], 4, ".", "") . " WHERE (RegistracneCislo = ''" . $sumrow[''RegistracneCislo''] . "'' AND PredajnaCena = ''" . $sumrow[''PredajnaCena''] . "'')";\r\n        mysql_query($myq);\r\n        $myq = "UPDATE _summary_st SET SpoluMnozstvo=SpoluMnozstvo+" . number_format($sumrow[''OB'' . $row[''Odvolavka''] . ''Mnoz''], 4, ".", "") . " WHERE (RegistracneCislo = ''" . $sumrow[''RegistracneCislo''] . "'' AND PredajnaCena = ''" . $sumrow[''PredajnaCena''] . "'')";\r\n        mysql_query($myq);\r\n    }\r\n    mysql_free_result($result);\r\n}\r\n\r\n@mysql_free_result($sumresult);\r\n\r\n/* Storna OB */\r\n\r\n\r\n/* Dodacie listy */\r\n\r\n$doklad_query = "SELECT * FROM Doklad WHERE DATE(Doklad.DatumDodania) >= ''$from_date'' AND DATE(Doklad.DatumDodania) <= ''$to_date'' AND Doklad.CisTypDokladuId IN (" . $typy_dokladov . ") AND CisPartnerId=$ID ORDER BY Doklad.DatumDodania";\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\n$stlpce = "";\r\n$i = 0;\r\n\r\n$stlpce_insert = "";\r\n$datum_insert = "";\r\n$let_insert = "";\r\n\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    if ($i == 0) {\r\n        $stlpce = "OB" . $row[''KodDokladu''] . " VARCHAR(250), OB" . $row[''KodDokladu''] . "Spolu VARCHAR(250), OB" . $row[''KodDokladu''] . "Mnoz DECIMAL(20,4), OB" . $row[''KodDokladu''] . "PC DECIMAL(20,4)";\r\n        $stlpce_insert = "RegistracneCislo, Nazov, PredajnaCena, MJ";\r\n        $let_insert = "'''',''Cislo letu'',-10000,''''";\r\n        $datum_insert = "'''',''Datum letu'',-10000,''''";\r\n    } else {\r\n        $stlpce .= ",OB" . $row[''KodDokladu''] . " VARCHAR(250), OB" . $row[''KodDokladu''] . "Spolu VARCHAR(250), OB" . $row[''KodDokladu''] . "Mnoz DECIMAL(20,4), OB" . $row[''KodDokladu''] . "PC DECIMAL(20,4)";\r\n    }\r\n    $i++;\r\n}\r\nmysql_free_result($result);\r\n\r\n//$doklad_query = "SELECT * FROM Doklad WHERE DATE(Doklad.DatumDodania) >= ''$from_date'' AND DATE(Doklad.DatumDodania) <= ''$to_date'' AND Doklad.CisTypDokladuId IN (" . $typy_dokladov . ") AND CisPartnerId=$ID ORDER BY Doklad.DatumDodania";\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    //$stlpce .= ",OB" . $row[''KodDokladu''] . " VARCHAR(250), OB" . $row[''KodDokladu''] . "Spolu VARCHAR(250), OB" . $row[''KodDokladu''] . "Mnoz DECIMAL(20,4), OB" . $row[''KodDokladu''] . "PC DECIMAL(20,4)";\r\n    $stlpce_insert .= ",OB" . $row[''KodDokladu''] . ", OB" . $row[''KodDokladu''] . "Spolu, OB" . $row[''KodDokladu''] . "Mnoz, OB" . $row[''KodDokladu''] . "PC";\r\n    $datum_insert .= ",''" . $row[''DatumDodania''] . " - " . $row[''catCateringName''] . "'','''',0,0";\r\n    $let_insert .= ",''" . $row[''catCisloLetu''] 