r\n        mysql_query($myq);\r\n    }\r\n    mysql_free_result($result);\r\n}\r\n\r\n@mysql_free_result($sumresult);\r\n\r\n/* Dodacie listy */\r\n\r\n$query = "DELETE FROM _blueticket_forms WHERE FormName=''_summary_dl''";\r\nmysql_query($query);\r\n\r\n$query = "DELETE FROM _blueticket_forms_fields WHERE FormName=''_summary_dl''";\r\nmysql_query($query);\r\n\r\n$query = "DELETE FROM _blueticket_forms_settings WHERE FormName=''_summary_dl''";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms(FormName,FormCaption,TableName) VALUES(''_summary_dl'',''SumÃ¡rny dodacÃ­ list'',''_summary_dl'')";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''RegistracneCislo'',''R.C.'',1,1,0)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''Nazov'',''Nazov'',1,1,1)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''PredajnaCena'',''PC'',1,1,2)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''MJ'',''MJ'',1,1,3)";\r\nmysql_query($query);\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\n$i = 4;\r\n\r\n$settings = "";\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''OB" . $row[''KodDokladu''] . "'',''OB" . $row[''KodDokladu''] . "'',1,1,$i)";\r\n\r\n    $settings .= "|OB" . $row[''KodDokladu''] . "^180^R";\r\n\r\n    mysql_query($query);\r\n    $i++;\r\n    //$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''OB" . $row[''KodDokladu''] . "Spolu'',''OB" . $row[''KodDokladu''] . " Spolu'',1,1,$i)";\r\n    //mysql_query($query);\r\n    //$i++;\r\n}\r\nmysql_free_result($result);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''SpoluMnozstvo'',''Mnozstvo celkom'',1,1,$i)";\r\nmysql_query($query);\r\n\r\n$i++;\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''CelkomZaPolozku'',''Celkom'',1,1,$i)";\r\nmysql_query($query);\r\n\r\n\r\n/* display table\r\n\r\n  $result = mysql_query("SELECT * FROM _summary_st");\r\n  if (!$result) {\r\n  die("Query to show fields from table failed");\r\n  }\r\n\r\n  $fields_num = mysql_num_fields($result);\r\n\r\n  echo "<h1>Table: </h1>";\r\n  echo "<table border=''1''><tr>";\r\n  // printing table headers\r\n  for ($i = 0; $i < $fields_num; $i++) {\r\n  $field = mysql_fetch_field($result);\r\n  echo "<td>{$field->name}</td>";\r\n  }\r\n  echo "</tr>\\n";\r\n  // printing table rows\r\n  while ($row = mysql_fetch_row($result)) {\r\n  echo "<tr>";\r\n\r\n  // $row is array... foreach( .. ) puts every element\r\n  // of $row to $cell variable\r\n  foreach ($row as $cell)\r\n  echo "<td>$cell</td>";\r\n\r\n  echo "</tr>\\n";\r\n  }\r\n  mysql_free_result($result);\r\n\r\n\r\n  $result = mysql_query("SELECT * FROM _summary_dl");\r\n  if (!$result) {\r\n  die("Query to show fields from table failed");\r\n  }\r\n\r\n  $fields_num = mysql_num_fields($result);\r\n\r\n  echo "<h1>Table: </h1>";\r\n  echo "<table border=''1''><tr>";\r\n  // printing table headers\r\n  for ($i = 0; $i < $fields_num; $i++) {\r\n  $field = mysql_fetch_field($result);\r\n  echo "<td>{$field->name}</td>";\r\n  }\r\n  echo "</tr>\\n";\r\n  // printing table rows\r\n  while ($row = mysql_fetch_row($result)) {\r\n  echo "<tr>";\r\n\r\n  // $row is array... foreach( .. ) puts every element\r\n  // of $row to $cell variable\r\n  foreach ($row as $cell)\r\n  echo "<td>$cell</td>";\r\n\r\n  echo "</tr>\\n";\r\n  }\r\n  mysql_free_result($result);\r\n\r\ndisplay table */\r\n\r\n$query = "DELETE FROM _summary_dl WHERE PredajnaCena = 0";\r\nmysql_query($query);\r\n\r\n$query = "UPDATE _summary_dl SET PredajnaCena = NULL WHERE PredajnaCena = -10000";\r\nmysql_query($query);\r\n\r\n$query = "SELECT * FROM Pouzivatel";\r\n$result = mysql_query($query);\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $query = "INSERT INTO _blueticket_forms_settings(UserID, FormName, UserSettings) VALUES(" . $row[''ID''] . ",''_summary_dl'',''RegistracneCislo^120^L|Nazov^250^L|PredajnaCena^60^R|MJ^30^L" . $settings . "|SpoluMnozstvo^160^R|CelkomZaPolozku^160^R|'')";\r\n    mysql_query($query);\r\n}\r\n\r\nmysql_free_result($result);\r\n\r\necho ''_summary_dl'';\r\n?>'),
(95, 'PriraditZlavuHodnota', 'Zadat zlavu v EUR', 'Zadajte hodnotu zlavy v EUR s DPH', 'SQL', '<?php\r\n\r\n$zauctovane = 0;\r\n\r\n$user_parameters = '''';\r\n\r\n\r\nforeach(explode(''|'',$_REQUEST[''Arguments'']) as $valueall)\r\n\r\n{\r\n\r\n	$z = 0;\r\n	$found = 0;\r\n	foreach(explode(''^^^'',$valueall) as $key=>$value)\r\n\r\n	{\r\n\r\n		if( $z == 0 )\r\n\r\n		{\r\n\r\n			$z = $z+1;\r\n\r\n			if( $value=="UserParameters" )\r\n\r\n			{\r\n\r\n				$found = 1;\r\n\r\n			}\r\n\r\n		}\r\n\r\n		else\r\n\r\n		{\r\n\r\n			$z = 0;\r\n\r\n			if( $found == 1 )\r\n\r\n			{\r\n\r\n				$found = 0;\r\n				$user_parameters = $value;\r\n\r\n			}\r\n\r\n		}\r\n\r\n	}\r\n\r\n}\r\n\r\n\r\n\r\n\r\nforeach(explode(''|'',$_REQUEST[''Arguments'']) as $valueall)\r\n\r\n{\r\n\r\n	$z = 0;\r\n	$found = 0;\r\n	foreach(explode(''^^^'',$valueall) as $key=>$value)\r\n\r\n	{\r\n\r\n		if( $z == 0 )\r\n\r\n		{\r\n\r\n			$z = $z+1;\r\n\r\n			if( $value=="ID" )\r\n\r\n			{\r\n\r\n				$found = 1;\r\n\r\n			}\r\n\r\n		}\r\n\r\n		else\r\n\r\n		{\r\n\r\n			$z = 0;\r\n\r\n			if( $found == 1 )\r\n\r\n			{\r\n\r\n				$found = 0;\r\n                                                                $user_parameters = str_replace(",",".",$user_parameters);\r\n\r\n				$query = "UPDATE Doklad SET Zlava=" . $user_parameters . " WHERE ID=" . $value;\r\n\r\n				mysql_query($query);\r\n\r\n				$zauctovane = $zauctovane + 1;\r\n\r\n			}\r\n\r\n		}\r\n\r\n	}\r\n\r\n}\r\n\r\n\r\n\r\necho ''Upravenych zaznamov : '' . $zauctovane;\r\n\r\n\r\n\r\n?>'),
(86, 'AktualizujPohyb', 'Aktualizuj pohyb', 'Skript je bez parametrov', 'SQL', '<?php\r\n\r\n$user_parameters = '''';\r\n\r\n\r\nforeach (explode(''|'', $_REQUEST[''Arguments'']) as $valueall) {\r\n\r\n    $z = 0;\r\n    $found = 0;\r\n    foreach (explode(''^^^'', $valueall) as $key => $value) {\r\n\r\n        if ($z == 0) {\r\n\r\n            $z = $z + 1;\r\n\r\n            if ($value == "ID") {\r\n                $found = 1;\r\n            }\r\n        } else {\r\n            $z = 0;\r\n            if ($found == 1) {\r\n                $found = 0;\r\n                $ID = $value;\r\n		$query = "UPDATE CisKodPohybu SET ID=KodPohybu WHERE ID=" . $ID;\r\n		mysql_query($query);\r\n            }\r\n\r\n        }\r\n    }\r\n}\r\n$z = 0;\r\n?>'),
(87, 'SpocitajObjednavku', 'Sumárna kalkulácia výroby za obdobie', 'Zadajte dátum od a dátum do oddelený čiarkami v tvare : RRRR-MM-DD,RRRR-MM-DD', 'SHOW', '<?php\r\n\r\n$karta = '''';\r\n$zauctovane = 0;\r\n$typ_doklad = 6;\r\n\r\n$user_parameters = '''';\r\n\r\n\r\nforeach(explode(''|'',$_REQUEST[''Arguments'']) as $valueall)\r\n\r\n{\r\n\r\n	$z = 0;\r\n	$found = 0;\r\n	foreach(explode(''^^^'',$valueall) as $key=>$value)\r\n\r\n	{\r\n\r\n		if( $z == 0 )\r\n\r\n		{\r\n\r\n			$z = $z+1;\r\n\r\n			if( $value=="UserParameters" )\r\n\r\n			{\r\n				$found = 1;\r\n			}\r\n\r\n		}\r\n\r\n		else\r\n\r\n		{\r\n\r\n			$z = 0;\r\n\r\n			if( $found == 1 )\r\n\r\n			{\r\n				$found = 0;\r\n				$user_parameters = $value;\r\n			}\r\n\r\n		}\r\n\r\n	}\r\n\r\n}\r\n\r\n\r\n		$params = explode('','',$user_parameters);\r\n\r\n		$from=$params[0];\r\n		$to=$params[1];\r\n\r\n			$z = 0;\r\n\r\n				$query = "DROP TABLE IF EXISTS __priprava_vyroby";\r\n				mysql_query($query);\r\n\r\n				$query = "CREATE TABLE __priprava_vyroby SELECT ''KalkulaciaVyroby'' as NazovDokladu, RegistracneCislo,Nazov, SUM(Mnozstvo) as Mnozstvo, MernaJednotkaNazov as MernaJednotkaNazov, '''' as Nakupit FROM objednavka_rozpad WHERE DATE(Datum)>=''" . $from . "'' AND DATE(Datum)<=''" . $to . "'' AND CisTypDokladuId=" . $typ_doklad . " GROUP BY RegistracneCislo, Nazov,MernaJednotkaNazov ORDER BY Nazov ASC";\r\n				mysql_query($query);\r\n\r\n				$query = "INSERT INTO __priprava_vyroby SELECT ''KalkulaciaVyroby'' as NazovDokladu, RegistracneCislo,Nazov, SUM(Mnozstvo) as Mnozstvo, MernaJednotkaNazov as MernaJednotkaNazov, '''' as Nakupit FROM objednavka_tovar WHERE DATE(Datum)>=''" . $from . "'' AND DATE(Datum)<=''" . $to . "'' AND CisTypDokladuId=" . $typ_doklad . " GROUP BY RegistracneCislo, Nazov,MernaJednotkaNazov ORDER BY Nazov ASC";\r\n				mysql_query($query);\r\n\r\n                                $query = "DELETE FROM _blueticket_forms WHERE FormName=''_priprava_vyroby''";\r\n				mysql_query($query);\r\n				\r\n				$query = "DELETE FROM _blueticket_forms_fields WHERE FormName=''_priprava_vyroby''";\r\n				mysql_query($query);\r\n\r\n				$query = "INSERT INTO _blueticket_forms(FormName,FormCaption,TableName) VALUES(''_priprava_vyroby'',''Sumárna kalkulácia výroby'',''__priprava_vyroby'')";\r\n				mysql_query($query);				\r\n				\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_priprava_vyroby'',''RegistracneCislo'',''Reg. cislo'',1,1,0)";\r\n				mysql_query($query);				\r\n\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_priprava_vyroby'',''Nazov'',''Nazov'',1,1,1)";\r\n				mysql_query($query);				\r\n\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_priprava_vyroby'',''Mnozstvo'',''Mnozstvo'',1,1,2)";\r\n				mysql_query($query);				\r\n\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_priprava_vyroby'',''MernaJednotkaNazov'',''MJ'',1,1,3)";\r\n				mysql_query($query);				\r\n\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_priprava_vyroby'',''Nakupit'',''Nakupit'',1,1,4)";\r\n				mysql_query($query);				\r\n\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_priprava_vyroby'',''NazovDokladu'',''Tlacovka'',1,1,5)";\r\n				mysql_query($query);				\r\n\r\necho ''_priprava_vyroby'';\r\n\r\n\r\n\r\n?>');
INSERT INTO `blueticket_scripts` (`ID`, `ScriptName`, `ScriptCaption`, `TableName`, `ScriptType`, `Script`) VALUES
(88, 'PripravaSumarnehoDL', '02. Priprava sumarneho DL s DPH', 'Od datumu po datum v tvare : RRRR-MM-DD,RRRR-MM-DD', 'SHOW', '<?php\r\n\r\n/* mysql_connect(''212.5.221.3'', ''root'', ''awqbn154'');\r\n\r\n  mysql_select_db(''blueticket'');\r\n */\r\n\r\n$karta = '''';\r\n$zauctovane = 0;\r\n// pre kazdy typ dokladu ine cislo\r\n$storno = "65,66";\r\n$typy_dokladov = "1, 60, 61, 62, 63, 67";\r\n\r\n\r\n$user_parameters = '''';\r\n\r\n\r\nforeach (explode(''|'', $_REQUEST[''Arguments'']) as $valueall) {\r\n\r\n    $z = 0;\r\n    $found = 0;\r\n    foreach (explode(''^^^'', $valueall) as $key => $value) {\r\n\r\n        if ($z == 0) {\r\n\r\n            $z = $z + 1;\r\n\r\n            if ($value == "ID") {\r\n                $found = 2;\r\n            }\r\n\r\n            if ($value == "UserParameters") {\r\n                $found = 1;\r\n            }\r\n        } else {\r\n\r\n            $z = 0;\r\n\r\n            if ($found == 1) {\r\n                $found = 0;\r\n                $array_exp = explode('','', $value);\r\n                $from_date = $array_exp[0];\r\n                $to_date = $array_exp[1];\r\n            }\r\n\r\n            if ($found == 2) {\r\n                $found = 0;\r\n                $ID = $value;\r\n            }\r\n        }\r\n    }\r\n}\r\n\r\n$z = 0;\r\n\r\n/* $from_date = "2012-04-01";\r\n  $to_date = "2012-04-20";\r\n  $ID = "6613";\r\n */\r\n\r\n/* Storna DL */\r\n\r\n$doklad_query = "SELECT * FROM Doklad WHERE DATE(Doklad.DatumDodania) >= ''$from_date'' AND DATE(Doklad.DatumDodania) <= ''$to_date'' AND Doklad.CisTypDokladuId IN (" . $storno . ") AND CisPartnerId=$ID ORDER BY Doklad.DatumDodania";\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\n$stlpce = "";\r\n$i = 0;\r\n\r\n$stlpce_insert = "";\r\n$datum_insert = "";\r\n$let_insert = "";\r\n\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    if ($i == 0) {\r\n        $stlpce = "DL" . $row[''Odvolavka''] . " VARCHAR(250), DL" . $row[''Odvolavka''] . "Spolu VARCHAR(250), DL" . $row[''Odvolavka''] . "Mnoz DECIMAL(20,4), DL" . $row[''Odvolavka''] . "PC DECIMAL(20,4)";\r\n        $stlpce_insert = "RegistracneCislo, Nazov, PredajnaCena, MJ";\r\n        $let_insert = "'''',''Cislo letu'',-10000,''''";\r\n        $datum_insert = "'''',''Datum letu'',-10000,''''";\r\n    } else {\r\n        $stlpce .= ",DL" . $row[''Odvolavka''] . " VARCHAR(250), DL" . $row[''Odvolavka''] . "Spolu VARCHAR(250), DL" . $row[''Odvolavka''] . "Mnoz DECIMAL(20,4), DL" . $row[''Odvolavka''] . "PC DECIMAL(20,4)";\r\n    }\r\n    $i++;\r\n}\r\nmysql_free_result($result);\r\n\r\n//$doklad_query = "SELECT * FROM Doklad WHERE DATE(Doklad.DatumDodania) >= ''$from_date'' AND DATE(Doklad.DatumDodania) <= ''$to_date'' AND Doklad.CisTypDokladuId IN (" . $storno . ") AND CisPartnerId=$ID ORDER BY Doklad.DatumDodania";\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    //$stlpce .= ",DL" . $row[''Odvolavka''] . " VARCHAR(250), DL" . $row[''Odvolavka''] . "Spolu VARCHAR(250), DL" . $row[''Odvolavka''] . "Mnoz DECIMAL(20,4), DL" . $row[''Odvolavka''] . "PC DECIMAL(20,4)";\r\n    $stlpce_insert .= ",DL" . $row[''Odvolavka''] . ", DL" . $row[''Odvolavka''] . "Spolu, DL" . $row[''Odvolavka''] . "Mnoz, DL" . $row[''Odvolavka''] . "PC";\r\n    $datum_insert .= ",''" . $row[''DatumDodania''] . " - " . $row[''catCateringName''] . "'','''',0,0";\r\n    $let_insert .= ",''" . $row[''catCisloLetu''] . " - " . $row[''catDestinacia''] . "'','''',0,0";\r\n}\r\n\r\nmysql_free_result($result);\r\n\r\n$query = "DROP TABLE IF EXISTS _summary_st";\r\nmysql_query($query);\r\n\r\n//echo $stlpce  . "<br/>";\r\n//echo $stlpce_insert . "<br/>";\r\n//echo $let_insert . "<br/>";\r\n//echo $stlpce_insert . "<br/>";\r\n//echo $datum_insert . "<br/>";\r\n\r\n$query = "CREATE TABLE _summary_st(RegistracneCislo VARCHAR(20), Nazov VARCHAR(255), PredajnaCena DECIMAL(20,4), MJ VARCHAR(20), " . $stlpce . ", SpoluMnozstvo DECIMAL(20,4), CelkomZaPolozku DECIMAL(20,4))";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _summary_st(" . $stlpce_insert . ") VALUES(" . $let_insert . ")";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _summary_st(" . $stlpce_insert . ") VALUES(" . $datum_insert . ")";\r\nmysql_query($query);\r\n\r\n$query = "SELECT Pohyb.*, Doklad.Odvolavka FROM Pohyb INNER JOIN Doklad ON Pohyb.DokladID=Doklad.ID WHERE DATE(Doklad.DatumDodania) >= ''$from_date'' AND DATE(Doklad.DatumDodania) <= ''$to_date'' AND Doklad.CisTypDokladuID IN (" . $storno . ") AND Doklad.CisPartnerId=$ID ORDER BY Doklad.DatumDodania";\r\n$result = mysql_query($query);\r\n\r\n$KodDokladu = 0;\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $myquery = "SELECT COUNT(*) AS Pocet FROM _summary_st WHERE RegistracneCislo = ''" . $row[''RegistracneCislo''] . "'' AND PredajnaCena=''" . $row[''PredajnaCena''] . "''";\r\n\r\n    $myresult = mysql_query($myquery);\r\n    $myrow = @mysql_fetch_assoc($myresult);\r\n\r\n    if ($myrow[''Pocet''] > 0) {\r\n        $myquery = "UPDATE _summary_st SET  PredajnaCena=" . number_format($row[''PredajnaCena''], 4, ".", "") . ", MJ=''" . $row[''MernaJednotkaNazov''] . "'', DL" . $row[''Odvolavka''] . "=''" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)), 4, ".", "") . "'', DL" . $row[''Odvolavka''] . "Spolu=''" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)) * $row[''PredajnaCena''], 4, ".", "") . " EUR'', DL" . $row[''Odvolavka''] . "Mnoz=" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)), 4, ".", "") . ", DL" . $row[''Odvolavka''] . "PC=" . number_format($row[''PredajnaCena''], 4, ".", "") . " WHERE RegistracneCislo = ''" . $row[''RegistracneCislo''] . "'' AND PredajnaCena=''" . $row[''PredajnaCena''] . "''";\r\n    } else {\r\n        $myquery = "INSERT INTO _summary_st(RegistracneCislo, Nazov, PredajnaCena, MJ, DL" . $row[''Odvolavka''] . ", DL" . $row[''Odvolavka''] . "Spolu, DL" . $row