(89, 'ZaradNaStredisko', 'Priradit karty na stredisko', 'Zadajte cislo strediska', 'SQL', '<?php\r\n\r\n$zauctovane = 0;\r\n$stredisko = 0;\r\n\r\nforeach (explode(''|'', $_REQUEST[''Arguments'']) as $valueall) {\r\n\r\n    foreach (explode(''^^^'', $valueall) as $key => $value) {\r\n\r\n        if ($z == 0) {\r\n\r\n            $z = $z + 1;\r\n\r\n            if ($value == "ID") {\r\n\r\n                $found = 2;\r\n            }\r\n\r\n            if ($value == "UserParameters") {\r\n                $found = 1;\r\n            }\r\n        } else {\r\n            $z = 0;\r\n\r\n            if ($found == 1)\r\n                $stredisko = $value;\r\n        }\r\n    }\r\n}\r\n\r\nforeach (explode(''|'', $_REQUEST[''Arguments'']) as $valueall) {\r\n    $z = 0;\r\n\r\n    $found = 0;\r\n\r\n    foreach (explode(''^^^'', $valueall) as $key => $value) {\r\n\r\n        if ($z == 0) {\r\n\r\n            $z = $z + 1;\r\n\r\n            if ($value == "ID") {\r\n                $found = 1;\r\n            }\r\n        } else {\r\n\r\n            $z = 0;\r\n\r\n            if ($found == 1) {\r\n                $found = 0;\r\n                $query = "UPDATE SkladovaKarta SET Stredisko" . $stredisko . "=1 WHERE ID=$value";\r\n                mysql_query($query);\r\n            }\r\n        }\r\n        $zauctovane = $zauctovane + 1;\r\n    }\r\n}\r\n\r\necho ''Dokoncene'';\r\n?>'),
(90, 'ZrusZoStrediska', 'Zrusit karty zo strediska', 'Zadajte cislo strediska', 'SQL', '<?php\r\n\r\n$zauctovane = 0;\r\n$stredisko = 0;\r\n\r\nforeach (explode(''|'', $_REQUEST[''Arguments'']) as $valueall) {\r\n\r\n    foreach (explode(''^^^'', $valueall) as $key => $value) {\r\n\r\n        if ($z == 0) {\r\n\r\n            $z = $z + 1;\r\n\r\n            if ($value == "ID") {\r\n\r\n                $found = 2;\r\n            }\r\n\r\n            if ($value == "UserParameters") {\r\n                $found = 1;\r\n            }\r\n        } else {\r\n            $z = 0;\r\n\r\n            if ($found == 1)\r\n                $stredisko = $value;\r\n        }\r\n    }\r\n}\r\n\r\nforeach (explode(''|'', $_REQUEST[''Arguments'']) as $valueall) {\r\n    $z = 0;\r\n\r\n    $found = 0;\r\n\r\n    foreach (explode(''^^^'', $valueall) as $key => $value) {\r\n\r\n        if ($z == 0) {\r\n\r\n            $z = $z + 1;\r\n\r\n            if ($value == "ID") {\r\n                $found = 1;\r\n            }\r\n        } else {\r\n\r\n            $z = 0;\r\n\r\n            if ($found == 1) {\r\n                $found = 0;\r\n                $query = "UPDATE SkladovaKarta SET Stredisko" . $stredisko . "=0 WHERE ID=$value";\r\n                mysql_query($query);\r\n            }\r\n        }\r\n        $zauctovane = $zauctovane + 1;\r\n    }\r\n}\r\n\r\necho ''Dokoncene'';\r\n?>'),
(91, 'SpocitajOznaceneObjednavky', 'Sumárna kalkulácia výroby z označených objednávok', 'Skript je bez parametrov', 'SHOW', '<?php\r\n\r\n$karta = '''';\r\n$zauctovane = 0;\r\n$typ_doklad = "6,68,69,70";\r\n\r\n$user_parameters = '''';\r\n\r\n\r\nforeach (explode(''|'', $_REQUEST[''Arguments'']) as $valueall) {\r\n\r\n    $z = 0;\r\n    $found = 0;\r\n    foreach (explode(''^^^'', $valueall) as $key => $value) {\r\n\r\n        if ($z == 0) {\r\n\r\n            $z = $z + 1;\r\n\r\n            if ($value == "ID") {\r\n                $found = 1;\r\n            }\r\n        } else {\r\n\r\n            $z = 0;\r\n\r\n            if ($found == 1) {\r\n                $found = 0;\r\n\r\n                if ($zauctovane == 0) {\r\n                    $user_parameters = $value;\r\n                    $zauctovane = 1;\r\n                } else {\r\n                    $user_parameters .= "," . $value;\r\n                }\r\n            }\r\n        }\r\n    }\r\n}\r\n\r\n$z = 0;\r\n\r\n$query = "DROP TABLE IF EXISTS __priprava_vyroby";\r\nmysql_query($query);\r\n\r\n$query = "DROP TABLE IF EXISTS _priprava_vyroby";\r\nmysql_query($query);\r\n\r\n$query = "CREATE TABLE _priprava_vyroby SELECT ''KalkulaciaVyroby'' as NazovDokladu, RegistracneCislo,Nazov, SUM(Mnozstvo) as Mnozstvo, SUM(SumaNC) as SumaNC, MernaJednotkaNazov as MernaJednotkaNazov, '''' as Nakupit FROM objednavka_rozpad WHERE DokladId IN($user_parameters) AND CisTypDokladuId IN(" . $typ_doklad . ") GROUP BY RegistracneCislo, Nazov,MernaJednotkaNazov ORDER BY Nazov ASC";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _priprava_vyroby SELECT ''KalkulaciaVyroby'' as NazovDokladu, RegistracneCislo,Nazov, SUM(Mnozstvo) as Mnozstvo, SUM(SumaNC) as SumaNC, MernaJednotkaNazov as MernaJednotkaNazov, '''' as Nakupit FROM objednavka_rozpad_uroven2 WHERE DokladId IN($user_parameters) AND CisTypDokladuId IN(" . $typ_doklad . ") GROUP BY RegistracneCislo, Nazov,MernaJednotkaNazov ORDER BY Nazov ASC";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _priprava_vyroby SELECT ''KalkulaciaVyroby'' as NazovDokladu, RegistracneCislo,Nazov, SUM(Mnozstvo) as Mnozstvo, SUM(SumaNC) as SumaNC, MernaJednotkaNazov as MernaJednotkaNazov, '''' as Nakupit FROM objednavka_tovar WHERE DokladId IN($user_parameters) AND CisTypDokladuId IN (" . $typ_doklad . ") GROUP BY RegistracneCislo, Nazov,MernaJednotkaNazov ORDER BY Nazov ASC";\r\nmysql_query($query);\r\n\r\n$query = "CREATE TABLE __priprava_vyroby SELECT NazovDokladu, RegistracneCislo,Nazov, SUM(Mnozstvo) as Mnozstvo, SUM(SumaNC) as SumaNC, MernaJednotkaNazov, Nakupit FROM _priprava_vyroby GROUP BY RegistracneCislo, Nazov,MernaJednotkaNazov ORDER BY Nazov ASC";\r\nmysql_query($query);\r\n\r\n$query = "DELETE FROM _blueticket_forms WHERE FormName=''_priprava_vyroby''";\r\nmysql_query($query);\r\n\r\n$query = "DELETE FROM _blueticket_forms_fields WHERE FormName=''_priprava_vyroby''";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms(FormName,FormCaption,TableName) VALUES(''_priprava_vyroby'',''Sumárna kalkulácia výroby'',''__priprava_vyroby'')";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_priprava_vyroby'',''RegistracneCislo'',''Reg. cislo'',1,1,0)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_priprava_vyroby'',''Nazov'',''Nazov'',1,1,1)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_priprava_vyroby'',''Mnozstvo'',''Mnozstvo'',1,1,2)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_priprava_vyroby'',''SumaNC'',''Suma NC bez DPH'',1,1,2)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_priprava_vyroby'',''MernaJednotkaNazov'',''MJ'',1,1,3)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_priprava_vyroby'',''Nakupit'',''Nakupit'',1,1,4)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_priprava_vyroby'',''NazovDokladu'',''Tlacovka'',1,1,5)";\r\nmysql_query($query);\r\n\r\necho ''_priprava_vyroby'';\r\n?>'),
(92, 'SKInventoryCateringKE', 'Vytvorit inventurny supis - Catering KE', NULL, 'SQL', '<?php\r\r\n$zauctovane = 0;\r\r\n\r\r\n$query = "INSERT INTO Inventura(Datum, Poznamka, Aktivna) VALUES(NOW(),''Inventura Catering KE-8'', 1)";\r\r\nmysql_query($query);\r\r\n\r\r\n$lastid = mysql_insert_id();\r\r\n$query = "INSERT INTO InventurnySupis(CiarovyKod, RegistracneCislo, KartaID, KratkyNazov, PredajnaCena, NakupnaCena, EvidencneMnozstvo, SkutocneMnozstvo, InventuraID) SELECT CiarovyKod, RegistracneCislo, ID, Nazov, PredajnaCena5, NakupnaCenaBezDPH, AktualnaZasoba, 0, " . $lastid . " FROM SkladovaKartaFullView8 WHERE (CisStavId=3 OR CisStavId=9) AND Stredisko8=1 ORDER BY TovarovaSkupinaID, Nazov";\r\r\n\r\n$zauctovane = mysql_query($query);\r\r\n\r\r\necho $zauctovane . '' vytvorenych inventurnych supisov. Cislo Inventury : '' . $lastid;\r\r\n\r\r\n?>'),
(93, 'SKInventoryCateringBA', 'Vytvorit inventurny supis - Catering BA', NULL, 'SQL', '<?php\r\r\n$zauctovane = 0;\r\r\n\r\r\n$query = "INSERT INTO Inventura(Datum, Poznamka, Aktivna) VALUES(NOW(),''Inventura Catering BA-9'', 1)";\r\r\nmysql_query($query);\r\r\n\r\r\n$lastid = mysql_insert_id();\r\r\n$query = "INSERT INTO InventurnySupis(CiarovyKod, RegistracneCislo, KartaID, KratkyNazov, PredajnaCena, NakupnaCena, EvidencneMnozstvo, SkutocneMnozstvo, InventuraID) SELECT CiarovyKod, RegistracneCislo, ID, Nazov, PredajnaCena5, NakupnaCenaBezDPH, AktualnaZasoba, 0, " . $lastid . " FROM SkladovaKartaFullView9 WHERE (CisStavId=3 OR CisStavId=9) AND Stredisko9=1 ORDER BY TovarovaSkupinaID, Nazov";\r\r\n\r\n$zauctovane = mysql_query($query);\r\r\n\r\r\necho $zauctovane . '' vytvorenych inventurnych supisov. Cislo Inventury : '' . $lastid;\r\r\n\r\r\n?>'),
(94, 'KopirujFormular', 'Vytvorit kopiu formulara', 'Zadajte nazov noveho formulara', 'SQL', '<?php\r\n\r\n$karta = '''';\r\n$zauctovane = 0;\r\n\r\n$user_parameters = '''';\r\n\r\n\r\nforeach (explode(''|'', $_REQUEST[''Arguments'']) as $valueall) {\r\n\r\n    $z = 0;\r\n    $found = 0;\r\n    foreach (explode(''^^^'', $valueall) as $key => $value) {\r\n\r\n        if ($z == 0) {\r\n\r\n            $z = $z + 1;\r\n\r\n            if ($value == "ID") {\r\n                $found = 2;\r\n            }\r\n\r\n            if ($value == "UserParameters") {\r\n                $found = 1;\r\n            }\r\n        } else {\r\n\r\n            $z = 0;\r\n\r\n            if ($found == 1) {\r\n                $found = 0;\r\n                $user_parameters = $value;\r\n            }\r\n\r\n            if ($found == 2) {\r\n                $found = 0;\r\n                $ID = $value;\r\n            }\r\n        }\r\n    }\r\n}\r\n$z = 0;\r\n$query = "SELECT FormName FROM blueticket_forms WHERE blueticket_forms.ID=$ID";\r\n$myresult = mysql_query($query);\r\n$row = mysql_fetch_assoc($myresult);\r\n$form_name = $row[''FormName''];\r\nmysql_free_result($myresult);\r\n\r\n$query = "INSERT INTO blueticket_forms(blueticket_forms.FormName,blueticket_forms.FormCaption,blueticket_forms.TableName,blueticket_forms.SelectCommandType,blueticket_forms.SelectCommand,blueticket_forms.SelectCountCommandType,blueticket_forms.SelectCountCommand,blueticket_forms.UpdateCommandType,blueticket_forms.UpdateCommand,blueticket_forms.InsertCommandType,blueticket_forms.InsertCommand,blueticket_forms.DeleteCommandType,blueticket_forms.DeleteCommand) SELECT ''$user_parameters'',blueticket_forms.FormCaption,blueticket_forms.TableName,blueticket_forms.SelectCommandType,blueticket_forms.SelectCommand,blueticket_forms.SelectCountCommandType,blueticket_forms.SelectCountCommand,blueticket_forms.UpdateCommandType,blueticket_forms.UpdateCommand,blueticket_forms.InsertCommandType,blueticket_forms.InsertCommand,blueticket_forms.DeleteCommandType,blueticket_forms.DeleteCommand FROM blueticket_forms WHERE blueticket_forms.FormName=''$form_name''";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO blueticket_forms_fields(blueticket_forms_fields.FormName,blueticket_forms_fields.FieldName,blueticket_forms_fields.FieldText,blueticket_forms_fields.LookUpField,blueticket_forms_fields.LookUpData,blueticket_forms_fields.LookUpReturnField,blueticket_forms_fields.LookUpDisplayFields,blueticket_forms_fields.List,blueticket_forms_fields.`Select`,blueticket_forms_fields.`Update`,blueticket_forms_fields.`Insert`,blueticket_forms_fields.ReadOnly,blueticket_forms_fields.AutomaticValue,blueticket_forms_fields.Priority,blueticket_forms_fields.`Password`,blueticket_forms_fields.UseInUpdate,blueticket_forms_fields.UseInInsert) SELECT ''$user_parameters'',blueticket_forms_fields.FieldName,blueticket_forms_fields.FieldText,blueticket_forms_fields.LookUpField,blueticket_forms_fields.LookUpData,blueticket_forms_fields.LookUpReturnField,blueticket_forms_fields.LookUpDisplayFields,blueticket_forms_fields.List,blueticket_forms_fields.`Select`,blueticket_forms_fields.`Update`,blueticket_forms_fields.`Insert`,blueticket_forms_fields.ReadOnly,blueticket_forms_fields.AutomaticValue,blueticket_forms_fields.Priority,blueticket_forms_fields.`Password`,blueticket_forms_fields.UseInUpdate,blueticket_forms_fields.UseInInsert FROM blueticket_forms_fields WHERE blueticket_forms_fields.FormName=''$form_name''";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO blueticket_forms_filter(blueticket_forms_filter.FormName,blueticket_forms_filter.FormArgumentName,blueticket_forms_filter.FormArgumentOperator,blueticket_forms_filter.FormArgumentValue) SELECT ''$user_parameters'',blueticket_forms_filter.FormArgumentName,blueticket_forms_filter.FormArgumentOperator,blueticket_forms_filter.FormArgumentValue FROM blueticket_forms_filter WHERE blueticket_forms_filter.FormName=''$form_name''";\r\nmysql_query($query);\r\n\r\necho ''Dokoncene. Skopirovane z formulara '' . $form_name;\r\n?>');
INSERT INTO `blueticket_scripts` (`ID`, `ScriptName`, `ScriptCaption`, `TableName`, `ScriptType`, `Script`) VALUES
(97, 'PripravaSumarnehoDLBezDPH', '01. Priprava sumarneho DL bez DPH', 'Od datumu po datum v tvare : RRRR-MM-DD,RRRR-MM-DD', 'SHOW', '<?php\r\n\r\n/* mysql_connect(''212.5.221.3'', ''root'', ''awqbn154'');\r\n\r\n  mysql_select_db(''blueticket'');\r\n */\r\n\r\n$karta = '''';\r\n$zauctovane = 0;\r\n// pre kazdy typ dokladu ine cislo\r\n$storno = "65,66";\r\n$typy_dokladov = "1, 60, 61, 62, 63, 67";\r\n\r\n\r\n$user_parameters = '''';\r\n\r\n\r\nforeach (explode(''|'', $_REQUEST[''Arguments'']) as $valueall) {\r\n\r\n    $z = 0;\r\n    $found = 0;\r\n    foreach (explode(''^^^'', $valueall) as $key => $value) {\r\n\r\n        if ($z == 0) {\r\n\r\n            $z = $z + 1;\r\n\r\n            if ($value == "ID") {\r\n                $found = 2;\r\n            }\r\n\r\n            if ($value == "UserParameters") {\r\n                $found = 1;\r\n            }\r\n        } else {\r\n\r\n            $z = 0;\r\n\r\n            if ($found == 1) {\r\n                $found = 0;\r\n                $array_exp = explode('','', $value);\r\n                $from_date = $array_exp[0];\r\n                $to_date = $array_exp[1];\r\n            }\r\n\r\n            if ($found == 2) {\r\n                $found = 0;\r\n                $ID = $value;\r\n            }\r\n        }\r\n    }\r\n}\r\n\r\n$z = 0;\r\n\r\n/* $from_date = "2012-04-01";\r\n  $to_date = "2012-04-20";\r\n  $ID = "6613";\r\n */\r\n\r\n/* Storna DL */\r\n\r\n$doklad_query = "SELECT * FROM Doklad WHERE DATE(Doklad.DatumDodania) >= ''$from_date'' AND DATE(Doklad.DatumDodania) <= ''$to_date'' AND Doklad.CisTypDokladuId IN (" . $storno . ") AND CisPartnerId=$ID ORDER BY Doklad.DatumDodania";\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\n$stlpce = "";\r\n$i = 0;\r\n\r\n$stlpce_insert = "";\r\n$datum_insert = "";\r\n$let_insert = "";\r\n\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    if ($i == 0) {\r\n        $stlpce = "DL" . $row[''Odvolavka''] . " VARCHAR(250), DL" . $row[''Odvolavka''] . "Spolu VARCHAR(250), DL" . $row[''Odvolavka''] . "Mnoz DECIMAL(20,4), DL" . $row[''Odvolavka''] . "PC DECIMAL(20,4)";\r\n        $stlpce_insert = "RegistracneCislo, Nazov, PredajnaCena, MJ";\r\n        $let_insert = "'''',''Cislo letu'',-10000,''''";\r\n        $datum_insert = "'''',''Datum letu'',-10000,''''";\r\n    } else {\r\n        $stlpce .= ",DL" . $row[''Odvolavka''] . " VARCHAR(250), DL" . $row[''Odvolavka''] . "Spolu VARCHAR(250), DL" . $row[''Odvolavka''] . "Mnoz DECIMAL(20,4), DL" . $row[''Odvolavka''] . "PC DECIMAL(20,4)";\r\n    }\r\n    $i++;\r\n}\r\nmysql_free_result($result);\r\n\r\n//$doklad_query = "SELECT * FROM Doklad WHERE DATE(Doklad.DatumDodania) >= ''$from_date'' AND DATE(Doklad.DatumDodania) <= ''$to_date'' AND Doklad.CisTypDokladuId IN (" . $storno . ") AND CisPartnerId=$ID ORDER BY Doklad.DatumDodania";\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    //$stlpce .= ",DL" . $row[''Odvolavka''] . " VARCHAR(250), DL" . $row[''Odvolavka''] . "Spolu VARCHAR(250), DL" . $row[''Odvolavka''] . "Mnoz DECIMAL(20,4), DL" . $row[''Odvolavka''] . "PC DECIMAL(20,4)";\r\n    $stlpce_insert .= ",DL" . $row[''Odvolavka''] . ", DL" . $row[''Odvolavka''] . "Spolu, DL" . $row[''Odvolavka''] . "Mnoz, DL" . $row[''Odvolavka''] . "PC";\r\n    $datum_insert .= ",''" . $row[''DatumDodania''] . " - " . $row[''catCateringName''] . "'','''',0,0";\r\n    $let_insert .= ",''" . $row[''catCisloLetu''] . " - " . $row[''catDestinacia''] . "'','''',0,0";\r\n}\r\n\r\nmysql_free_result($result);\r\n\r\n$query = "DROP TABLE IF EXISTS _summary_st";\r\nmysql_query($query);\r\n\r\n//echo $stlpce  . "<br/>";\r\n//echo $stlpce_insert . "<br/>";\r\n//echo $let_insert . "<br/>";\r\n//echo $stlpce_insert . "<br/>";\r\n//echo $datum_insert . "<br/>";\r\n\r\n$query = "CREATE TABLE _summary_st(RegistracneCislo VARCHAR(20), Nazov VARCHAR(255), PredajnaCena DECIMAL(20,4), MJ VARCHAR(20), " . $stlpce . ", SpoluMnozstvo DECIMAL(20,4), CelkomZaPolozku DECIMAL(20,4))";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _summary_st(" . $stlpce_insert . ") VALUES(" . $let_insert . ")";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _summary_st(" . $stlpce_insert . ") VALUES(" . $datum_insert . ")";\r\nmysql_query($query);\r\n\r\n$query = "SELECT Pohyb.*, Doklad.Odvolavka FROM Pohyb INNER JOIN Doklad ON Pohyb.DokladID=Doklad.ID WHERE DATE(Doklad.DatumDodania) >= ''$from_date'' AND DATE(Doklad.DatumDodania) <= ''$to_date'' AND Doklad.CisTypDokladuID IN (" . $storno . ") AND Doklad.CisPartnerId=$ID ORDER BY Doklad.DatumDodania";\r\n$result = mysql_query($query);\r\n\r\n$KodDokladu = 0;\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $myquery = "SELECT COUNT(*) AS Pocet FROM _summary_st WHERE RegistracneCislo = ''" . $row[''RegistracneCislo''] . "'' AND PredajnaCena=''" . $row[''PredajnaCena''] . "''";\r\n\r\n    $myresult = mysql_query($myquery);\r\n    $myrow = @mysql_fetch_assoc($myresult);\r\n\r\n    if ($myrow[''Pocet''] > 0) {\r\n        $myquery = "UPDATE _summary_st SET  PredajnaCena=" . number_format($row[''PredajnaCena''], 4, ".", "") . ", MJ=''" . $row[''MernaJednotkaNazov''] . "'', DL" . $row[''Odvolavka''] . "=''" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)), 4, ".", "") . "'', DL" . $row[''Odvolavka''] . "Spolu=''" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)) * $row[''PredajnaCena''], 4, ".", "") . " EUR'', DL" . $row[''Odvolavka''] . "Mnoz=" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)), 4, ".", "") . ", DL" . $row[''Odvolavka''] . "PC=" . number_format($row[''PredajnaCena''], 4, ".", "") . " WHERE RegistracneCislo = ''" . $row[''RegistracneCislo''] . "'' AND PredajnaCena=''" . $row[''PredajnaCena''] . "''";\r\n    } else {\r\n        $myquery = "INSERT INTO _summary_st(RegistracneCislo, Nazov, PredajnaCena, MJ, DL" . $row[''Odvolavka''] . ", DL" . $row[''Odvolavka''] . "Spolu, DL