$row[''catCisloLetu''] . " - " . $row[''catDestinacia''] . "'','''',0,0";\r\n}\r\n\r\nmysql_free_result($result);\r\n\r\n$query = "DROP TABLE IF EXISTS _summary_dl";\r\nmysql_query($query);\r\n\r\n//echo $stlpce  . "<br/>";\r\n//echo $stlpce_insert . "<br/>";\r\n//echo $let_insert . "<br/>";\r\n//echo $stlpce_insert . "<br/>";\r\n//echo $datum_insert . "<br/>";\r\n\r\n$query = "CREATE TABLE _summary_dl(RegistracneCislo VARCHAR(20), Nazov VARCHAR(255), PredajnaCena DECIMAL(20,4), MJ VARCHAR(20), " . $stlpce . ", SpoluMnozstvo DECIMAL(20,4), CelkomZaPolozku DECIMAL(20,4))";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _summary_dl(" . $stlpce_insert . ") VALUES(" . $let_insert . ")";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _summary_dl(" . $stlpce_insert . ") VALUES(" . $datum_insert . ")";\r\nmysql_query($query);\r\n\r\n$query = "SELECT Pohyb.*, Doklad.KodDokladu FROM Pohyb INNER JOIN Doklad ON Pohyb.DokladID=Doklad.ID WHERE DATE(Doklad.DatumDodania) >= ''$from_date'' AND DATE(Doklad.DatumDodania) <= ''$to_date'' AND Doklad.CisTypDokladuID IN (" . $typy_dokladov . ") AND Doklad.CisPartnerId=$ID ORDER BY Doklad.DatumDodania";\r\n$result = mysql_query($query);\r\n\r\n$KodDokladu = 0;\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $myquery = "SELECT COUNT(*) AS Pocet FROM _summary_dl WHERE RegistracneCislo = ''" . $row[''RegistracneCislo''] . "'' AND PredajnaCena=''" . $row[''PredajnaCena''] . "''";\r\n\r\n    $myresult = mysql_query($myquery);\r\n    $myrow = @mysql_fetch_assoc($myresult);\r\n\r\n    if ($myrow[''Pocet''] > 0) {\r\n        $qsucet = "SELECT if(SUM(DL" . $row[''KodDokladu''] . "Mnoz)<>0,SUM(DL" . $row[''KodDokladu''] . "Mnoz),0) as Mnozstvo FROM _summary_dl WHERE RegistracneCislo = ''" . $row[''RegistracneCislo''] . "'' AND PredajnaCena=''" . $row[''PredajnaCena''] . "''";\r\n        $ressucet = mysql_query($qsucet);\r\n        $rowsucet = mysql_fetch_assoc($ressucet);\r\n        \r\n        $sucet = 0;\r\n        \r\n        $sucet = $rowsucet[''Mnozstvo''];\r\n        \r\n        mysql_free_result($ressucet);\r\n        \r\n        //$myquery = "UPDATE _summary_dl SET  PredajnaCena=" . number_format($row[''PredajnaCena''], 4, ".", "") . ", MJ=''" . $row[''MernaJednotkaNazov''] . "'', DL" . $row[''KodDokladu''] . "=(IF(DL" . $row[''KodDokladu''] . ">=0),DL" . $row[''KodDokladu''] . ",0))+(" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)), 4, ".", "") . "), DL" . $row[''KodDokladu''] . "Spolu=''" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)) * $row[''PredajnaCena''], 4, ".", "") . " EUR'', DL" . $row[''KodDokladu''] . "Mnoz=(IF(DL" . $row[''KodDokladu''] . "Mnoz>=0),DL" . $row[''KodDokladu''] . "Mnoz,0))+(" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)), 4, ".", "") . "), DL" . $row[''KodDokladu''] . "PC=" . number_format($row[''PredajnaCena''], 4, ".", "") . " WHERE RegistracneCislo = ''" . $row[''RegistracneCislo''] . "'' AND PredajnaCena=''" . $row[''PredajnaCena''] . "''";\r\n        $myquery = "UPDATE _summary_dl SET  PredajnaCena=" . number_format($row[''PredajnaCena''], 4, ".", "") . ", MJ=''" . $row[''MernaJednotkaNazov''] . "'', DL" . $row[''KodDokladu''] . "=''" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)) + $sucet, 4, ".", "") . "'', DL" . $row[''KodDokladu''] . "Spolu=''" . number_format((($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)) + $sucet) * $row[''PredajnaCena''], 4, ".", "") . " EUR'', DL" . $row[''KodDokladu''] . "Mnoz=" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)) + $sucet, 4, ".", "") . ", DL" . $row[''KodDokladu''] . "PC=" . number_format($row[''PredajnaCena''], 4, ".", "") . " WHERE RegistracneCislo = ''" . $row[''RegistracneCislo''] . "'' AND PredajnaCena=''" . $row[''PredajnaCena''] . "''";\r\n        //$mnozstvo = 0;\r\n        //$myquery = "INSERT INTO _summary_dl(RegistracneCislo, Nazov, PredajnaCena, MJ, DL" . $row[''KodDokladu''] . ", DL" . $row[''KodDokladu''] . "Spolu, DL" . $row[''KodDokladu''] . "Mnoz, DL" . $row[''KodDokladu''] . "PC) VALUES(''" . $row[''RegistracneCislo''] . "'',''" . $row[''Nazov''] . "''," . number_format($row[''PredajnaCena''], 4, ".", "") . ",''" . $row[''MernaJednotkaNazov''] . "'',''" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)) + ($mnozstvo), 4, ".", "") . "'', ''" . number_format((($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)) + ($mnozstvo)) * $row[''PredajnaCena''], 4, ".", "") . "''," . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)) + ($mnozstvo), 4, ".", "") . "," . number_format($row[''PredajnaCena''], 4, ".", "") . ")";\r\n    } else {\r\n        $qodpis = "SELECT if(SUM(DL" . $row[''KodDokladu''] . "Mnoz)<>0,SUM(DL" . $row[''KodDokladu''] . "Mnoz),0) as Mnozstvo FROM _summary_st WHERE RegistracneCislo = ''" . $row[''RegistracneCislo''] . "''";\r\n        $qres = mysql_query($qodpis);\r\n        $qrow = mysql_fetch_assoc($qres);\r\n        $mnozstvo = $qrow[''Mnozstvo''];\r\n        mysql_free_result($qres);\r\n\r\n        $myquery = "INSERT INTO _summary_dl(RegistracneCislo, Nazov, PredajnaCena, MJ, DL" . $row[''KodDokladu''] . ", DL" . $row[''KodDokladu''] . "Spolu, DL" . $row[''KodDokladu''] . "Mnoz, DL" . $row[''KodDokladu''] . "PC) VALUES(''" . $row[''RegistracneCislo''] . "'',''" . $row[''Nazov''] . "''," . number_format($row[''PredajnaCena''], 4, ".", "") . ",''" . $row[''MernaJednotkaNazov''] . "'',''" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)) + ($mnozstvo), 4, ".", "") . "'', ''" . number_format((($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)) + ($mnozstvo)) * $row[''PredajnaCena''], 4, ".", "") . "''," . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)) + ($mnozstvo), 4, ".", "") . "," . number_format($row[''PredajnaCena''], 4, ".", "") . ")";\r\n    }\r\n    @mysql_free_result($myresult);\r\n\r\n    //echo $myquery . "<br/>";\r\n    mysql_query($myquery);\r\n}\r\n\r\nmysql_free_result($result);\r\n\r\n$myq = "INSERT INTO _summary_dl(RegistracneCislo, PredajnaCena, Nazov) VALUES(''Spolu za DL bez DPH'',-10000, '''')";\r\nmysql_query($myq);\r\n\r\n$myq = "INSERT INTO _summary_dl(RegistracneCislo, PredajnaCena, Nazov) VALUES(''Spolu za DL s DPH'',-10000, '''')";\r\nmysql_query($myq);\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $myq = "UPDATE _summary_dl SET DL" . $row[''KodDokladu''] . "Mnoz=0 WHERE DL" . $row[''KodDokladu''] . "Mnoz IS NULL";\r\n    mysql_query($myq);\r\n    $myq = "UPDATE _summary_dl SET DL" . $row[''KodDokladu''] . "PC=0 WHERE DL" . $row[''KodDokladu''] . "PC IS NULL";\r\n    mysql_query($myq);\r\n    $myq = "UPDATE _summary_dl SET CelkomZaPolozku = 0, SpoluMnozstvo = 0";\r\n    mysql_query($myq);\r\n}\r\nmysql_free_result($result);\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $myq = "SELECT SUM(DL" . $row[''KodDokladu''] . "Mnoz*(ROUND(DL" . $row[''KodDokladu''] . "PC*1.2,2))) as Suma FROM _summary_dl";\r\n    $res = mysql_query($myq);\r\n    $myrow = @mysql_fetch_assoc($res);\r\n    $spolu = number_format($myrow[''Suma''], 4, ".", "");\r\n    @mysql_free_result($res);\r\n    $myq = "UPDATE _summary_dl SET DL" . $row[''KodDokladu''] . " = ''" . number_format($spolu/1.2, 4, ".", "") . "'', DL" . $row[''KodDokladu''] . "Spolu = " . number_format($spolu/1.2, 4, ".", "") . ", DL" . $row[''KodDokladu''] . "PC=" . number_format($spolu/1.2, 4, ".", "") . ", DL" . $row[''KodDokladu''] . "Mnoz=1 WHERE RegistracneCislo = ''Spolu za DL bez DPH''";\r\n    mysql_query($myq);\r\n    $myq = "UPDATE _summary_dl SET DL" . $row[''KodDokladu''] . " = ''" . number_format($spolu, 4, ".", "") . "'', DL" . $row[''KodDokladu''] . "Spolu = " . number_format($spolu, 4, ".", "") . ", DL" . $row[''KodDokladu''] . "PC=" . number_format($spolu , 4, ".", "") . ", DL" . $row[''KodDokladu''] . "Mnoz=1 WHERE RegistracneCislo = ''Spolu za DL s DPH''";\r\n    mysql_query($myq);\r\n\r\n\r\n/*    $myq = "SELECT SUM(DL" . $row[''KodDokladu''] . "Mnoz*DL" . $row[''KodDokladu''] . "PC) as Suma FROM _summary_dl";\r\n    $res = mysql_query($myq);\r\n    $myrow = @mysql_fetch_assoc($res);\r\n    $spolu = number_format($myrow[''Suma''], 4, ".", "");\r\n    @mysql_free_result($res);\r\n    $myq = "UPDATE _summary_dl SET DL" . $row[''KodDokladu''] . " = ''$spolu'', DL" . $row[''KodDokladu''] . "Spolu = $spolu, DL" . $row[''KodDokladu''] . "PC=$spolu, DL" . $row[''KodDokladu''] . "Mnoz=1 WHERE RegistracneCislo = ''Spolu za DL bez DPH''";\r\n    mysql_query($myq);\r\n    $myq = "UPDATE _summary_dl SET DL" . $row[''KodDokladu''] . " = ''" . number_format($spolu * 1.2, 4, ".", "") . "'', DL" . $row[''KodDokladu''] . "Spolu = " . number_format($spolu * 1.2, 4, ".", "") . ", DL" . $row[''KodDokladu''] . "PC=" . number_format($spolu * 1.2, 4, ".", "") . ", DL" . $row[''KodDokladu''] . "Mnoz=1 WHERE RegistracneCislo = ''Spolu za DL s DPH''";\r\n    mysql_query($myq); */\r\n}\r\nmysql_free_result($result);\r\n\r\n\r\n$sumquery = "SELECT * FROM _summary_dl";\r\n$sumresult = mysql_query($sumquery);\r\n\r\nwhile ($sumrow = @mysql_fetch_assoc($sumresult)) {\r\n    $query = $doklad_query;\r\n    $result = mysql_query($query);\r\n    while ($row = mysql_fetch_assoc($result)) {\r\n        $myq = "UPDATE _summary_dl SET CelkomZaPolozku=CelkomZaPolozku+" . number_format($sumrow[''DL'' . $row[''KodDokladu''] . ''Mnoz''] * $sumrow[''DL'' . $row[''KodDokladu''] . ''PC''], 4, ".", "") . " WHERE (RegistracneCislo = ''" . $sumrow[''RegistracneCislo''] . "'' AND PredajnaCena = ''" . $sumrow[''PredajnaCena''] . "'')";\r\n        mysql_query($myq);\r\n        $myq = "UPDATE _summary_dl SET SpoluMnozstvo=SpoluMnozstvo+" . number_format($sumrow[''DL'' . $row[''KodDokladu''] . ''Mnoz''], 4, ".", "") . " WHERE (RegistracneCislo = ''" . $sumrow[''RegistracneCislo''] . "'' AND PredajnaCena = ''" . $sumrow[''PredajnaCena''] . "'')";\r\n        mysql_query($myq);\r\n    }\r\n    mysql_free_result($result);\r\n}\r\n\r\n@mysql_free_result($sumresult);\r\n\r\n/* Dodacie listy */\r\n\r\n$query = "DELETE FROM _blueticket_forms WHERE FormName=''_summary_dl''";\r\nmysql_query($query);\r\n\r\n$query = "DELETE FROM _blueticket_forms_fields WHERE FormName=''_summary_dl''";\r\nmysql_query($query);\r\n\r\n$query = "DELETE FROM _blueticket_forms_settings WHERE FormName=''_summary_dl''";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms(FormName,FormCaption,TableName) VALUES(''_summary_dl'',''SumÃ¡rny dodacÃ­ list'',''_summary_dl'')";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''RegistracneCislo'',''R.C.'',1,1,0)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''Nazov'',''Nazov'',1,1,1)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''PredajnaCena'',''PC'',1,1,2)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''MJ'',''MJ'',1,1,3)";\r\nmysql_query($query);\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\n$i = 4;\r\n\r\n$settings = "";\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''DL" . $row[''KodDokladu''] . "'',''DL" . $row[''KodDokladu''] . "'',1,1,$i)";\r\n\r\n    $settings .= "|DL" . $row[''KodDokladu''] . "^180^R";\r\n\r\n    mysql_query($query);\r\n    $i++;\r\n    //$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''DL" . $row[''KodDokladu''] . "Spolu'',''DL" . $row[''KodDokladu''] . " Spolu'',1,1,$i)";\r\n    //mysql_query($query);\r\n    //$i++;\r\n}\r\nmysql_free_result($result);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''SpoluMnozstvo'',''Mnozstvo celkom'',1,1,$i)";\r\nmysql_query($query);\r\n\r\n$i++;\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''CelkomZaPolozku'',''Celkom'',1,1,$i)";\r\nmysql_query($query);\r\n\r\n\r\n/* display table\r\n\r\n  $result = mysql_query("SELECT * FROM _summary_st");\r\n  if (!$result) {\r\n  die("Query to show fields from table failed");\r\n  }\r\n\r\n  $fields_num = mysql_num_fields($result);\r\n\r\n  echo "<h1>Table: </h1>";\r\n  echo "<table border=''1''><tr>";\r\n  // printing table headers\r\n  for ($i = 0; $i < $fields_num; $i++) {\r\n  $field = mysql_fetch_field($result);\r\n  echo "<td>{$field->name}</td>";\r\n  }\r\n  echo "</tr>\\n";\r\n  // printing table rows\r\n  while ($row = mysql_fetch_row($result)) {\r\n  echo "<tr>";\r\n\r\n  // $row is array... foreach( .. ) puts every element\r\n  // of $row to $cell variable\r\n  foreach ($row as $cell)\r\n  echo "<td>$cell</td>";\r\n\r\n  echo "</tr>\\n";\r\n  }\r\n  mysql_free_result($result);\r\n\r\n\r\n  $result = mysql_query("SELECT * FROM _summary_dl");\r\n  if (!$result) {\r\n  die("Query to show fields from table failed");\r\n  }\r\n\r\n  $fields_num = mysql_num_fields($result);\r\n\r\n  echo "<h1>Table: </h1>";\r\n  echo "<table border=''1''><tr>";\r\n  // printing table headers\r\n  for ($i = 0; $i < $fields_num; $i++) {\r\n  $field = mysql_fetch_field($result);\r\n  echo "<td>{$field->name}</td>";\r\n  }\r\n  echo "</tr>\\n";\r\n  // printing table rows\r\n  while ($row = mysql_fetch_row($result)) {\r\n  echo "<tr>";\r\n\r\n  // $row is array... foreach( .. ) puts every element\r\n  // of $row to $cell variable\r\n  foreach ($row as $cell)\r\n  echo "<td>$cell</td>";\r\n\r\n  echo "</tr>\\n";\r\n  }\r\n  mysql_free_result($result);\r\n\r\ndisplay table */\r\n\r\n$query = "DELETE FROM _summary_dl WHERE PredajnaCena = 0";\r\nmysql_query($query);\r\n\r\n$query = "UPDATE _summary_dl SET PredajnaCena = NULL WHERE PredajnaCena = -10000";\r\nmysql_query($query);\r\n\r\n$query = "SELECT * FROM Pouzivatel";\r\n$result = mysql_query($query);\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $query = "INSERT INTO _blueticket_forms_settings(UserID, FormName, UserSettings) VALUES(" . $row[''ID''] . ",''_summary_dl'',''RegistracneCislo^120^L|Nazov^250^L|PredajnaCena^60^R|MJ^30^L" . $settings . "|SpoluMnozstvo^160^R|CelkomZaPolozku^160^R|'')";\r\n    mysql_query($query);\r\n}\r\n\r\nmysql_free_result($result);\r\n\r\necho ''_summary_dl'';\r\n?>');
INSERT INTO `blueticket_scripts` (`ID`, `ScriptName`, `ScriptCaption`, `TableName`, `ScriptType`, `Script`) VALUES
(99, 'PripravaSumarnejObjednavkyBezDPH', '04. Priprava sumarnej Objednavky bez DPH', 'Od datumu po datum v tvare : RRRR-MM-DD,RRRR-MM-DD', 'SHOW', '<?php\r\n\r\n/* mysql_connect(''212.5.221.3'', ''root'', ''awqbn154'');\r\n\r\n  mysql_select_db(''blueticket'');\r\n */\r\n\r\n$karta = '''';\r\n$zauctovane = 0;\r\n// pre kazdy typ dokladu ine cislo\r\n$storno = "0";\r\n$typy_dokladov = "6";\r\n\r\n\r\n$user_parameters = '''';\r\n\r\n\r\nforeach (explode(''|'', $_REQUEST[''Arguments'']) as $valueall) {\r\n\r\n    $z = 0;\r\n    $found = 0;\r\n    foreach (explode(''^^^'', $valueall) as $key => $value) {\r\n\r\n        if ($z == 0) {\r\n\r\n            $z = $z + 1;\r\n\r\n            if ($value == "ID") {\r\n                $found = 2;\r\n            }\r\n\r\n            if ($value == "UserParameters") {\r\n                $found = 1;\r\n            }\r\n        } else {\r\n\r\n            $z = 0;\r\n\r\n            if ($found == 1) {\r\n                $found = 0;\r\n                $array_exp = explode('','', $value);\r\n                $from_date = $array_exp[0];\r\n                $to_date = $array_exp[1];\r\n            }\r\n\r\n            if ($found == 2) {\r\n                $found = 0;\r\n                $ID = $value;\r\n            }\r\n        }\r\n    }\r\n}\r\n\r\n$z = 0;\r\n\r\n/* $from_date = "2012-04-01";\r\n  $to_date = "2012-04-20";\r\n  $ID = "6613";\r\n */\r\n\r\n/* Storna OB */\r\n\r\n$doklad_query = "SELECT * FROM Doklad WHERE DATE(Doklad.DatumDodania) >= ''$from_date'' AND DATE(Doklad.DatumDodania) <= ''$to_date'' AND Doklad.CisTypDokladuId IN (" . $storno . ") AND CisPartnerId=$ID ORDER BY Doklad.DatumDodania";\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\n$stlpce = "";\r\n$i = 0;\r\n\r\n$stlpce_insert = "";\r\n$datum_insert = "";\r\n$let_insert = "";\r\n\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    if ($i == 0) {\r\n        $stlpce = "OB" . $row[''Odvolavka''] . " VARCHAR(250), OB" . $row[''Odvolavka''] . "Spolu VARCHAR(250), OB" . $row[''Odvolavka''] . "Mnoz DECIMAL(20,4), OB" . $row[''Odvolavka''] . "PC DECIMAL(20,4)";\r\n        $stlpce_insert = "RegistracneCislo, Nazov, PredajnaCena, MJ";\r\n        $let_insert = "'''',''Cislo letu'',-10000,''''";\r\n        $datum_insert = "'''',''Datum letu'',-10000,''''";\r\n    } else {\r\n        $stlpce .= ",OB" . $row[''Odvolavka''] . " VARCHAR(250), OB" . $row[''Odvolavka''] . "Spolu VARCHAR(250), OB" . $row[''Odvolavka''] . "Mnoz DECIMAL(20,4), OB" . $row[''Odvolavka''] . "PC DECIMAL(20,4)";\r\n    }\r\n    $i++;\r\n}\r\nmysql_free_result($result);\r\n\r\n//$doklad_query = "SELECT * FROM Doklad WHERE DATE(Doklad.DatumDodania) >= ''$from_date'' AND DATE(Doklad.DatumDodania) <= ''$to_date'' AND Doklad.CisTypDokladuId IN (" . $storno . ") AND CisPartnerId=$ID ORDER BY Doklad.DatumDodania";\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    //$stlpce .= ",OB" . $row[''Odvolavka''] . " VARCHAR(250), OB" . $row[''Odvolavka''] . "Spolu VARCHAR(250), OB" . $row[''Odvolavka''] . "Mnoz DECIMAL(20,4), OB" . $row[''Odvolavka''] . "PC DECIMAL(20,4)";\r\n    $stlpce_insert .= ",OB" . $row[''Odvolavka''] . ", OB" . $row[''Odvolavka''] . "Spolu, OB" . $row[''Odvolavka''] . "Mnoz, OB" . $row[''Odvolavka''] . "PC";\r\n    $datum_insert .= ",''" . $row[''DatumDodania''] . " - " . $row[''catCateringName''] . "'','''',0,0";\r\n    $let_insert .= ",''" . $row[''catCisloLetu''] . " - " . $row[''catDestinacia''] . "'','''',0,0";\r\n}\r\n\r\nmysql_free_result($result);\r\n\r\n$query = "DROP TABLE IF EXISTS _summary_st";\r\nmysql_query($query);\r\n\r\n//echo $stlpce  . "<br/>";\r\n//echo $stlpce_insert . "<br/>";\r\n//echo $let_insert . "<br/>";\r\n//echo $stlpce_insert . "<br/>";\r\n//echo $datum_insert . "<br/>";\r\n\r\n$query = "CREATE TABLE _summary_st(RegistracneCislo VARCHAR(20), Nazov VARCHAR(255), PredajnaCena DECIMAL(20,4), MJ VARCHAR(20), " . $stlpce . ", SpoluMnozstvo DECIMAL(20,4), CelkomZaPolozku DECIMAL(20,4))";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _summary_st(" . $stlpce_insert . ") VALUES(" . $let_insert . ")";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _summary_st(" . $stlpce_insert . ") VALUES(" . $datum_insert . ")";\r\nmysql_query($query);\r\n\r\n$query = "SELECT Pohyb.*, Doklad.Odvolavka FROM Pohyb INNER JOIN Doklad ON Pohyb.DokladID=Doklad.ID WHERE DATE(Doklad.DatumDodania) >= ''$from_date'' AND DATE(Doklad.DatumDodania) <= ''$to_date'' AND Doklad.CisTypDokladuID IN (" . $storno . ") AND Doklad.CisPartnerId=$ID ORDER BY Doklad.DatumDodania";\r\n$result = mysql_query($query);\r\n\r\n$KodDokladu = 0;\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $myquery = "SELECT COUNT(*) AS Pocet FROM _summary_st WHERE RegistracneCislo = ''" . $row[''RegistracneCislo''] . "'' AND PredajnaCena=''" . $row[''PredajnaCena''] . "''";\r\n\r\n    $myresult = mysql_query($myquery);\r\n    $myrow = @mysql_fetch_assoc($myresult);\r\n\r\n    if ($myrow[''Pocet''] > 0) {\r\n        $myquery = "UPDATE _summary_st SET  PredajnaCena=" . number_format($row[''PredajnaCena''], 4, ".", "") . ", MJ=''" . $row[''MernaJednotkaNazov''] . "'', OB" . $row[''Odvolavka''] . "=''" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)), 4, ".", "") . "'', OB" . $row[''Odvolavka''] . "Spolu=''" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)) * $row[''PredajnaCena''], 4, ".", "") . " EUR'', OB" . $row[''Odvolavka''] . "Mnoz=" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)), 4, ".", "") . ", OB" . $row[''Odvolavka''] . "PC=" . number_format($row[''PredajnaCena''], 4, ".", "") . " WHERE RegistracneCislo = ''" . $row[''RegistracneCislo''] . "'' AND PredajnaCena=''" . $row[''PredajnaCena''] . "''";\r\n    } else {\r\n        $myquery = "INSERT INTO _summary_st(RegistracneCislo, Nazov, PredajnaCena, MJ, OB" . $row[''Odvolavka''] . ", OB" . $row[''Odvolavka''] . "Spolu, OB" . $row[''Odvolavka''] . "Mnoz, OB" . $row[''Odvolavka''] . "PC) VALUES(''" . $row[''RegistracneCislo''] . "'',''" . $row[''Nazov''] . "''," . number_format($row[''PredajnaCena''], 4, ".", "") . ",''" . $row[''MernaJednotkaNazov''] . "'',''" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)), 4, ".", "") . "'', ''" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)) * $row[''PredajnaCena''], 4, ".", "") . "''," . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)), 4, ".", "") . "," . number_format($row[''PredajnaCena''], 4, ".", "") . ")";\r\n    }\r\n    @mysql_free_result($myresult);\r\n\r\n    //echo $myquery . "<br/>";\r\n    mysql_query($myquery);\r\n}\r\n\r\nmysql_free_result($result);\r\n\r\n$myq = "INSERT INTO _summary_st(RegistracneCislo, PredajnaCena, Nazov) VALUES(''Spolu za OB bez DPH'',-10000, '''')";\r\nmysql_query($myq);\r\n\r\n$myq = "INSERT INTO _summary_st(RegistracneCislo, PredajnaCena, Nazov) VALUES(''Spolu za OB s DPH'',-10000, '''')";\r\nmysql_query($myq);\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $myq = "UPDATE _summary_st SET OB" . $row[''Odvolavka''] . "Mnoz=0 WHERE OB" . $row[''Odvolavka''] . "Mnoz IS NULL";\r\n    mysql_query($myq);\r\n    $myq = "UPDATE _summary_st SET OB" . $row[''Odvolavka''] . "PC=0 WHERE OB" . $row[''Odvolavka''] . "PC IS NULL";\r\n    mysql_query($myq);\r\n    $myq = "UPDATE _summary_st SET CelkomZaPolozku = 0, SpoluMnozstvo = 0";\r\n    mysql_query($myq);\r\n}\r\nmysql_free_result($result);\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $myq = "SELECT SUM(OB" . $row[''Odvolavka''] . "Mnoz*(OB" . $row[''Odvolavka''] . "PC*1.2)) as Suma FROM _summary_st";\r\n    $res = mysql_query($myq);\r\n    $myrow = @mysql_fetch_assoc($res);\r\n    $spolu = number_format($myrow[''Suma''], 4, ".", "");\r\n    @mysql_free_result($res);\r\n    $myq = "UPDATE _summary_st SET OB" . $row[''Odvolavka''] . " = ''" . number_format(($spolu/1.2), 4, ".", "") . "'', OB" . $row[''Odvolavka''] . "Spolu = " . number_format(($spolu/1.2), 4, ".", "") . ", OB" . $row[''Odvolavka''] . "PC=" . number_format(($spolu/1.2), 4, ".", "") . ", OB" . $row[''Odvolavka''] . "Mnoz=1 WHERE RegistracneCislo = ''Spolu za OB bez DPH''";\r\n    mysql_query($myq);\r\n    $myq = "UPDATE _summary_st SET OB" . $row[''Odvolavka''] . " = ''" . number_format($spolu, 4, ".", "") . "'', OB" . $row[''Odvolavka''] . "Spolu = " . number_format($spolu, 4, ".", "") . ", OB" . $row[''Odvolavka''] . "PC=" . number_format($spolu , 4, ".", "") . ", OB" . $row[''Odvolavka''] . "Mnoz=1 WHERE RegistracneCislo = ''Spolu za OB s DPH''";\r\n    mysql_query($myq);\r\n}\r\nmysql_free_result($result);\r\n\r\n\r\n$sumquery = "SELECT * FROM _summary_st";\r\n$sumresult = mysql_query($sumquery);\r\n\r\nwhile ($sumrow = @mysql_fetch_assoc($sumresult)) {\r\n    $query = $doklad_query;\r\n    $result = mysql_query($query);\r\n    while ($row = mysql_fetch_assoc($result)) {\r\n        $myq = "UPDATE _summary_st SET CelkomZaPolozku=CelkomZaPolozku+" . number_format($sumrow[''OB'' . $row[''Odvolavka''] . ''Mnoz''] * $sumrow[''OB'' . $row[''Odvolavka''] . ''PC''], 4, ".", "") . " WHERE (RegistracneCislo = ''" . $sumrow[''RegistracneCislo''] . "'' AND PredajnaCena = ''" . $sumrow[''PredajnaCena''] . "'')";\r\n        mysql_query($myq);\r\n        $myq = "UPDATE _summary_st SET SpoluMnozstvo=SpoluMnozstvo+" . number_format($sumrow[''OB'' . $row[''Odvolavka''] . ''Mnoz''], 4, ".", "") . " WHERE (RegistracneCislo = ''" . $sumrow[''RegistracneCislo''] . "'' AND PredajnaCena = ''" . $sumrow[''PredajnaCena''] . "'')";\r\n        mysql_query($myq);\r\n    }\r\n    mysql_free_result($result);\r\n}\r\n\r\n@mysql_free_result($sumresult);\r\n\r\n/* Storna OB */\r\n\r\n\r\n/* Dodacie listy */\r\n\r\n$doklad_query = "SELECT * FROM Doklad WHERE DATE(Doklad.DatumDodania) >= ''$from_date'' AND DATE(Doklad.DatumDodania) <= ''$to_date'' AND Doklad.CisTypDokladuId IN (" . $typy_dokladov . ") AND CisPartnerId=$ID ORDER BY Doklad.DatumDodania";\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\n$stlpce = "";\r\n$i = 0;\r\n\r\n$stlpce_insert = "";\r\n$datum_insert = "";\r\n$let_insert = "";\r\n\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    if ($i == 0) {\r\n        $stlpce = "OB" . $row[''KodDokladu''] . " VARCHAR(250), OB" . $row[''KodDokladu''] . "Spolu VARCHAR(250), OB" . $row[''KodDokladu''] . "Mnoz DECIMAL(20,4), OB" . $row[''KodDokladu''] . "PC DECIMAL(20,4)";\r\n        $stlpce_insert = "RegistracneCislo, Nazov, PredajnaCena, MJ";\r\n        $let_insert = "'''',''Cislo letu'',-10000,''''";\r\n        $datum_insert = "'''',''Datum letu'',-10000,''''";\r\n    } else {\r\n        $stlpce .= ",OB" . $row[''KodDokladu''] . " VARCHAR(250), OB" . $row[''KodDokladu''] . "Spolu VARCHAR(250), OB" . $row[''KodDokladu''] . "Mnoz DECIMAL(20,4), OB" . $row[''KodDokladu''] . "PC DECIMAL(20,4)";\r\n    }\r\n    $i++;\r\n}\r\nmysql_free_result($result);\r\n\r\n//$doklad_query = "SELECT * FROM Doklad WHERE DATE(Doklad.DatumDodania) >= ''$from_date'' AND DATE(Doklad.DatumDodania) <= ''$to_date'' AND Doklad.CisTypDokladuId IN (" . $typy_dokladov . ") AND CisPartnerId=$ID ORDER BY Doklad.DatumDodania";\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    //$stlpce .= ",OB" . $row[''KodDokladu''] . " VARCHAR(250), OB" . $row[''KodDokladu''] . "Spolu VARCHAR(250), OB" . $row[''KodDokladu''] . "Mnoz DECIMAL(20,4), OB" . $row[''KodDokladu''] . "PC DECIMAL(20,4)";\r\n    $stlpce_insert .= ",OB" . $row[''KodDokladu''] . ", OB" . $row[''KodDokladu''] . "Spolu, OB" . $row[''KodDokladu''] . "Mnoz, OB" . $row[''KodDokladu''] . "PC";\r\n    $datum_insert .= ",''" . $row[''DatumDodania''] . " - " . $row[''catCateringName''] . "'','''',0,0";\r\n    $let_insert .= ",''" . $row[''catCisloLetu''] . " - " . $row[''catDestinacia''] . "'','''',0,0";\r\n}\r\n\r\nmysql_free_result($result);\r\n\r\n$query = "DROP TABLE IF EXISTS _summary_dl";\r\nmysql_query($query);\r\n\r\n//echo $stlpce  . "<br/>";\r\n//echo $stlpce_insert . "<br/>";\r\n//echo $let_insert . "<br/>";\r\n//echo $stlpce_insert . "<br/>";\r\n//echo $datum_insert . "<br/>";\r\n\r\n$query = "CREATE TABLE _summary_dl(RegistracneCislo VARCHAR(20), Nazov VARCHAR(255), PredajnaCena DECIMAL(20,4), MJ VARCHAR(20), " . $stlpce . ", SpoluMnozstvo DECIMAL(20,4), CelkomZaPolozku DECIMAL(20,4))";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _summary_dl(" . $stlpce_insert . ") VALUES(" . $let_insert . ")";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _summary_dl(" . $stlpce_insert . ") VALUES(" . $datum_insert . ")";\r\nmysql_query($query);\r\n\r\n$query = "SELECT Pohyb.*, Doklad.KodDokladu FROM Pohyb INNER JOIN Doklad ON Pohyb.DokladID=Doklad.ID WHERE DATE(Doklad.DatumDodania) >= ''$from_date'' AND DATE(Doklad.DatumDodania) <= ''$to_date'' AND Doklad.CisTypDokladuID IN (" . $typy_dokladov . ") AND Doklad.CisPartnerId=$ID ORDER BY Doklad.DatumDodania";\r\n$result = mysql_query($query);\r\n\r\n$KodDokladu = 0;\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $myquery = "SELECT COUNT(*) AS Pocet FROM _summary_dl WHERE RegistracneCislo = ''" . $row[''RegistracneCislo''] . "'' AND PredajnaCena=''" . $row[''PredajnaCena''] . "''";\r\n\r\n    $myresult = mysql_query($myquery);\r\n    $myrow = @mysql_fetch_assoc($myresult);\r\n\r\n    if ($myrow[''Pocet''] > 0) {\r\n        $qsucet = "SELECT if(SUM(OB" . $row[''KodDokladu''] . "Mnoz)<>0,SUM(OB" . $row[''KodDokladu''] . "Mnoz),0) as Mnozstvo FROM _summary_dl WHERE RegistracneCislo = ''" . $row[''RegistracneCislo''] . "'' AND PredajnaCena=''" . $row[''PredajnaCena''] . "''";\r\n        $ressucet = mysql_query($qsucet);\r\n        $rowsucet = mysql_fetch_assoc($ressucet);\r\n        \r\n        $sucet = 0;\r\n        \r\n        $sucet = $rowsucet[''Mnozstvo''];\r\n        \r\n        mysql_free_result($ressucet);\r\n        \r\n        //$myquery = "UPDATE _summary_dl SET  PredajnaCena=" . number_format($row[''PredajnaCena''], 4, ".", "") . ", MJ=''" . $row[''MernaJednotkaNazov''] . "'', OB" . $row[''KodDokladu''] . "=(IF(OB" . $row[''KodDokladu''] . ">=0),OB" . $row[''KodDokladu''] . ",0))+(" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)), 4, ".", "") . "), OB" . $row[''KodDokladu''] . "Spolu=''" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)) * $row[''PredajnaCena''], 4, ".", "") . " EUR'', OB" . $row[''KodDokladu''] . "Mnoz=(IF(OB" . $row[''KodDokladu''] . "Mnoz>=0),OB" . $row[''KodDokladu''] . "Mnoz,0))+(" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)), 4, ".", "") . "), OB" . $row[''KodDokladu''] . "PC=" . number_format($row[''PredajnaCena''], 4, ".", "") . " WHERE RegistracneCislo = ''" . $row[''RegistracneCislo''] . "'' AND PredajnaCena=''" . $row[''PredajnaCena''] . "''";\r\n        $myquery = "UPDATE _summary_dl SET  PredajnaCena=" . number_format($row[''PredajnaCena''], 4, ".", "") . ", MJ=''" . $row[''MernaJednotkaNazov''] . "'', OB" . $row[''KodDokladu''] . "=''" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)) + $sucet, 4, ".", "") . "'', OB" . $row[''KodDokladu''] . "Spolu=''" . number_format((($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)) + $sucet) * $row[''PredajnaCena''], 4, ".", "") . " EUR'', OB" . $row[''KodDokladu''] . "Mnoz=" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)) + $sucet, 4, ".", "") . ", OB" . $row[''KodDokladu''] . "PC=" . number_format($row[''PredajnaCena''], 4, ".", "") . " WHERE RegistracneCislo = ''" . $row[''RegistracneCislo''] . "'' AND PredajnaCena=''" . $row[''PredajnaCena''] . "''";\r\n        //$mnozstvo = 0;\r\n        //$myquery = "INSERT INTO _summary_dl(RegistracneCislo, Nazov, PredajnaCena, MJ, OB" . $row[''KodDokladu''] . ", OB" . $row[''KodDokladu''] .