);\r\n\r\n$myq = "INSERT INTO _summary_dl(RegistracneCislo, PredajnaCena, Nazov) VALUES(''Spolu za OB bez DPH'',-10000, '''')";\r\nmysql_query($myq);\r\n\r\n//$myq = "INSERT INTO _summary_dl(RegistracneCislo, PredajnaCena, Nazov) VALUES(''Spolu za OB s DPH'',-10000, '''')";\r\n//mysql_query($myq);\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $myq = "UPDATE _summary_dl SET OB" . $row[''KodDokladu''] . "Mnoz=0 WHERE OB" . $row[''KodDokladu''] . "Mnoz IS NULL";\r\n    mysql_query($myq);\r\n    $myq = "UPDATE _summary_dl SET OB" . $row[''KodDokladu''] . "PC=0 WHERE OB" . $row[''KodDokladu''] . "PC IS NULL";\r\n    mysql_query($myq);\r\n    $myq = "UPDATE _summary_dl SET CelkomZaPolozku = 0, SpoluMnozstvo = 0";\r\n    mysql_query($myq);\r\n}\r\nmysql_free_result($result);\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $myq = "SELECT SUM(OB" . $row[''KodDokladu''] . "Mnoz*(ROUND(OB" . $row[''KodDokladu''] . "PC*1.2,2))) as Suma FROM _summary_dl";\r\n    $res = mysql_query($myq);\r\n    $myrow = @mysql_fetch_assoc($res);\r\n    $spolu = number_format($myrow[''Suma''], 4, ".", "");\r\n    @mysql_free_result($res);\r\n    $myq = "UPDATE _summary_dl SET OB" . $row[''KodDokladu''] . " = ''" . number_format($spolu/1.2, 4, ".", "") . "'', OB" . $row[''KodDokladu''] . "Spolu = " . number_format($spolu/1.2, 4, ".", "") . ", OB" . $row[''KodDokladu''] . "PC=" . number_format($spolu/1.2, 4, ".", "") . ", OB" . $row[''KodDokladu''] . "Mnoz=1 WHERE RegistracneCislo = ''Spolu za OB bez DPH''";\r\n    mysql_query($myq);\r\n    $myq = "UPDATE _summary_dl SET OB" . $row[''KodDokladu''] . " = ''" . number_format($spolu, 4, ".", "") . "'', OB" . $row[''KodDokladu''] . "Spolu = " . number_format($spolu, 4, ".", "") . ", OB" . $row[''KodDokladu''] . "PC=" . number_format($spolu , 4, ".", "") . ", OB" . $row[''KodDokladu''] . "Mnoz=1 WHERE RegistracneCislo = ''Spolu za OB s DPH''";\r\n    mysql_query($myq);\r\n\r\n\r\n/*    $myq = "SELECT SUM(OB" . $row[''KodDokladu''] . "Mnoz*OB" . $row[''KodDokladu''] . "PC) as Suma FROM _summary_dl";\r\n    $res = mysql_query($myq);\r\n    $myrow = @mysql_fetch_assoc($res);\r\n    $spolu = number_format($myrow[''Suma''], 4, ".", "");\r\n    @mysql_free_result($res);\r\n    $myq = "UPDATE _summary_dl SET OB" . $row[''KodDokladu''] . " = ''$spolu'', OB" . $row[''KodDokladu''] . "Spolu = $spolu, OB" . $row[''KodDokladu''] . "PC=$spolu, OB" . $row[''KodDokladu''] . "Mnoz=1 WHERE RegistracneCislo = ''Spolu za OB bez DPH''";\r\n    mysql_query($myq);\r\n    $myq = "UPDATE _summary_dl SET OB" . $row[''KodDokladu''] . " = ''" . number_format($spolu * 1.2, 4, ".", "") . "'', OB" . $row[''KodDokladu''] . "Spolu = " . number_format($spolu * 1.2, 4, ".", "") . ", OB" . $row[''KodDokladu''] . "PC=" . number_format($spolu * 1.2, 4, ".", "") . ", OB" . $row[''KodDokladu''] . "Mnoz=1 WHERE RegistracneCislo = ''Spolu za OB s DPH''";\r\n    mysql_query($myq); */\r\n}\r\nmysql_free_result($result);\r\n\r\n\r\n$sumquery = "SELECT * FROM _summary_dl";\r\n$sumresult = mysql_query($sumquery);\r\n\r\nwhile ($sumrow = @mysql_fetch_assoc($sumresult)) {\r\n    $query = $doklad_query;\r\n    $result = mysql_query($query);\r\n    while ($row = mysql_fetch_assoc($result)) {\r\n        $myq = "UPDATE _summary_dl SET CelkomZaPolozku=CelkomZaPolozku+" . number_format($sumrow[''OB'' . $row[''KodDokladu''] . ''Mnoz''] * $sumrow[''OB'' . $row[''KodDokladu''] . ''PC''], 4, ".", "") . " WHERE (RegistracneCislo = ''" . $sumrow[''RegistracneCislo''] . "'' AND PredajnaCena = ''" . $sumrow[''PredajnaCena''] . "'')";\r\n        mysql_query($myq);\r\n        $myq = "UPDATE _summary_dl SET SpoluMnozstvo=SpoluMnozstvo+" . number_format($sumrow[''OB'' . $row[''KodDokladu''] . ''Mnoz''], 4, ".", "") . " WHERE (RegistracneCislo = ''" . $sumrow[''RegistracneCislo''] . "'' AND PredajnaCena = ''" . $sumrow[''PredajnaCena''] . "'')";\r\n        mysql_query($myq);\r\n    }\r\n    mysql_free_result($result);\r\n}\r\n\r\n@mysql_free_result($sumresult);\r\n\r\n/* Dodacie listy */\r\n\r\n$query = "DELETE FROM _blueticket_forms WHERE FormName=''_summary_dl''";\r\nmysql_query($query);\r\n\r\n$query = "DELETE FROM _blueticket_forms_fields WHERE FormName=''_summary_dl''";\r\nmysql_query($query);\r\n\r\n$query = "DELETE FROM _blueticket_forms_settings WHERE FormName=''_summary_dl''";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms(FormName,FormCaption,TableName) VALUES(''_summary_dl'',''SumÃƒÂ¡rny dodacÃƒÂ­ list'',''_summary_dl'')";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''RegistracneCislo'',''R.C.'',1,1,0)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''Nazov'',''Nazov'',1,1,1)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''PredajnaCena'',''PC'',1,1,2)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''MJ'',''MJ'',1,1,3)";\r\nmysql_query($query);\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\n$i = 4;\r\n\r\n$settings = "";\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''OB" . $row[''KodDokladu''] . "'',''OB" . $row[''KodDokladu''] . "'',1,1,$i)";\r\n\r\n    $settings .= "|OB" . $row[''KodDokladu''] . "^180^R";\r\n\r\n    mysql_query($query);\r\n    $i++;\r\n    //$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''OB" . $row[''KodDokladu''] . "Spolu'',''OB" . $row[''KodDokladu''] . " Spolu'',1,1,$i)";\r\n    //mysql_query($query);\r\n    //$i++;\r\n}\r\nmysql_free_result($result);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''SpoluMnozstvo'',''Mnozstvo celkom'',1,1,$i)";\r\nmysql_query($query);\r\n\r\n$i++;\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''CelkomZaPolozku'',''Celkom'',1,1,$i)";\r\nmysql_query($query);\r\n\r\n\r\n/* display table\r\n\r\n  $result = mysql_query("SELECT * FROM _summary_st");\r\n  if (!$result) {\r\n  die("Query to show fields from table failed");\r\n  }\r\n\r\n  $fields_num = mysql_num_fields($result);\r\n\r\n  echo "<h1>Table: </h1>";\r\n  echo "<table border=''1''><tr>";\r\n  // printing table headers\r\n  for ($i = 0; $i < $fields_num; $i++) {\r\n  $field = mysql_fetch_field($result);\r\n  echo "<td>{$field->name}</td>";\r\n  }\r\n  echo "</tr>\\n";\r\n  // printing table rows\r\n  while ($row = mysql_fetch_row($result)) {\r\n  echo "<tr>";\r\n\r\n  // $row is array... foreach( .. ) puts every element\r\n  // of $row to $cell variable\r\n  foreach ($row as $cell)\r\n  echo "<td>$cell</td>";\r\n\r\n  echo "</tr>\\n";\r\n  }\r\n  mysql_free_result($result);\r\n\r\n\r\n  $result = mysql_query("SELECT * FROM _summary_dl");\r\n  if (!$result) {\r\n  die("Query to show fields from table failed");\r\n  }\r\n\r\n  $fields_num = mysql_num_fields($result);\r\n\r\n  echo "<h1>Table: </h1>";\r\n  echo "<table border=''1''><tr>";\r\n  // printing table headers\r\n  for ($i = 0; $i < $fields_num; $i++) {\r\n  $field = mysql_fetch_field($result);\r\n  echo "<td>{$field->name}</td>";\r\n  }\r\n  echo "</tr>\\n";\r\n  // printing table rows\r\n  while ($row = mysql_fetch_row($result)) {\r\n  echo "<tr>";\r\n\r\n  // $row is array... foreach( .. ) puts every element\r\n  // of $row to $cell variable\r\n  foreach ($row as $cell)\r\n  echo "<td>$cell</td>";\r\n\r\n  echo "</tr>\\n";\r\n  }\r\n  mysql_free_result($result);\r\n\r\ndisplay table */\r\n\r\n$query = "DELETE FROM _summary_dl WHERE PredajnaCena = 0";\r\nmysql_query($query);\r\n\r\n$query = "UPDATE _summary_dl SET PredajnaCena = NULL WHERE PredajnaCena = -10000";\r\nmysql_query($query);\r\n\r\n$query = "SELECT * FROM Pouzivatel";\r\n$result = mysql_query($query);\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $query = "INSERT INTO _blueticket_forms_settings(UserID, FormName, UserSettings) VALUES(" . $row[''ID''] . ",''_summary_dl'',''RegistracneCislo^120^L|Nazov^250^L|PredajnaCena^60^R|MJ^30^L" . $settings . "|SpoluMnozstvo^160^R|CelkomZaPolozku^160^R|'')";\r\n    mysql_query($query);\r\n}\r\n\r\nmysql_free_result($result);\r\n\r\necho ''_summary_dl'';\r\n?>'),
(100, 'ZaradenieTovaru', 'Oznacenie T, M, V, ...', 'Zadajte oznacenie', 'SQL', '<?php\r\n\r\n$zauctovane = 0;\r\n$stredisko = 0;\r\n\r\nforeach (explode(''|'', $_REQUEST[''Arguments'']) as $valueall) {\r\n\r\n    foreach (explode(''^^^'', $valueall) as $key => $value) {\r\n\r\n        if ($z == 0) {\r\n\r\n            $z = $z + 1;\r\n\r\n            if ($value == "ID") {\r\n\r\n                $found = 2;\r\n            }\r\n\r\n            if ($value == "UserParameters") {\r\n                $found = 1;\r\n            }\r\n        } else {\r\n            $z = 0;\r\n\r\n            if ($found == 1)\r\n                $stredisko = $value;\r\n        }\r\n    }\r\n}\r\n\r\nforeach (explode(''|'', $_REQUEST[''Arguments'']) as $valueall) {\r\n    $z = 0;\r\n\r\n    $found = 0;\r\n\r\n    foreach (explode(''^^^'', $valueall) as $key => $value) {\r\n\r\n        if ($z == 0) {\r\n\r\n            $z = $z + 1;\r\n\r\n            if ($value == "ID") {\r\n                $found = 1;\r\n            }\r\n        } else {\r\n\r\n            $z = 0;\r\n\r\n            if ($found == 1) {\r\n                $found = 0;\r\n                $query = "UPDATE SkladovaKarta SET Typ=''$stredisko'' WHERE ID=$value";\r\n                mysql_query($query);\r\n            }\r\n        }\r\n        $zauctovane = $zauctovane + 1;\r\n    }\r\n}\r\n\r\necho ''Dokoncene'';\r\n?>'),
(107, 'ObjednavkaOld', NULL, NULL, 'SHOW', '<?php\r\n\r\n/*mysql_connect(''212.5.221.3'', ''root'', ''awqbn154'');\r\n\r\nmysql_select_db(''blueticket'');*/\r\n\r\n\r\n$karta = '''';\r\n$zauctovane = 0;\r\n// pre kazdy typ dokladu ine cislo\r\n$typy_dokladov = "6";\r\n\r\n\r\n$user_parameters = '''';\r\n\r\n\r\nforeach (explode(''|'', $_REQUEST[''Arguments'']) as $valueall) {\r\n\r\n    $z = 0;\r\n    $found = 0;\r\n    foreach (explode(''^^^'', $valueall) as $key => $value) {\r\n\r\n        if ($z == 0) {\r\n\r\n            $z = $z + 1;\r\n\r\n            if ($value == "ID") {\r\n                $found = 2;\r\n            }\r\n\r\n            if ($value == "UserParameters") {\r\n                $found = 1;\r\n            }\r\n        } else {\r\n\r\n            $z = 0;\r\n\r\n            if ($found == 1) {\r\n                $found = 0;\r\n                $array_exp = explode('','', $value);\r\n                $from_date = $array_exp[0];\r\n                $to_date = $array_exp[1];\r\n            }\r\n\r\n            if ($found == 2) {\r\n                $found = 0;\r\n                $ID = $value;\r\n            }\r\n        }\r\n    }\r\n}\r\n\r\n\r\n$z = 0;\r\n\r\n/*$from_date = "2012-04-19";\r\n$to_date = "2012-04-19";\r\n$ID = "6625";\r\n*/\r\n$doklad_query = "SELECT * FROM Doklad WHERE DATE(Doklad.DatumDodania) >= ''$from_date'' AND DATE(Doklad.DatumDodania) <= ''$to_date'' AND Doklad.CisTypDokladuId IN (" . $typy_dokladov . ") AND CisPartnerId=$ID ORDER BY Doklad.DatumDodania";\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\n$stlpce = "";\r\n$i = 0;\r\n\r\n$stlpce_insert = "";\r\n$datum_insert = "";\r\n$let_insert = "";\r\n\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    if ($i == 0) {\r\n        $stlpce = "DL" . $row[''KodDokladu''] . " VARCHAR(250), DL" . $row[''KodDokladu''] . "Spolu VARCHAR(250), DL" . $row[''KodDokladu''] . "Mnoz DECIMAL(20,4), DL" . $row[''KodDokladu''] . "PC DECIMAL(20,4)";\r\n        $stlpce_insert = "RegistracneCislo, Nazov, PredajnaCena, MJ";\r\n        $let_insert = "'''',''Cislo letu'',-10000,''''";\r\n        $datum_insert = "'''',''Datum letu'',-10000,''''";\r\n    }\r\n    else\r\n    {\r\n        $stlpce .= ",DL" . $row[''KodDokladu''] . " VARCHAR(250), DL" . $row[''KodDokladu''] . "Spolu VARCHAR(250), DL" . $row[''KodDokladu''] . "Mnoz DECIMAL(20,4), DL" . $row[''KodDokladu''] . "PC DECIMAL(20,4)";\r\n    }\r\n    $i++;\r\n}\r\nmysql_free_result($result);\r\n\r\n//$doklad_query = "SELECT * FROM Doklad WHERE DATE(Doklad.DatumDodania) >= ''$from_date'' AND DATE(Doklad.DatumDodania) <= ''$to_date'' AND Doklad.CisTypDokladuId IN (" . $typy_dokladov . ") AND CisPartnerId=$ID ORDER BY Doklad.DatumDodania";\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    //$stlpce .= ",DL" . $row[''KodDokladu''] . " VARCHAR(250), DL" . $row[''KodDokladu''] . "Spolu VARCHAR(250), DL" . $row[''KodDokladu''] . "Mnoz DECIMAL(20,4), DL" . $row[''KodDokladu''] . "PC DECIMAL(20,4)";\r\n    $stlpce_insert .= ",DL" . $row[''KodDokladu''] . ", DL" . $row[''KodDokladu''] . "Spolu, DL" . $row[''KodDokladu''] . "Mnoz, DL" . $row[''KodDokladu''] . "PC";\r\n    $datum_insert .= ",''" . $row[''DatumDodania''] . " - " . $row[''catCateringName''] . "'','''',0,0";\r\n    $let_insert .= ",''" . $row[''catCisloLetu''] . " - " . $row[''catDestinacia''] . "'','''',0,0";\r\n}\r\n\r\nmysql_free_result($result);\r\n\r\n$query = "DROP TABLE IF EXISTS _summary_dl";\r\nmysql_query($query);\r\n\r\n//echo $stlpce  . "<br/>";\r\n//echo $stlpce_insert . "<br/>";\r\n//echo $let_insert . "<br/>";\r\n//echo $stlpce_insert . "<br/>";\r\n//echo $datum_insert . "<br/>";\r\n\r\n$query = "CREATE TABLE _summary_dl(RegistracneCislo VARCHAR(20), Nazov VARCHAR(255), PredajnaCena DECIMAL(20,4), MJ VARCHAR(20), " . $stlpce . ", SpoluMnozstvo DECIMAL(20,4), CelkomZaPolozku DECIMAL(20,4))";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _summary_dl(" . $stlpce_insert . ") VALUES(" . $let_insert . ")";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _summary_dl(" . $stlpce_insert . ") VALUES(" . $datum_insert . ")";\r\nmysql_query($query);\r\n\r\n$query = "SELECT Pohyb.*, Doklad.KodDokladu FROM Pohyb INNER JOIN Doklad ON Pohyb.DokladID=Doklad.ID WHERE DATE(Doklad.DatumDodania) >= ''$from_date'' AND DATE(Doklad.DatumDodania) <= ''$to_date'' AND Doklad.CisTypDokladuID IN (" . $typy_dokladov . ") AND Doklad.CisPartnerId=$ID ORDER BY Doklad.DatumDodania";\r\n$result = mysql_query($query);\r\n\r\n$KodDokladu = 0;\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $myquery = "SELECT COUNT(*) AS Pocet FROM _summary_dl WHERE RegistracneCislo = ''" . $row[''RegistracneCislo''] . "'' AND PredajnaCena=''" . $row[''PredajnaCena''] . "''";\r\n    \r\n    $myresult = mysql_query($myquery);\r\n    $myrow = @mysql_fetch_assoc($myresult);\r\n\r\n    if ($myrow[''Pocet''] > 0) {\r\n        $myquery = "UPDATE _summary_dl SET  PredajnaCena=" . number_format($row[''PredajnaCena''], 2, ".", "") . ", MJ=''" . $row[''MernaJednotkaNazov''] . "'', DL" . $row[''KodDokladu''] . "=''" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)), 2, ".", "") . "'', DL" . $row[''KodDokladu''] . "Spolu=''" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)) * $row[''PredajnaCena''], 2, ".", "") . " EUR'', DL" . $row[''KodDokladu''] . "Mnoz=" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)), 4, ".", "") . ", DL" . $row[''KodDokladu''] . "PC=" . number_format($row[''PredajnaCena''], 4, ".", "") . " WHERE RegistracneCislo = ''" . $row[''RegistracneCislo''] . "'' AND PredajnaCena=''" . $row[''PredajnaCena''] . "''";\r\n    } else {\r\n        $myquery = "INSERT INTO _summary_dl(RegistracneCislo, Nazov, PredajnaCena, MJ, DL" . $row[''KodDokladu''] . ", DL" . $row[''KodDokladu''] . "Spolu, DL" . $row[''KodDokladu''] . "Mnoz, DL" . $row[''KodDokladu''] . "PC) VALUES(''" . $row[''RegistracneCislo''] . "'',''" . $row[''Nazov''] . "''," . number_format($row[''PredajnaCena''], 2, ".", "") . ",''" . $row[''MernaJednotkaNazov''] . "'',''" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)), 2, ".", "") . "'', ''" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)) * $row[''PredajnaCena''], 2, ".", "") . "''," . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)), 4, ".", "") . "," . number_format($row[''PredajnaCena''], 4, ".", "") . ")";\r\n    }\r\n    @mysql_free_result($myresult);\r\n\r\n    //echo $myquery . "<br/>";\r\n    mysql_query($myquery);// or die ($myquery . "<br/>" . mysql_error());\r\n}\r\n\r\nmysql_free_result($result);\r\n\r\n$myq = "INSERT INTO _summary_dl(RegistracneCislo, PredajnaCena, Nazov) VALUES(''Spolu za DL bez DPH'',-10000, '''')";\r\nmysql_query($myq);\r\n\r\n//$myq = "INSERT INTO _summary_dl(RegistracneCislo, PredajnaCena, Nazov) VALUES(''Spolu za DL s DPH'',-10000, '''')";\r\n//mysql_query($myq);\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $myq = "UPDATE _summary_dl SET DL" . $row[''KodDokladu''] . "Mnoz=0 WHERE DL" . $row[''KodDokladu''] . "Mnoz IS NULL";\r\n    mysql_query($myq);\r\n    $myq = "UPDATE _summary_dl SET DL" . $row[''KodDokladu''] . "PC=0 WHERE DL" . $row[''KodDokladu''] . "PC IS NULL";\r\n    mysql_query($myq);\r\n    $myq = "UPDATE _summary_dl SET CelkomZaPolozku = 0, SpoluMnozstvo = 0";\r\n    mysql_query($myq);\r\n}\r\nmysql_free_result($result);\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $myq = "SELECT SUM(DL" . $row[''KodDokladu''] . "Mnoz*DL" . $row[''KodDokladu''] . "PC) as Suma FROM _summary_dl";\r\n    $res = mysql_query($myq);\r\n    $myrow = @mysql_fetch_assoc($res);\r\n    $spolu = number_format($myrow[''Suma''], 2);\r\n    @mysql_free_result($res);\r\n    $myq = "UPDATE _summary_dl SET DL" . $row[''KodDokladu''] . " = ''$spolu'', DL" . $row[''KodDokladu''] . "Spolu = $spolu, DL" . $row[''KodDokladu''] . "PC=$spolu, DL" . $row[''KodDokladu''] . "Mnoz=1 WHERE RegistracneCislo = ''Spolu za DL bez DPH''";\r\n    mysql_query($myq);\r\n    $myq = "UPDATE _summary_dl SET DL" . $row[''KodDokladu''] . " = ''" . number_format($spolu*1.2,2, ".", "") . "'', DL" . $row[''KodDokladu''] . "Spolu = " . number_format($spolu*1.2,2, ".", "") . ", DL" . $row[''KodDokladu''] . "PC=" . number_format($spolu*1.2,2, ".", "") . ", DL" . $row[''KodDokladu''] . "Mnoz=1 WHERE RegistracneCislo = ''Spolu za DL s DPH''";\r\n    mysql_query($myq);\r\n}\r\nmysql_free_result($result);\r\n\r\n\r\n$sumquery = "SELECT * FROM _summary_dl";\r\n$sumresult = mysql_query($sumquery);\r\n\r\nwhile ($sumrow = @mysql_fetch_assoc($sumresult)) {\r\n    $query = $doklad_query;\r\n    $result = mysql_query($query);\r\n    while ($row = mysql_fetch_assoc($result)) {\r\n        $myq = "UPDATE _summary_dl SET CelkomZaPolozku=CelkomZaPolozku+" . number_format($sumrow[''DL'' . $row[''KodDokladu''] . ''Mnoz''] * $sumrow[''DL'' . $row[''KodDokladu''] . ''PC''], 2, ".", "") . " WHERE (RegistracneCislo = ''" . $sumrow[''RegistracneCislo''] . "'' AND PredajnaCena = ''" . $sumrow[''PredajnaCena''] . "'')";\r\n        mysql_query($myq);\r\n        $myq = "UPDATE _summary_dl SET SpoluMnozstvo=SpoluMnozstvo+" . number_format($sumrow[''DL'' . $row[''KodDokladu''] . ''Mnoz''], 2, ".", "") . " WHERE (RegistracneCislo = ''" . $sumrow[''RegistracneCislo''] . "'' AND PredajnaCena = ''" . $sumrow[''PredajnaCena''] . "'')";\r\n        mysql_query($myq);\r\n    }\r\n    mysql_free_result($result);\r\n}\r\n\r\n@mysql_free_result($sumresult);\r\n\r\n\r\n$query = "DELETE FROM _blueticket_forms WHERE FormName=''_summary_dl''";\r\nmysql_query($query);\r\n\r\n$query = "DELETE FROM _blueticket_forms_fields WHERE FormName=''_summary_dl''";\r\nmysql_query($query);\r\n\r\n$query = "DELETE FROM _blueticket_forms_settings WHERE FormName=''_summary_dl''";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms(FormName,FormCaption,TableName) VALUES(''_summary_dl'',''Sumárny dodací list'',''_summary_dl'')";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''RegistracneCislo'',''R.C.'',1,1,0)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''Nazov'',''Nazov'',1,1,1)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''PredajnaCena'',''PC'',1,1,2)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''MJ'',''MJ'',1,1,3)";\r\nmysql_query($query);\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\n$i = 4;\r\n\r\n$settings = "";\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''DL" . $row[''KodDokladu''] . "'',''DL" . $row[''KodDokladu''] . "'',1,1,$i)";\r\n\r\n    $settings .= "|DL" . $row[''KodDokladu''] . "^180^R";\r\n\r\n    mysql_query($query);\r\n    $i++;\r\n    //$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''DL" . $row[''KodDokladu''] . "Spolu'',''DL" . $row[''KodDokladu''] . " Spolu'',1,1,$i)";\r\n    //mysql_query($query);\r\n    //$i++;\r\n}\r\nmysql_free_result($result);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''SpoluMnozstvo'',''Mnozstvo celkom'',1,1,$i)";\r\nmysql_query($query);\r\n\r\n$i++;\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''CelkomZaPolozku'',''Celkom'',1,1,$i)";\r\nmysql_query($query);\r\n\r\n\r\n/* display table\r\n$result = mysql_query("SELECT * FROM _summary_dl");\r\nif (!$result) {\r\n    die("Query to show fields from table failed");\r\n}\r\n\r\n$fields_num = mysql_num_fields($result);\r\n\r\necho "<h1>Table: </h1>";\r\necho "<table border=''1''><tr>";\r\n// printing table headers\r\nfor ($i = 0; $i < $fields_num; $i++) {\r\n    $field = mysql_fetch_field($result);\r\n    echo "<td>{$field->name}</td>";\r\n}\r\necho "</tr>\\n";\r\n// printing table rows\r\nwhile ($row = mysql_fetch_row($result)) {\r\n    echo "<tr>";\r\n\r\n    // $row is array... foreach( .. ) puts every element\r\n    // of $row to $cell variable\r\n    foreach ($row as $cell)\r\n        echo "<td>$cell</td>";\r\n\r\n    echo "</tr>\\n";\r\n}\r\nmysql_free_result($result);\r\n\r\ndisplay table */\r\n\r\n$query = "DELETE FROM _summary_dl WHERE PredajnaCena = 0";\r\nmysql_query($query);\r\n\r\n$query = "UPDATE _summary_dl SET PredajnaCena = NULL WHERE PredajnaCena = -10000";\r\nmysql_query($query);\r\n\r\n$query = "SELECT * FROM Pouzivatel";\r\n$result = mysql_query($query);\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $query = "INSERT INTO _blueticket_forms_settings(UserID, FormName, UserSettings) VALUES(" . $row[''ID''] . ",''_summary_dl'',''RegistracneCislo^120^L|Nazov^250^L|PredajnaCena^60^R|MJ^30^L" . $settings . "|SpoluMnozstvo^160^R|CelkomZaPolozku^160^R|'')";\r\n    mysql_query($query);\r\n}\r\n\r\nmysql_free_result($result);\r\n\r\necho ''_summary_dl'';\r\n?>'),
(101, 'OdbytPodlaTypu', 'Odbyt podla typu', 'Zadajte číslo strediska a rozsah dátumov v tvare STREDISKO,RRRR-MM-DD,RRRR-MM-DD', 'SHOW', '<?php\r\n\r\n$karta = '''';\r\n$zauctovane = 0;\r\n\r\n$user_parameters = '''';\r\n\r\n\r\nforeach(explode(''|'',$_REQUEST[''Arguments'']) as $valueall)\r\n\r\n{\r\n\r\n	$z = 0;\r\n	$found = 0;\r\n	foreach(explode(''^^^'',$valueall) as $key=>$value)\r\n\r\n	{\r\n\r\n		if( $z == 0 )\r\n\r\n		{\r\n\r\n			$z = $z+1;\r\n\r\n			if( $value=="UserParameters" )\r\n\r\n			{\r\n				$found = 1;\r\n			}\r\n\r\n		}\r\n\r\n		else\r\n\r\n		{\r\n\r\n			$z = 0;\r\n\r\n			if( $found == 1 )\r\n\r\n			{\r\n				$found = 0;\r\n				$user_parameters = $value;\r\n			}\r\n\r\n		}\r\n\r\n	}\r\n\r\n}\r\n\r\n\r\n		$params = explode('','',$user_parameters);\r\n\r\n		$stredisko=$params[0];\r\n		$from=$params[1];\r\n		$to=$params[2];\r\n\r\n			$z = 0;\r\n\r\n				$query = "DROP TABLE IF EXISTS __trzba_typ";\r\n				mysql_query($query);\r\n\r\n				$query = "CREATE TABLE __trzba_typ SELECT if(Barcode like ''99922%'',''01. Dobitie kreditu'', if(Barcode=''-1'',''02. Odpocet kreditu'',(SELECT Typ FROM SkladovaKarta WHERE SkladovaKarta.RegistracneCislo=posmonth.Barcode))) as Typ, SUM(Price*Quantity) as Subtotal,''" . $stredisko . "'' as Stredisko, PosName FROM posmonth WHERE InvoiceNumber LIKE ''00" . $stredisko . "-%'' AND DATE(InvoiceDateTime)>=''" . $from . "'' AND DATE(InvoiceDateTime)<=''" . $to . "'' GROUP BY PosName, if(Barcode like ''99922%'',''01. Dobitie kreditu'', if(Barcode=''-1'',''02. Odpocet kreditu'',(SELECT Typ FROM SkladovaKarta WHERE SkladovaKarta.RegistracneCislo=posmonth.Barcode))) ORDER BY if(Barcode like ''99922%'',''01. Dobitie kreditu'', if(Barcode=''-1'',''02. Odpocet kreditu'',(SELECT Typ FROM SkladovaKarta WHERE SkladovaKarta.RegistracneCislo=posmonth.Barcode))) ASC";\r\n				mysql_query($query);\r\n\r\n				$query = "DELETE FROM _blueticket_forms WHERE FormName=''_trzba_typ''";\r\n				mysql_query($query);\r\n				\r\n				$query = "DELETE FROM _blueticket_forms_fields WHERE FormName=''_trzba_typ''";\r\n				mysql_query($query);\r\n\r\n				$query = "INSERT INTO _blueticket_forms(FormName,FormCaption,TableName) VALUES(''_trzba_typ'',''Trzba podla typu za datum - " . $user_parameters . "'',''__trzba_typ'')";\r\n				mysql_query($query);				\r\n				\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_trzba_typ'',''Typ'',''Typ'',1,1)";\r\n				mysql_query($query);				\r\n\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_trzba_typ'',''Subtotal'',''Trzba'',1,1)";\r\n				mysql_query($query);				\r\n\r\n				$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`) VALUES(''_trzba_typ'',''PosName'',''Pokladna'',1,1)";\r\n				mysql_query($query);				\r\n\r\necho ''_trzba_typ'';\r\n\r\n\r\n\r\n?>');
INSERT INTO `blueticket_scripts` (`ID`, `ScriptName`, `ScriptCaption`, `TableName`, `ScriptType`, `Script`) VALUES
(102, 'ZobrazitDochadzku', 'Zobraziť dochádzku', 'Zadajte mesiac a rok oddelené čiarkami v tvare MM,RRRR', 'SHOW', '<?php\r\n\r\n/* mysql_connect(''212.5.221.3'', ''root'', ''awqbn154'');\r\n\r\n  mysql_select_db(''blueticket'');\r\n */\r\n\r\n$karta = '''';\r\n$zauctovane = 0;\r\n\r\n$user_parameters = '''';\r\n\r\n$month = "";\r\n$year = "";\r\n\r\n//error_reporting(E_ALL);\r\n\r\nforeach (explode(''|'', $_REQUEST[''Arguments'']) as $valueall) {\r\n\r\n    $z = 0;\r\n    $found = 0;\r\n    foreach (explode(''^^^'', $valueall) as $key => $value) {\r\n\r\n        if ($z == 0) {\r\n\r\n            $z = $z + 1;\r\n\r\n            if ($value == "ID") {\r\n                $found = 2;\r\n            }\r\n\r\n            if ($value == "UserParameters") {\r\n                $found = 1;\r\n            }\r\n        } else {\r\n\r\n            $z = 0;\r\n\r\n            if ($found == 1) {\r\n                $found = 0;\r\n                $array_exp = explode('','', $value);\r\n                $month = $array_exp[0];\r\n                $year = $array_exp[1];\r\n            }\r\n\r\n            if ($found == 2) {\r\n                $found = 0;\r\n                $ID = $value;\r\n            }\r\n        }\r\n    }\r\n}\r\n\r\n\r\n/* $month = "05";\r\n  $year = "2012";\r\n */\r\n\r\n$z = 0;\r\n\r\n$days = cal_days_in_month(CAL_GREGORIAN, $month, $year);\r\n\r\n$create_command = "CREATE TABLE _dochadzka(OsobneCislo VARCHAR(20), Karta VARCHAR(255), Meno VARCHAR(255), Priezvisko VARCHAR(255)";\r\n\r\nfor ($i = 1; $i <= $days; $i++) {\r\n    if ($i < 10) {\r\n        $create_command .= ", Den_0" . $i . " VARCHAR(255)";\r\n        $create_command .= ", Den_0" . $i . "_Spolu VARCHAR(255)";\r\n    } else {\r\n        $create_command .= ", Den_" . $i . " VARCHAR(255)";\r\n        $create_command .= ", Den_" . $i . "_Spolu VARCHAR(255)";\r\n    }\r\n}\r\n\r\n$create_command .= ")";\r\n\r\n$drop_command = "DROP TABLE IF EXISTS _dochadzka";\r\n\r\nmysql_query($drop_command);\r\nmysql_query($create_command);\r\n\r\n$table_create = "DROP TABLE IF EXISTS _dochadzkaview";\r\nmysql_query($table_create);\r\n\r\n$table_create = "CREATE TABLE _dochadzkaview SELECT * FROM dochadzkaview WHERE MONTH(Datum)=$month AND YEAR(Datum)=$year";\r\nmysql_query($table_create);\r\n\r\n$table_create = "ALTER TABLE _dochadzkaview ADD INDEX pk_Karta (Karta)";\r\nmysql_query($table_create);\r\n\r\n$table_create = "ALTER TABLE _dochadzkaview ADD INDEX pk_Datum (Datum)";\r\nmysql_query($table_create);\r\n\r\n$table_create = "ALTER TABLE _dochadzkaview ADD INDEX pk_Cas (Cas)";\r\nmysql_query($table_create);\r\n\r\n$table_create = "ALTER TABLE _dochadzka ADD INDEX pk_Karta (Karta)";\r\nmysql_query($table_create);\r\n\r\n$select = "INSERT INTO _dochadzka(OsobneCislo,Meno,Priezvisko,Karta) SELECT (SELECT Cislo FROM zamestnanci WHERE zamestnanci.CisloKarty=_dochadzkaview.Karta) as OsobneCislo, (SELECT Meno FROM zamestnanci WHERE zamestnanci.CisloKarty=_dochadzkaview.Karta) as Meno, (SELECT Priezvisko FROM zamestnanci WHERE zamestnanci.CisloKarty=_dochadzkaview.Karta) as Priezvisko, Karta FROM _dochadzkaview WHERE MONTH(Datum)=$month AND YEAR(Datum)=$year GROUP BY Karta ORDER BY (SELECT Cislo FROM zamestnanci WHERE zamestnanci.CisloKarty=_dochadzkaview.Karta)";\r\nmysql_query($select);\r\n\r\n$select = "SELECT * FROM _dochadzka";\r\n$result = mysql_query($select);\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    for ($i = 1; $i <= $days; $i++) {\r\n        $query = "SELECT MIN(Cas) as Od, MAX(Cas) as Do,TIMEDIFF(MAX(Cas),MIN(Cas)) as Spolu FROM _dochadzkaview WHERE MONTH(Datum) = $month AND YEAR(Datum) = $year AND DAY(Datum) = $i AND Karta=''" . $row[''Karta''] . "''";\r\n        $resultt = mysql_query($query);\r\n        $rowt = mysql_fetch_assoc($resultt);\r\n\r\n        $od = $rowt[''Od''];\r\n        $do = $rowt[''Do''];\r\n        $spolu = $rowt[''Spolu''];\r\n\r\n        mysql_free_result($resultt);\r\n\r\n        if ($i < 10) {\r\n            $update_command = "UPDATE _dochadzka SET Den_0" . $i . " = ''$od - $do'' WHERE Karta = ''" . $row[''Karta''] . "''";\r\n            mysql_query($update_command);\r\n            $update_command = "UPDATE _dochadzka SET Den_0" . $i . "_Spolu = ''$spolu'' WHERE Karta = ''" . $row[''Karta''] . "''";\r\n            mysql_query($update_command);\r\n        } else {\r\n            $update_command = "UPDATE _dochadzka SET Den_" . $i . " = ''$od - $do'' WHERE Karta = ''" . $row[''Karta''] . "''";\r\n            mysql_query($update_command);\r\n            $update_command = "UPDATE _dochadzka SET Den_" . $i . "_Spolu = ''$spolu'' WHERE Karta = ''" . $row[''Karta''] . "''";\r\n            mysql_query($update_command);\r\n        }\r\n    }\r\n}\r\n\r\nmysql_free_result($result);\r\n\r\n$query = "DELETE FROM _blueticket_forms WHERE FormName=''_dochadzka''";\r\nmysql_query($query);\r\n\r\n$query = "DELETE FROM _blueticket_forms_fields WHERE FormName=''_dochadzka''";\r\nmysql_query($query);\r\n\r\n$query = "DELETE FROM _blueticket_forms_settings WHERE FormName=''_dochadzka''";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms(FormName,FormCaption,TableName) VALUES(''_dochadzka'',''Dochádzka za $month / $year'',''_dochadzka'')";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_dochadzka'',''OsobneCislo'',''Osobné císlo'',1,1,0)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_dochadzka'',''Meno'',''Meno'',1,1,1)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_dochadzka'',''Priezvisko'',''Priezvisko'',1,1,2)";\r\nmysql_query($query);\r\n\r\n$posun = 3;\r\n\r\n\r\nfor ($i = 1; $i <= $days; $i++) {\r\n    if ($i < 10) {\r\n        $query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_dochadzka'',''Den_0" . $i . "'',''0" . $i . "'',1,1," . $posun . ")";\r\n        mysql_query($query);\r\n        $posun++;\r\n        $query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_dochadzka'',''Den_0" . $i . "_Spolu'',''0" . $i . " hod'',1,1," . $posun . ")";\r\n        $posun++;\r\n        mysql_query($query);\r\n    } else {\r\n        $query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_dochadzka'',''Den_" . $i . "'',''" . $i . "'',1,1," . $posun . ")";\r\n        $posun++;\r\n        mysql_query($query);\r\n        $query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_dochadzka'',''Den_" . $i . "_Spolu'',''" . $i . " hod'',1,1," . $posun . ")";\r\n        $posun++;\r\n        mysql_query($query);\r\n    }\r\n\r\n        if ($i < 10)\r\n            $settings .= "|Den_0" . $i . "^120^C|Den_0" . $i . "_Spolu^110^R";\r\n        else\r\n            $settings .= "|Den_" . $i . "^120^C|Den_" . $i . "_Spolu^110^R";\r\n}\r\n\r\n$query = "SELECT * FROM Pouzivatel";\r\n$result = mysql_query($query);\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $query = "INSERT INTO _blueticket_forms_settings(UserID, FormName, UserSettings) VALUES(" . $row[''ID''] . ",''_dochadzka'',''OsobneCislo^80^L|Meno^200^L|Priezvisko^200^L" . $settings . "'')";\r\n    mysql_query($query);\r\n}\r\n\r\nmysql_free_result($result);\r\n\r\n\r\necho ''_dochadzka'';\r\n?>'),
(103, 'KopirujPartnera', '06. Vytvorit kopiu partnera s cateringom', 'Zadajte novy obchodny nazov partnera', 'SQL', '<?php\r\n\r\n$zauctovane = 0;\r\n\r\n$user_parameters = '''';\r\n\r\n$partnerid = 0;\r\n$partner_nazov = '''';\r\n\r\nforeach (explode(''|'', $_REQUEST[''Arguments'']) as $valueall) {\r\n\r\n    $z = 0;\r\n    $found = 0;\r\n    foreach (explode(''^^^'', $valueall) as $key => $value) {\r\n\r\n        if ($z == 0) {\r\n\r\n            $z = $z + 1;\r\n\r\n            if ($value == "ID") {\r\n                $found = 2;\r\n            }\r\n\r\n            if ($value == "UserParameters") {\r\n                $found = 1;\r\n            }\r\n        } else {\r\n\r\n            $z = 0;\r\n\r\n            if ($found == 1) {\r\n                $found = 0;\r\n                $partner_nazov = $value;\r\n            }\r\n\r\n            if ($found == 2) {\r\n                $partnerid = $value;\r\n            }\r\n        }\r\n    }\r\n}\r\n$z = 0;\r\n\r\n$query = "INSERT INTO cispartner(ObchodneMeno, Aktivny) VALUES(''$partner_nazov'',1)";\r\nmysql_query($query);\r\n\r\n$id = mysql_insert_id();\r\n\r\n$query = "INSERT INTO catering(CisPartnerId, CateringName, CateringDescription) SELECT $id, CateringName, ID FROM catering WHERE CisPartnerId = $partnerid";\r\nmysql_query($query);\r\n\r\n$query = "SELECT * FROM catering WHERE CisPartnerId = $id";\r\n$result = mysql_query($query);\r\n\r\nwhile ($row = mysql_fetch_assoc($result))\r\n{\r\n    $query = "INSERT INTO catering_detail(RegistracneCislo, Mnozstvo, Uctovat, PredajnaCena, CateringId) SELECT RegistracneCislo, Mnozstvo, Uctovat, PredajnaCena, " . $row[''ID''] . " FROM catering_detail WHERE CateringId = " . $row[''CateringDescription''] . "";\r\n    mysql_query($query);\r\n}\r\n\r\nmysql_free_result($result);\r\n\r\necho "Vytvorenie partnera $partner_nazov bolo dokoncene. Najdite si noveho partnera a zadajte jeho dalsie udaje.";\r\n?>'),
(104, 'PresunSkupiny', '01. Presunut tovary do novej skupiny', 'Zadajte cislo skupiny do ktorej chcete spravit presun', 'SQL', '<?php\r\necho ''Dokoncene'';\r\n?>'),
(105, 'PresunSkupinyPolozky', '01. Presunut tovary do novej skupiny po polozkach', 'Táto akcia je bez parametrov', 'SHOW', '<?php\r\n$zauctovane = 0;\r\n\r\n$query = "DROP TABLE IF EXISTS _skcopy";\r\nmysql_query($query);\r\n\r\n$query = "CREATE TABLE _skcopy SELECT * FROM SkladovaKarta";\r\nmysql_query($query);\r\n\r\n$query = "DELETE FROM _skcopy";\r\nmysql_query($query);\r\n\r\nforeach(explode(''|'',$_REQUEST[''Arguments'']) as $valueall)\r\n{\r\n	$z = 0;\r\n	$found = 0;\r\n	foreach(explode(''^^^'',$valueall) as $key=>$value)\r\n	{\r\n		if( $z == 0 )\r\n		{\r\n			$z = $z+1;\r\n			if( $value=="ID" )\r\n			{\r\n				$found = 1;\r\n			}\r\n		}\r\n		else\r\n		{\r\n			$z = 0;\r\n			if( $found == 1 )\r\n			{\r\n				$found = 0;\r\n				$query = "INSERT INTO _skcopy SELECT * FROM SkladovaKarta WHERE TovarovaSkupinaId = " . $value;\r\n				mysql_query($query);\r\n				$zauctovane = $zauctovane + 1;\r\n			}\r\n		}\r\n	}\r\n}\r\n\r\n$query = "DELETE FROM _blueticket_forms WHERE FormName=''_skcopy''";\r\nmysql_query($query);\r\n\r\n$query = "DELETE FROM _blueticket_forms_fields WHERE FormName=''_skcopy''";\r\nmysql_query($query);\r\n\r\n$query = "DELETE FROM _blueticket_forms_nested_scripts WHERE FormName=''_skcopy''";\r\nmysql_query($query);\r\n\r\n//$query = "DELETE FROM _blueticket_forms_settings WHERE FormName=''_skcopy''";\r\n//mysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms(FormName,FormCaption,TableName) VALUES(''_skcopy'',''Vyberte karty na presun'',''_skcopy'')";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_nested_scripts(FormName,NestedScriptName) VALUES(''_skcopy'',''AktualizujKartyTS'')";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_skcopy'',''ID'',''ID'',1,1,0)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_skcopy'',''RegistracneCislo'',''R.C.'',1,1,1)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_skcopy'',''Nazov'',''Nazov'',1,1,2)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_skcopy'',''PredajnaCena'',''PC'',1,1,3)";\r\nmysql_query($query);\r\n\r\necho ''_skcopy'';\r\n\r\n?>'),
(106, 'MeskanieOld', NULL, NULL, 'SHOW', '<?php\r\n\r\n/*mysql_connect(''212.5.221.3'', ''root'', ''awqbn154'');\r\n\r\nmysql_select_db(''blueticket'');\r\n*/\r\n\r\n$karta = '''';\r\n$zauctovane = 0;\r\n// pre kazdy typ dokladu ine cislo\r\n$typy_dokladov = "0";\r\n\r\n\r\n$user_parameters = '''';\r\n\r\n\r\nforeach (explode(''|'', $_REQUEST[''Arguments'']) as $valueall) {\r\n\r\n    $z = 0;\r\n    $found = 0;\r\n    foreach (explode(''^^^'', $valueall) as $key => $value) {\r\n\r\n        if ($z == 0) {\r\n\r\n            $z = $z + 1;\r\n\r\n            if ($value == "ID") {\r\n                $found = 2;\r\n            }\r\n\r\n            if ($value == "UserParameters") {\r\n                $found = 1;\r\n            }\r\n        } else {\r\n\r\n            $z = 0;\r\n\r\n            if ($found == 1) {\r\n                $found = 0;\r\n                $array_exp = explode('','', $value);\r\n                $from_date = $array_exp[0];\r\n                $to_date = $array_exp[1];\r\n            }\r\n\r\n            if ($found == 2) {\r\n                $found = 0;\r\n                $ID = $value;\r\n            }\r\n        }\r\n    }\r\n}\r\n\r\n\r\n$z = 0;\r\n\r\n//$from_date = "2012-04-01";\r\n//$to_date = "2012-04-10";\r\n//$ID = "7045";\r\n\r\n$doklad_query = "SELECT * FROM Doklad WHERE DATE(Doklad.DatumDodania) >= ''$from_date'' AND DATE(Doklad.DatumDodania) <= ''$to_date'' AND Doklad.CisTypDokladuId IN (" . $typy_dokladov . ") AND CisPartnerId=$ID ORDER BY Doklad.DatumDodania";\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\n$stlpce = "";\r\n$i = 0;\r\n\r\n$stlpce_insert = "";\r\n$datum_insert = "";\r\n$let_insert = "";\r\n\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    if ($i == 0) {\r\n        $stlpce = "DL" . $row[''KodDokladu''] . " VARCHAR(250), DL" . $row[''KodDokladu''] . "Spolu VARCHAR(250), DL" . $row[''KodDokladu''] . "Mnoz DECIMAL(20,4), DL" . $row[''KodDokladu''] . "PC DECIMAL(20,4)";\r\n        $stlpce_insert = "RegistracneCislo, Nazov, PredajnaCena, MJ";\r\n        $let_insert = "'''',''Cislo letu'',-10000,''''";\r\n        $datum_insert = "'''',''Datum letu'',-10000,''''";\r\n    }\r\n    else\r\n    {\r\n        $stlpce .= ",DL" . $row[''KodDokladu''] . " VARCHAR(250), DL" . $row[''KodDokladu''] . "Spolu VARCHAR(250), DL" . $row[''KodDokladu''] . "Mnoz DECIMAL(20,4), DL" . $row[''KodDokladu''] . "PC DECIMAL(20,4)";\r\n    }\r\n    $i++;\r\n}\r\nmysql_free_result($result);\r\n\r\n//$doklad_query = "SELECT * FROM Doklad WHERE DATE(Doklad.DatumDodania) >= ''$from_date'' AND DATE(Doklad.DatumDodania) <= ''$to_date'' AND Doklad.CisTypDokladuId IN (" . $typy_dokladov . ") AND CisPartnerId=$ID ORDER BY Doklad.DatumDodania";\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    //$stlpce .= ",DL" . $row[''KodDokladu''] . " VARCHAR(250), DL" . $row[''KodDokladu''] . "Spolu VARCHAR(250), DL" . $row[''KodDokladu''] . "Mnoz DECIMAL(20,4), DL" . $row[''KodDokladu''] . "PC DECIMAL(20,4)";\r\n    $stlpce_insert .= ",DL" . $row[''KodDokladu''] . ", DL" . $row[''KodDokladu''] . "Spolu, DL" . $row[''KodDokladu''] . "Mnoz, DL" . $row[''KodDokladu''] . "PC";\r\n    $datum_insert .= ",''" . $row[''DatumDodania''] . " - " . $row[''catCateringName''] . "'','''',0,0";\r\n    $let_insert .= ",''" . $row[''catCisloLetu''] . " - " . $row[''catDestinacia''] . "'','''',0,0";\r\n}\r\n\r\nmysql_free_result($result);\r\n\r\n$query = "DROP TABLE IF EXISTS _summary_dl";\r\nmysql_query($query);\r\n\r\n//echo $stlpce  . "<br/>";\r\n//echo $stlpce_insert . "<br/>";\r\n//echo $let_insert . "<br/>";\r\n//echo $stlpce_insert . "<br/>";\r\n//echo $datum_insert . "<br/>";\r\n\r\n$query = "CREATE TABLE _summary_dl(RegistracneCislo VARCHAR(20), Nazov VARCHAR(255), PredajnaCena DECIMAL(20,4), MJ VARCHAR(20), " . $stlpce . ", SpoluMnozstvo DECIMAL(20,4), CelkomZaPolozku DECIMAL(20,4))";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _summary_dl(" . $stlpce_insert . ") VALUES(" . $let_insert . ")";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _summary_dl(" . $stlpce_insert . ") VALUES(" . $datum_insert . ")";\r\nmysql_query($query);\r\n\r\n$query = "SELECT Pohyb.*, Doklad.KodDokladu FROM Pohyb INNER JOIN Doklad ON Pohyb.DokladID=Doklad.ID WHERE DATE(Doklad.DatumDodania) >= ''$from_date'' AND DATE(Doklad.DatumDodania) <= ''$to_date'' AND Doklad.CisTypDokladuID IN (" . $typy_dokladov . ") AND Doklad.CisPartnerId=$ID ORDER BY Doklad.DatumDodania";\r\n$result = mysql_query($query);\r\n\r\n$KodDokladu = 0;\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $myquery = "SELECT COUNT(*) AS Pocet FROM _summary_dl WHERE RegistracneCislo = ''" . $row[''RegistracneCislo''] . "'' AND PredajnaCena=''" . $row[''PredajnaCena''] . "''";\r\n\r\n    $myresult = mysql_query($myquery);\r\n    $myrow = @mysql_fetch_assoc($myresult);\r\n\r\n    if ($myrow[''Pocet''] > 0) {\r\n        $myquery = "UPDATE _summary_dl SET  PredajnaCena=" . number_format($row[''PredajnaCena''], 2) . ", MJ=''" . $row[''MernaJednotkaNazov''] . "'', DL" . $row[''KodDokladu''] . "=''" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)), 2) . "'', DL" . $row[''KodDokladu''] . "Spolu=''" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)) * $row[''PredajnaCena''], 2) . " EUR'', DL" . $row[''KodDokladu''] . "Mnoz=" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)), 4) . ", DL" . $row[''KodDokladu''] . "PC=" . number_format($row[''PredajnaCena''], 4) . " WHERE RegistracneCislo = ''" . $row[''RegistracneCislo''] . "'' AND PredajnaCena=''" . $row[''PredajnaCena''] . "''";\r\n    } else {\r\n        $myquery = "INSERT INTO _summary_dl(RegistracneCislo, Nazov, PredajnaCena, MJ, DL" . $row[''KodDokladu''] . ", DL" . $row[''KodDokladu''] . "Spolu, DL" . $row[''KodDokladu''] . "Mnoz, DL" . $row[''KodDokladu''] . "PC) VALUES(''" . $row[''RegistracneCislo''] . "'',''" . $row[''Nazov''] . "''," . number_format($row[''PredajnaCena''], 2) . ",''" . $row[''MernaJednotkaNazov''] . "'',''" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)), 2) . "'', ''" . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)) * $row[''PredajnaCena''], 2) . "''," . number_format(($row[''Mnozstvo''] * $row[''Multiplier''] * (-1)), 4) . "," . number_format($row[''PredajnaCena''], 4) . ")";\r\n    }\r\n    @mysql_free_result($myresult);\r\n\r\n    //echo $myquery . "<br/>";\r\n    mysql_query($myquery);\r\n}\r\n\r\nmysql_free_result($result);\r\n\r\n$myq = "INSERT INTO _summary_dl(RegistracneCislo, PredajnaCena, Nazov) VALUES(''Spolu za DL bez DPH'',-10000, '''')";\r\nmysql_query($myq);\r\n\r\n$myq = "INSERT INTO _summary_dl(RegistracneCislo, PredajnaCena, Nazov) VALUES(''Spolu za DL s DPH'',-10000, '''')";\r\nmysql_query($myq);\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $myq = "UPDATE _summary_dl SET DL" . $row[''KodDokladu''] . "Mnoz=0 WHERE DL" . $row[''KodDokladu''] . "Mnoz IS NULL";\r\n    mysql_query($myq);\r\n    $myq = "UPDATE _summary_dl SET DL" . $row[''KodDokladu''] . "PC=0 WHERE DL" . $row[''KodDokladu''] . "PC IS NULL";\r\n    mysql_query($myq);\r\n    $myq = "UPDATE _summary_dl SET CelkomZaPolozku = 0, SpoluMnozstvo = 0";\r\n    mysql_query($myq);\r\n}\r\nmysql_free_result($result);\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $myq = "SELECT SUM(DL" . $row[''KodDokladu''] . "Mnoz*DL" . $row[''KodDokladu''] . "PC) as Suma FROM _summary_dl";\r\n    $res = mysql_query($myq);\r\n    $myrow = @mysql_fetch_assoc($res);\r\n    $spolu = number_format($myrow[''Suma''], 2);\r\n    @mysql_free_result($res);\r\n    $myq = "UPDATE _summary_dl SET DL" . $row[''KodDokladu''] . " = ''$spolu'', DL" . $row[''KodDokladu''] . "Spolu = $spolu, DL" . $row[''KodDokladu''] . "PC=$spolu, DL" . $row[''KodDokladu''] . "Mnoz=1 WHERE RegistracneCislo = ''Spolu za DL bez DPH''";\r\n    mysql_query($myq);\r\n    $myq = "UPDATE _summary_dl SET DL" . $row[''KodDokladu''] . " = ''" . number_format($spolu*1.2,2) . "'', DL" . $row[''KodDokladu''] . "Spolu = " . number_format($spolu*1.2,2) . ", DL" . $row[''KodDokladu''] . "PC=" . number_format($spolu*1.2,2) . ", DL" . $row[''KodDokladu''] . "Mnoz=1 WHERE RegistracneCislo = ''Spolu za DL s DPH''";\r\n    mysql_query($myq);\r\n}\r\nmysql_free_result($result);\r\n\r\n\r\n$sumquery = "SELECT * FROM _summary_dl";\r\n$sumresult = mysql_query($sumquery);\r\n\r\nwhile ($sumrow = @mysql_fetch_assoc($sumresult)) {\r\n    $query = $doklad_query;\r\n    $result = mysql_query($query);\r\n    while ($row = mysql_fetch_assoc($result)) {\r\n        $myq = "UPDATE _summary_dl SET CelkomZaPolozku=CelkomZaPolozku+" . number_format($sumrow[''DL'' . $row[''KodDokladu''] . ''Mnoz''] * $sumrow[''DL'' . $row[''KodDokladu''] . ''PC''], 2) . " WHERE (RegistracneCislo = ''" . $sumrow[''RegistracneCislo''] . "'' AND PredajnaCena = ''" . $sumrow[''PredajnaCena''] . "'')";\r\n        mysql_query($myq);\r\n        $myq = "UPDATE _summary_dl SET SpoluMnozstvo=SpoluMnozstvo+" . number_format($sumrow[''DL'' . $row[''KodDokladu''] . ''Mnoz''], 2) . " WHERE (RegistracneCislo = ''" . $sumrow[''RegistracneCislo''] . "'' AND PredajnaCena = ''" . $sumrow[''PredajnaCena''] . "'')";\r\n        mysql_query($myq);\r\n    }\r\n    mysql_free_result($result);\r\n}\r\n\r\n@mysql_free_result($sumresult);\r\n\r\n\r\n$query = "DELETE FROM _blueticket_forms WHERE FormName=''_summary_dl''";\r\nmysql_query($query);\r\n\r\n$query = "DELETE FROM _blueticket_forms_fields WHERE FormName=''_summary_dl''";\r\nmysql_query($query);\r\n\r\n$query = "DELETE FROM _blueticket_forms_settings WHERE FormName=''_summary_dl''";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms(FormName,FormCaption,TableName) VALUES(''_summary_dl'',''Sumárny dodací list'',''_summary_dl'')";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''RegistracneCislo'',''R.C.'',1,1,0)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''Nazov'',''Nazov'',1,1,1)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''PredajnaCena'',''PC'',1,1,2)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''MJ'',''MJ'',1,1,3)";\r\nmysql_query($query);\r\n\r\n$query = $doklad_query;\r\n$result = mysql_query($query);\r\n\r\n$i = 4;\r\n\r\n$settings = "";\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''DL" . $row[''KodDokladu''] . "'',''DL" . $row[''KodDokladu''] . "'',1,1,$i)";\r\n\r\n    $settings .= "|DL" . $row[''KodDokladu''] . "^180^R";\r\n\r\n    mysql_query($query);\r\n    $i++;\r\n    //$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''DL" . $row[''KodDokladu''] . "Spolu'',''DL" . $row[''KodDokladu''] . " Spolu'',1,1,$i)";\r\n    //mysql_query($query);\r\n    //$i++;\r\n}\r\nmysql_free_result($result);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''SpoluMnozstvo'',''Mnozstvo celkom'',1,1,$i)";\r\nmysql_query($query);\r\n\r\n$i++;\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_summary_dl'',''CelkomZaPolozku'',''Celkom'',1,1,$i)";\r\nmysql_query($query);\r\n\r\n\r\n/* display table\r\n$result = mysql_query("SELECT * FROM _summary_dl");\r\nif (!$result) {\r\n    die("Query to show fields from table failed");\r\n}\r\n\r\n$fields_num = mysql_num_fields($result);\r\n\r\necho "<h1>Table: </h1>";\r\necho "<table border=''1''><tr>";\r\n// printing table headers\r\nfor ($i = 0; $i < $fields_num; $i++) {\r\n    $field = mysql_fetch_field($result);\r\n    echo "<td>{$field->name}</td>";\r\n}\r\necho "</tr>\\n";\r\n// printing table rows\r\nwhile ($row = mysql_fetch_row($result)) {\r\n    echo "<tr>";\r\n\r\n    // $row is array... foreach( .. ) puts every element\r\n    // of $row to $cell variable\r\n    foreach ($row as $cell)\r\n        echo "<td>$cell</td>";\r\n\r\n    echo "</tr>\\n";\r\n}\r\nmysql_free_result($result);\r\n\r\n display table */\r\n\r\n$query = "DELETE FROM _summary_dl WHERE PredajnaCena = 0";\r\nmysql_query($query);\r\n\r\n$query = "UPDATE _summary_dl SET PredajnaCena = NULL WHERE PredajnaCena = -10000";\r\nmysql_query($query);\r\n\r\n$query = "SELECT * FROM Pouzivatel";\r\n$result = mysql_query($query);\r\n\r\nwhile ($row = mysql_fetch_assoc($result)) {\r\n    $query = "INSERT INTO _blueticket_forms_settings(UserID, FormName, UserSettings) VALUES(" . $row[''ID''] . ",''_summary_dl'',''RegistracneCislo^120^L|Nazov^250^L|PredajnaCena^60^R|MJ^30^L" . $settings . "|SpoluMnozstvo^160^R|CelkomZaPolozku^160^R|'')";\r\n    mysql_query($query);\r\n}\r\n\r\nmysql_free_result($result);\r\n\r\necho ''_summary_dl'';\r\n?>'),
(108, 'AKtualizujKartyTS', '01. Zaradit do skupiny', 'Zadajte ID Tovarovej skupiny do ktorej si prajete karty zaradit', 'SQL', '<?php\r\n$zauctovane = 0;\r\n\r\nforeach(explode(''|'',$_REQUEST[''Arguments'']) as $valueall)\r\n{\r\n	$z = 0;\r\n	$found = 0;\r\n	foreach(explode(''^^^'',$valueall) as $key=>$value)\r\n	{\r\n		if( $z == 0 )\r\n		{\r\n			$z = $z+1;\r\n			if( $value=="UserParameters" )\r\n			{\r\n				$found = 1;\r\n			}\r\n		}\r\n		else\r\n		{\r\n			$z = 0;\r\n			if( $found == 1 )\r\n			{\r\n				$found = 0;\r\n				$user_parameters = $value;\r\n			}\r\n		}\r\n	}\r\n}\r\n\r\n\r\nforeach(explode(''|'',$_REQUEST[''Arguments'']) as $valueall)\r\n{\r\n	$z = 0;\r\n	$found = 0;\r\n	foreach(explode(''^^^'',$valueall) as $key=>$value)\r\n	{\r\n		if( $z == 0 )\r\n		{\r\n			$z = $z+1;\r\n			if( $value=="ID" )\r\n			{\r\n				$found = 1;\r\n			}\r\n		}\r\n		else\r\n		{\r\n			$z = 0;\r\n			if( $found == 1 )\r\n			{\r\n				$found = 0;\r\n				$query = "UPDATE SkladovaKarta SET TovarovaSkupinaId = " . $user_parameters . " WHERE ID = $value";\r\n				mysql_query($query);\r\n				$zauctovane = $zauctovane + 1;\r\n			}\r\n		}\r\n	}\r\n}\r\n\r\n$query = "DELETE FROM _blueticket_forms WHERE FormName=''_skcopy''";\r\nmysql_query($query);\r\n\r\n$query = "DELETE FROM _blueticket_forms_fields WHERE FormName=''_skcopy''";\r\nmysql_query($query);\r\n\r\n//$query = "DELETE FROM _blueticket_forms_settings WHERE FormName=''_skcopy''";\r\n//mysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms(FormName,FormCaption,TableName) VALUES(''_skcopy'',''Vyberte karty na presun'',''_skcopy'')";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_skcopy'',''ID'',''ID'',1,1,0)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_skcopy'',''RegistracneCislo'',''R.C.'',1,1,1)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_skcopy'',''Nazov'',''Nazov'',1,1,2)";\r\nmysql_query($query);\r\n\r\n$query = "INSERT INTO _blueticket_forms_fields(FormName,FieldName,FieldText,`List`,`Select`,`Priority`) VALUES(''_skcopy'',''PredajnaCena'',''PC'',1,1,3)";\r\nmysql_query($query);\r\n\r\necho "Dokoncene mozete zavriet okno. Oznacene polozky boli presunute do skupiny: $user_parameters";\r\n\r\n?>'),
(111, 'DeaktivujKarty', '!!! Zrus vybrane karty !!!', 'Tento skript je bez parametrov', 'SQL', '<?php\r\n\r\n$zauctovane = 0;\r\n$stredisko = 0;\r\n\r\nforeach (explode(''|'', $_REQUEST[''Arguments'']) as $valueall) {\r\n\r\n    foreach (explode(''^^^'', $valueall) as $key => $value) {\r\n\r\n        if ($z == 0) {\r\n\r\n            $z = $z + 1;\r\n\r\n            if ($value == "ID") {\r\n\r\n                $found = 2;\r\n            }\r\n\r\n            if ($value == "UserParameters") {\r\n                $found = 1;\r\n            }\r\n        } else {\r\n            $z = 0;\r\n\r\n            if ($found == 1)\r\n                $stredisko = $value;\r\n        }\r\n    }\r\n}\r\n\r\nforeach (explode(''|'', $_REQUEST[''Arguments'']) as $valueall) {\r\n    $z = 0;\r\n\r\n    $found = 0;\r\n\r\n    foreach (explode(''^^^'', $valueall) as $key => $value) {\r\n\r\n        if ($z == 0) {\r\n\r\n            $z = $z + 1;\r\n\r\n            if ($value == "ID") {\r\n                $found = 1;\r\n            }\r\n        } else {\r\n\r\n            $z = 0;\r\n\r\n            if ($found == 1) {\r\n                $found = 0;\r\n                $query = "UPDATE SkladovaKarta SET CisStavId=4 WHERE ID=$value";\r\n                mysql_query($query);\r\n            }\r\n        }\r\n        $zauctovane = $zauctovane + 1;\r\n    }\r\n}\r\n\r\necho ''Dokoncene'';\r\n?>');
