('14cad247250618', 'procedure', 'WIZARDSUBFORM', 'Subform Wizard', 'setup', '14cad243c2d9ef', NULL, '', NULL, '', 0, '0', NULL, '', '', '', '', NULL, '$TN               = ''#TableName#'';\r\n$PK               = ''#PrimaryKey#'';\r\n$FK				  = ''#ForeignKey#'';\r\n$FN				  = ''#FormName#'';\r\n$formID           = uniqid(''1'');\r\n//echo $FN;\r\n//die();\r\n//======================================\r\n//         add form \r\n//======================================\r\n\r\n$insertObject       = "INSERT INTO zzsys_object (zzsys_object_id, sob_zzsys_form_id, sob_all_title, ";\r\n$insertObject    .= "sob_all_name, sob_all_column_number, sob_all_order_number, ";\r\n$insertObject    .= "sob_all_tab_title, sob_all_tab_number, sob_all_type, ";\r\n$insertObject    .= "sob_all_clone, sob_subform_table, sob_subform_primary_key, sob_subform_foreign_key,  ";\r\n$insertObject	 .= "sob_subform_sql, sob_subform_left, sob_subform_top, sob_subform_height, sob_subform_width, ";\r\n$insertObject	 .= "sob_subform_blank_rows, sob_subform_delete_box, sob_subform_title_height)";\r\n$insertObject    .= "VALUES (''$formID'', ''$FN'', ''subform_{$TN}'', ''subform_{$TN}'', ''10'', ";\r\n$insertObject    .= " ''10'', ''Subform'', ''20'', ''subform'', ''1'', ";\r\n$insertObject	 .= "''$TN'',''$PK'',''$FK'',''SELECT * FROM {$TN} WHERE $FK = \\''#id#\\'''',50,50,20,1000,3,1,2);";\r\n\r\n//print $insertObject . ''<br/>'';\r\nnuRunQuery($insertObject);\r\n//nuRunQuery("CREATE TABLE `fanste` SELECT * FROM zzsys_object WHERE zzsys_object_id = ''$formID''");\r\n\r\n\r\n//======================================\r\n//         add objects \r\n//======================================\r\n$insertObject        = "";\r\n$column              = 10;\r\n$order               = 10;\r\n\r\n$t = nuRunQuery(''SELECT #SelectedFieldNames# FROM #SelectedFieldNames# ORDER BY id'');\r\n\r\nwhile($r=db_fetch_row($t)){\r\n\r\n   $fname            = $r[0];\r\n   $ID               = uniqid(''1'');\r\n   if($order         > 100){\r\n   	$column      = $column + 10;\r\n   	$order       = 10;\r\n   }else{\r\n   	$order       = $order + 10;\r\n   }\r\n   $insertObject    .= "INSERT INTO zzsys_object ";\r\n   $insertObject    .= "(zzsys_object_id, sob_zzsys_form_id, sob_all_title, ";\r\n   $insertObject    .= "sob_all_name, sob_all_column_number, sob_all_order_number, ";\r\n   $insertObject    .= "sob_all_tab_title, sob_all_tab_number, sob_all_type, ";\r\n   $insertObject    .= "sob_all_clone, sob_text_align, sob_text_length) ";\r\n   $insertObject    .= "VALUES (''$ID'', ''$formID'', ''$fname'', ''$fname'', ''$column'', ";\r\n   $insertObject    .= " ''$order'', ''Subform'', ''20'', ''text'', ''1'', ''l'', ''10'');";\r\n\r\n\r\n   nuRunQuery($insertObject);\r\n   $insertObject   = '''';\r\n}\r\n\r\n$qry = nuRunQuery("SELECT * FROM zzsys_form WHERE zzsys_form_id = ''$FN''");\r\n$obj = mysql_fetch_object($qry);\r\n$string             = "<br/><br/>A Subform and its Objects have now been created ";\r\n$string            .= "on the $obj->sfo_name form.<br/>";\r\nprint $string;', '2010-10-07 12:07:54', '2011-03-26 13:10:58', 'globeadmin'),
('14c8dc47abd6e9', 'procedure', 'WIZARDFORM', 'Form Wizard', 'setup', '14c8dc4aec9b4f', NULL, '', NULL, '', 0, '0', NULL, '', '', '', '', NULL, '$TN               = ''#TableName#'';\r\n$PK               = ''#PrimaryKey#'';\r\n$formID           = uniqid(''1'');\r\n\r\n//======================================\r\n//         add form \r\n//======================================\r\n\r\n$insertForm       = "INSERT INTO zzsys_form (zzsys_form_id, sfo_name, sfo_title, ";\r\n$insertForm      .= "sfo_access_without_login, sfo_close_after_save, ";\r\n$insertForm      .= "sfo_refresh_after_save, sfo_sql, sfo_table, ";\r\n$insertForm      .= "sfo_primary_key, sfo_add_button, sfo_save_button, ";\r\n$insertForm      .= "sfo_delete_button, sfo_clone_button, sfo_close_button) ";\r\n$insertForm      .= "VALUES (''$formID'', ''(Wizard) $TN'', ''$TN'', ''0'', ''0'', ''1'', ";\r\n$insertForm      .= "''SELECT * FROM $TN'', ''$TN'', ''$PK'', ''1'', ''1'', ''1'', ''1'', ''0'');";\r\n\r\n\r\n//print $insertForm . ''<br/>'';\r\nnuRunQuery($insertForm);\r\n\r\n\r\n\r\n//======================================\r\n//         add browse columns \r\n//======================================\r\n$insertColumns       = "";\r\n$order               = 10;\r\n$t = nuRunQuery("SELECT #BrowseColumns# FROM #BrowseColumns# ORDER BY id");\r\n//nuRunQuery("CREATE TABLE `fanste` SELECT * FROM #BrowseColumns#");\r\n//die();\r\n\r\nwhile($r=db_fetch_row($t)){\r\n\r\n   $fname            = $r[0];\r\n   \r\n   $ID               = uniqid(''1'');\r\n   $order            = $order + 10;\r\n\r\n   $insertColumns   .= "INSERT INTO zzsys_browse ";\r\n   $insertColumns   .= "(zzsys_browse_id, sbr_zzsys_form_id, sbr_title, ";\r\n   $insertColumns   .= "sbr_display, sbr_align, ";\r\n   $insertColumns   .= "sbr_searchable, sbr_sort, sbr_sortable, ";\r\n   $insertColumns   .= "sbr_visible, sbr_order, sbr_width) VALUES (";\r\n   $insertColumns   .= "''$ID'', ''$formID'', ''$fname'', ''$fname'', ";\r\n   $insertColumns   .= "''l'', ''1'', ''$fname'', ''1'', ''1'', $order, 100);";\r\n\r\n   nuRunQuery($insertColumns);\r\n   $insertColumns   = '''';\r\n}\r\n\r\n//print $insertColumns;\r\n\r\n\r\n\r\n\r\n//======================================\r\n//         add objects \r\n//======================================\r\n$insertObject        = "";\r\n$column              = 10;\r\n$order               = 10;\r\n\r\n$t = nuRunQuery(''SELECT #SelectedFieldNames# FROM #SelectedFieldNames# ORDER BY id'');\r\n//nuRunQuery("CREATE TABLE `fanste` SELECT * FROM #SelectedFieldNames#");\r\n//die();\r\n\r\n\r\nwhile($r=db_fetch_row($t)){\r\n\r\n   $fname            = $r[0];\r\n   //echo $fname;\r\n\r\n   $ID               = uniqid(''1'');\r\n   if($order         > 100){\r\n   	$column      = $column + 10;\r\n   	$order       = 10;\r\n   }else{\r\n   	$order       = $order + 10;\r\n   }\r\n   $insertObject    .= "INSERT INTO zzsys_object ";\r\n   $insertObject    .= "(zzsys_object_id, sob_zzsys_form_id, sob_all_title, ";\r\n   $insertObject    .= "sob_all_name, sob_all_column_number, sob_all_order_number, ";\r\n   $insertObject    .= "sob_all_tab_title, sob_all_tab_number, sob_all_type, ";\r\n   $insertObject    .= "sob_all_clone, sob_text_align, sob_text_length) ";\r\n   $insertObject    .= "VALUES (''$ID'', ''$formID'', ''$fname'', ''$fname'', ''$column'', ";\r\n   $insertObject    .= " ''$order'', ''Main'', ''10'', ''text'', ''1'', ''l'', ''10'');";\r\n\r\n\r\n   nuRunQuery($insertObject);\r\n   $insertObject   = '''';\r\n}\r\n$ID                  = uniqid(''1'');\r\n\r\n$insertObject       .= "INSERT INTO zzsys_object (sob_button_zzsys_form_id, ";\r\n$insertObject       .= "zzsys_object_id, sob_zzsys_form_id, sob_all_title, ";\r\n$insertObject       .= "sob_all_name, sob_all_column_number, sob_all_order_number, ";\r\n$insertObject       .= "sob_all_tab_title, sob_all_tab_number, sob_all_type, sob_button_left, ";\r\n$insertObject       .= "sob_button_top, sob_all_clone, sob_text_align, sob_button_length) ";\r\n$insertObject       .= "VALUES ( ''$formID'', ''$ID'', ''index'', ''$TN (wizard)'', ''$TN'', ''10'', ";\r\n$insertObject       .= " ''10'', ''Wizard'', ''1000'', ''button'', ''0'', ''0'', ''10'', ''0'', ''10'');";\r\n\r\n//print $insertObject;\r\nnuRunQuery($insertObject);\r\n\r\n$string             = "<br/><br/>A Form and its Objects have now been created, ";\r\n$string            .= "along with a Button to open this Form.<br/>";\r\n$string            .= "This Button, called <font color=''red''>$TN</font>, is found ";\r\n$string            .= "on the Index Form under a Tab called Wizard<br/>";\r\n$string            .= "(The Index Form will need to be refreshed for this Button to appear)";\r\nprint "<table align=''center''><tr align=''center''><td align=''center''>$string</td></tr></table>";\r\n\r\n\r\n', '2010-09-13 15:58:10', '2011-03-26 13:10:42', 'globeadmin'),
