('14f370b6ae810f', 'lead_sheet', 'Príjemky', NULL, '0', '', '1', NULL, 'SELECT *, partners.Name FROM lead_sheets LEFT JOIN partners ON partners.ID=lead_sheets.Partner where lead_sheets.DocType=1', 'lead_sheets', 'lead_sheets.ID', '1', '1', '0', '1', '0', 'Pridať záznam', 'Uložiť', 'Zmazať', 'Kopírovať', '', '', '', 'select if(#recordID#=-1 OR length(''#clone#'')>0,1,0)', '', '', NULL, '', NULL, NULL, '', '', 'nuRunQuery("UPDATE items SET PurchasePrice=(SELECT PurchasePrice FROM lead_sheets_items WHERE lead_sheets_items.Barcode=items.RegistrationNumber AND LeadSheet=" . $recordID . " LIMIT 1) WHERE RegistrationNumber IN(SELECT Barcode FROM lead_sheets_items WHERE LeadSheet=" . $recordID . ")");\r\nnuRunQuery("UPDATE items SET Price=(SELECT Price FROM lead_sheets_items WHERE lead_sheets_items.Barcode=items.RegistrationNumber AND LeadSheet=" . $recordID . " LIMIT 1) WHERE RegistrationNumber IN(SELECT Barcode FROM lead_sheets_items WHERE LeadSheet=" . $recordID . ")");\r\n', '', '', 'function calculatetotal()\r\n{\r\n	// funkcia prepocita cely doklad a aktualizuje polia total\r\n\r\n   	theRows = Number(document.getElementById(''rowslead_sheet_items'').value);\r\n   	\r\n   	documentTotal=0;\r\n   	documentTotalPrice=0;\r\n   	\r\n	for(i=0;i<theRows;i++)\r\n	{\r\n		strlength		= ''0000''+i;\r\n		pstrlength      	= strlength.length;\r\n		PRE			= ''lead_sheet_items'' + (''0000''+i).substring(pstrlength-4);\r\n		unit			= Number(document.getElementById(PRE+''Qty'').value);\r\n		unitCost		= Number(document.getElementById(PRE+''PurchasePrice'').value);\r\n		unitPrice		= Number(document.getElementById(PRE+''Price'').value);\r\n		total			= Math.round((unit  * unitCost)*10000)/10000;\r\n		totalPrice		= Math.round((unit  * unitPrice)*10000)/10000;\r\n		documentTotal		= documentTotal + total;\r\n		documentTotalPrice	= documentTotalPrice + totalPrice;\r\n	}\r\n	\r\n	document.getElementById(''TotalPrice'').value=documentTotalPrice;\r\n	document.getElementById(''PurchasePrice'').value=documentTotal;\r\n	\r\n	nuFormat(document.getElementById(''TotalPrice''));\r\n	nuFormat(document.getElementById(''PurchasePrice''));\r\n}', '', 'lorem ipsum', '0', '2012-02-12 11:14:26', '2012-04-07 01:36:26', 'globeadmin', ''),
