('14f52ce357b43d', 'Inventory', 'Inventúra', NULL, '0', '', '1', NULL, 'SELECT * FROM inv_table INNER JOIN groups ON groups.ID = inv_table.GroupID INNER JOIN item_types ON item_types.ID = inv_table.TypeID INNER JOIN units ON units.ID=inv_table.UnitID ORDER BY groups.Name, inv_table.Name', 'inv_table', 'inv_table.ID', '1', '1', '0', '1', '0', 'Pridať záznam', 'Uložiť', 'Zmazať', 'Kopírovať', '', '', '', '', '', '', NULL, '', NULL, NULL, '', '', '', '', '', '', '', '', '0', '2012-03-04 12:36:45', '2012-03-04 12:38:51', 'globeadmin', ''),
('14f764fffbfb48', 'lead_sheet_inventory', 'Inventury', NULL, '0', '', '1', NULL, 'SELECT *, partners.Name FROM lead_sheets LEFT JOIN partners ON partners.ID=lead_sheets.Partner where lead_sheets.DocType=2', 'lead_sheets', 'lead_sheets.ID', '1', '1', '0', '1', '0', 'Pridať záznam', 'Uložiť', 'Zmazať', 'Kopírovať', '', '', '', 'select if(#recordID#=-1 OR length(''#clone#'')>0,1,0)', '', '', NULL, '', NULL, NULL, '', '', '', '', '', 'function calculatetotal()\r\n{\r\n	// funkcia prepocita cely doklad a aktualizuje polia total\r\n\r\n   	theRows = Number(document.getElementById(''rowslead_sheet_items'').value);\r\n   	\r\n   	documentTotal=0;\r\n   	documentTotalPrice=0;\r\n   	\r\n	for(i=0;i<theRows;i++)\r\n	{\r\n		strlength		= ''0000''+i;\r\n		pstrlength      	= strlength.length;\r\n		PRE			= ''lead_sheet_items'' + (''0000''+i).substring(pstrlength-4);\r\n                document.getElementById(PRE+''Qty'').value = ((document.getElementById(PRE+''RealQty'').value) - (document.getElementById(PRE+''EvidenceQty'').value));\r\n	        nuFormat(document.getElementById(PRE+''Qty'').value);\r\n		unit			= Number(document.getElementById(PRE+''Qty'').value);\r\n		unitCost		= Number(document.getElementById(PRE+''PurchasePrice'').value);\r\n		unitPrice		= Number(document.getElementById(PRE+''Price'').value);\r\n		total			= Math.round((unit  * unitCost)*10000)/10000;\r\n		totalPrice		= Math.round((unit  * unitPrice)*10000)/10000;\r\n		documentTotal		= documentTotal + total;\r\n		documentTotalPrice	= documentTotalPrice + totalPrice;\r\n	}\r\n	\r\n	document.getElementById(''TotalPrice'').value=documentTotalPrice;\r\n	document.getElementById(''PurchasePrice'').value=documentTotal;\r\n	\r\n	nuFormat(document.getElementById(''TotalPrice''));\r\n	nuFormat(document.getElementById(''PurchasePrice''));\r\n}', '', 'lorem ipsum', '0', '2012-03-31 10:59:51', '2012-04-07 02:07:48', 'globeadmin', ''),
