('14f6e2e88b936f', 'Zauctovanie pohybov', 'function zauctujPohybyPOS() {\r\n\r\n    $posdb02 = 0; //zmenit ak neexistuje posdb02\r\n\r\n\r\n    $query = "UPDATE items SET Qty=0, NoGTFlag=0";\r\n    nuRunQuery($query);\r\n    $query = "UPDATE invoices_items SET Synchronized=0 WHERE Synchronized != 3";\r\n    nuRunQuery($query);\r\n    $query = "UPDATE invoices_items_month SET Synchronized=0 WHERE Synchronized !=3";\r\n    nuRunQuery($query);\r\n    $query = "UPDATE invoices_items SET Synchronized=2 WHERE (Synchronized!=1 AND Synchronized!=3)";\r\n    nuRunQuery($query);\r\n    $query = "UPDATE invoices_items_month SET Synchronized=2 WHERE (Synchronized!=1 AND Synchronized!=3)";\r\n    nuRunQuery($query);\r\n\r\n\r\n//posdb02\r\nif($posdb02 == 1)\r\n{\r\n    $query = "UPDATE posdb02.invoices_items SET Synchronized=0 WHERE Synchronized != 3";\r\n    nuRunQuery($query);\r\n    $query = "UPDATE posdb02.invoices_items_month SET Synchronized=0 WHERE Synchronized !=3";\r\n    nuRunQuery($query);\r\n    $query = "UPDATE posdb02.invoices_items SET Synchronized=2 WHERE (Synchronized!=1 AND Synchronized!=3)";\r\n    nuRunQuery($query);\r\n    $query = "UPDATE posdb02.invoices_items_month SET Synchronized=2 WHERE (Synchronized!=1 AND Synchronized!=3)";\r\n    nuRunQuery($query);\r\n//posdb02\r\n}\r\n\r\n    //$query = "SELECT Barcode,Name,sum(Quantity) as Quantity FROM invoices_items WHERE Synchronized=2 GROUP BY Barcode, Name UNION SELECT Barcode,Name,sum(Quantity) as Quantity FROM invoices_items_month WHERE Synchronized=2 GROUP BY Barcode, Name";\r\n\r\n        $query = "SELECT items_content.ContentFrom as Barcode, sum(invoices_items.Quantity*items_content.Quantity) as Quantity from invoices_items inner join items_content on items_content.RegistrationNumber=invoices_items.Barcode WHERE invoices_items.Synchronized!=3 group by items_content.ContentFrom";\r\n    \r\n    $table = nuRunQuery($query);\r\n\r\n    while ($row = db_fetch_array($table)) {\r\n                $query = "UPDATE items SET Qty=Qty-(" . $row[''Quantity''] . ") WHERE RegistrationNumber = ''" . $row[''Barcode''] . "''";\r\n                nuRunQuery($query);\r\n                //echo "Odpis zo zlozenia : " . number_format($row[''Quantity''], 2, ''.'', '' '') . " x " . $row[''Barcode''] . " " . " (" . number_format($row[''Quantity''], 3, ''.'', '' '') . ")<br/>";\r\n        //echo ''<hr/>'';\r\n    }\r\n\r\n    mysql_free_result($table);\r\n\r\n    $query = "SELECT invoices_items.Barcode as Barcode, invoices_items.Quantity as Quantity from invoices_items left join items_content on items_content.RegistrationNumber=invoices_items.Barcode WHERE invoices_items.Synchronized!=3 and items_content.RegistrationNumber is null";\r\n    $table = nuRunQuery($query);\r\n\r\n    while ($row = db_fetch_array($table)) {\r\n                $query = "UPDATE items SET Qty=Qty-(" . $row[''Quantity''] . ") WHERE RegistrationNumber = ''" . $row[''Barcode''] . "''";\r\n                nuRunQuery($query);\r\n                //echo "Okamzity odpis : " . number_format($row[''Quantity''], 2, ''.'', '' '') . " x " . $row[''Barcode''] . " " . " (" . number_format($row[''Quantity''], 3, ''.'', '' '') . ")<br/>";\r\n        //echo ''<hr/>'';\r\n    }\r\n\r\n    mysql_free_result($table);\r\n\r\n//posdb02\r\n\r\nif($posdb02 == 1)\r\n{\r\n        $query = "SELECT posdb01.items_content.ContentFrom as Barcode, sum(posdb02.invoices_items.Quantity*posdb01.items_content.Quantity) as Quantity from posdb02.invoices_items inner join posdb01.items_content on posdb01.items_content.RegistrationNumber=posdb02.invoices_items.Barcode WHERE posdb02.invoices_items.Synchronized!=3 group by posdb01.items_content.ContentFrom";\r\n    \r\n    $table = nuRunQuery($query);\r\n\r\n    while ($row = db_fetch_array($table)) {\r\n                $query = "UPDATE items SET Qty=Qty-(" . $row[''Quantity''] . ") WHERE RegistrationNumber = ''" . $row[''Barcode''] . "''";\r\n                nuRunQuery($query);\r\n                //echo "Odpis zo zlozenia : " . number_format($row[''Quantity''], 2, ''.'', '' '') . " x " . $row[''Barcode''] . " " . " (" . number_format($row[''Quantity''], 3, ''.'', '' '') . ")<br/>";\r\n        //echo ''<hr/>'';\r\n    }\r\n\r\n    mysql_free_result($table);\r\n\r\n    $query = "SELECT posdb02.invoices_items.Barcode as Barcode, posdb02.invoices_items.Quantity as Quantity from posdb02.invoices_items left join posdb01.items_content on posdb01.items_content.RegistrationNumber=posdb02.invoices_items.Barcode WHERE posdb02.invoices_items.Synchronized!=3 and posdb01.items_content.RegistrationNumber is null";\r\n    $table = nuRunQuery($query);\r\n\r\n    while ($row = db_fetch_array($table)) {\r\n                $query = "UPDATE items SET Qty=Qty-(" . $row[''Quantity''] . ") WHERE RegistrationNumber = ''" . $row[''Barcode''] . "''";\r\n                nuRunQuery($query);\r\n                //echo "Okamzity odpis : " . number_format($row[''Quantity''], 2, ''.'', '' '') . " x " . $row[''Barcode''] . " " . " (" . number_format($row[''Quantity''], 3, ''.'', '' '') . ")<br/>";\r\n        //echo ''<hr/>'';\r\n    }\r\n\r\n    mysql_free_result($table);\r\n    \r\n    $query = "SELECT posdb01.items_content.ContentFrom as Barcode, sum(posdb02.invoices_items_month.Quantity*posdb01.items_content.Quantity) as Quantity from posdb02.invoices_items_month inner join posdb01.items_content on posdb01.items_content.RegistrationNumber=posdb02.invoices_items_month.Barcode WHERE posdb02.invoices_items_month.Synchronized!=3 group by posdb01.items_content.ContentFrom";\r\n    \r\n    $table = nuRunQuery($query);\r\n\r\n    while ($row = db_fetch_array($table)) {\r\n                $query = "UPDATE items SET Qty=Qty-(" . $row[''Quantity''] . ") WHERE RegistrationNumber = ''" . $row[''Barcode''] . "''";\r\n                nuRunQuery($query);\r\n                //echo "Odpis zo zlozenia : " . number_format($row[''Quantity''], 2, ''.'', '' '') . " x " . $row[''Barcode''] . " " . " (" . number_format($row[''Quantity''], 3, ''.'', '' '') . ")<br/>";\r\n        //echo ''<hr/>'';\r\n    }\r\n\r\n    mysql_free_result($table);\r\n\r\n    $query = "SELECT posdb02.invoices_items_month.Barcode as Barcode, posdb02.invoices_items_month.Quantity as Quantity from posdb02.invoices_items_month left join posdb01.items_content on posdb01.items_content.RegistrationNumber=posdb02.invoices_items_month.Barcode WHERE posdb02.invoices_items_month.Synchronized!=3 and posdb01.items_content.RegistrationNumber is null";\r\n    $table = nuRunQuery($query);\r\n\r\n    while ($row = db_fetch_array($table)) {\r\n                $query = "UPDATE items SET Qty=Qty-(" . $row[''Quantity''] . ") WHERE RegistrationNumber = ''" . $row[''Barcode''] . "''";\r\n                nuRunQuery($query);\r\n                //echo "Okamzity odpis : " . number_format($row[''Quantity''], 2, ''.'', '' '') . " x " . $row[''Barcode''] . " " . " (" . number_format($row[''Quantity''], 3, ''.'', '' '') . ")<br/>";\r\n        //echo ''<hr/>'';\r\n    }\r\n\r\n    mysql_free_result($table);\r\n}\r\n\r\n//posdb02\r\n\r\n    $query = "SELECT items_content.ContentFrom as Barcode, sum(invoices_items_month.Quantity*items_content.Quantity) as Quantity from invoices_items_month inner join items_content on items_content.RegistrationNumber=invoices_items_month.Barcode WHERE invoices_items_month.Synchronized!=3 group by items_content.ContentFrom";\r\n    \r\n    $table = nuRunQuery($query);\r\n\r\n    while ($row = db_fetch_array($table)) {\r\n                $query = "UPDATE items SET Qty=Qty-(" . $row[''Quantity''] . ") WHERE RegistrationNumber = ''" . $row[''Barcode''] . "''";\r\n                nuRunQuery($query);\r\n                //echo "Odpis zo zlozenia : " . number_format($row[''Quantity''], 2, ''.'', '' '') . " x " . $row[''Barcode''] . " " . " (" . number_format($row[''Quantity''], 3, ''.'', '' '') . ")<br/>";\r\n        //echo ''<hr/>'';\r\n    }\r\n\r\n    mysql_free_result($table);\r\n\r\n    $query = "SELECT invoices_items_month.Barcode as Barcode, invoices_items_month.Quantity as Quantity from invoices_items_month left join items_content on items_content.RegistrationNumber=invoices_items_month.Barcode WHERE invoices_items_month.Synchronized!=3 and items_content.RegistrationNumber is null";\r\n    $table = nuRunQuery($query);\r\n\r\n    while ($row = db_fetch_array($table)) {\r\n                $query = "UPDATE items SET Qty=Qty-(" . $row[''Quantity''] . ") WHERE RegistrationNumber = ''" . $row[''Barcode''] . "''";\r\n                nuRunQuery($query);\r\n                //echo "Okamzity odpis : " . number_format($row[''Quantity''], 2, ''.'', '' '') . " x " . $row[''Barcode''] . " " . " (" . number_format($row[''Quantity''], 3, ''.'', '' '') . ")<br/>";\r\n        //echo ''<hr/>'';\r\n    }\r\n\r\n    mysql_free_result($table);\r\n\r\n    $query = "SELECT items_content.ContentFrom as Barcode, sum(lead_sheets_items.Qty*items_content.Quantity) as Quantity from lead_sheets_items inner join items_content on items_content.RegistrationNumber=lead_sheets_items.Barcode group by items_content.ContentFrom";\r\n    \r\n    $table = nuRunQuery($query);\r\n\r\n    while ($row = db_fetch_array($table)) {\r\n                $query = "UPDATE items SET Qty=Qty+(" . $row[''Quantity''] . ") WHERE RegistrationNumber = ''" . $row[''Barcode''] . "''";\r\n                nuRunQuery($query);\r\n                //echo "Pripocitanie zo zlozenia : " . number_format($row[''Quantity''], 2, ''.'', '' '') . " x " . $row[''Barcode''] . " " . " (" . number_format($row[''Quantity''], 3, ''.'', '' '') . ")<br/>";\r\n        //echo ''<hr/>'';\r\n    }\r\n\r\n    mysql_free_result($table);\r\n\r\n\r\n    $query = "SELECT lead_sheets_items.Barcode as Barcode, lead_sheets_items.Qty as Quantity from lead_sheets_items left join items_content on items_content.RegistrationNumber=lead_sheets_items.Barcode WHERE items_content.RegistrationNumber is null";\r\n    $table = nuRunQuery($query);\r\n\r\n    while ($row = db_fetch_array($table)) {\r\n                $query = "UPDATE items SET Qty=Qty+(" . $row[''Quantity''] . ") WHERE RegistrationNumber = ''" . $row[''Barcode''] . "''";\r\n                nuRunQuery($query);\r\n                //echo "Okamzite pripocitanie : " . number_format($row[''Quantity''], 2, ''.'', '' '') . " x " . $row[''Barcode''] . " " . " (" . number_format($row[''Quantity''], 3, ''.'', '' '') . ")<br/>";\r\n        //echo ''<hr/>'';\r\n    }\r\n\r\n    mysql_free_result($table);\r\n    \r\n    $query = "UPDATE invoices_items SET Synchronized=1 WHERE Synchronized=2";\r\n    nuRunQuery($query);\r\n    $query = "UPDATE invoices_items_month SET Synchronized=1 WHERE Synchronized=2";\r\n    nuRunQuery($query);\r\n}');
